(16361, 'Garden Coloring Book', 4, 15, 1, 7059, 4.4, 13791, '33M', 0.00, '2017-09-20', '2.9.2', '3.0 and up', 'https://play-lh.googleusercontent.com/uZwZVjklg6TUk2N9H9KltSdp7XxdIzRFT71XDi0qJRnBOCGYubHJLbcerg7BWd-XhQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.iscoolentertainment.snc', 'Easy to play Garden of Words is a word game that makes learning fun! Play every day and improve your spelling! Memorize new words and expand your vocabulary! - Simple and accessible: slide your finger on the letters to make a word. - Original and fun: the crossword puzzle gives you hints about the words you can find. - Enjoy the different and colorful garden backgrounds! The calm and cozy atmosphere will help you concentrate when looking for words. - Over 700 puzzles in 8 languages with regular updates each week! - Thousands of hidden words to unlock thanks to our comprehensive dictionaries! Win coins with each bonus word you find. - Can\'t think of a word in a puzzle? Use a hint to uncover a letter on the board! - Play offline anywhere anytime! Once you start to play you\'ll never want to stop!'),
(16371, 'FlipaClip - Cartoon animation', 4, 16, 1, 10784, 4.3, 194216, '39M', 0.00, '2018-08-03', '2.2.5', '4.0.3 and up', 'https://play-lh.googleusercontent.com/uBXSQUBUC4lIOUhkJEAJaj-r-Y6ZffyYCjjjTMPKBkab-w8R9hEsvhhmt4Wv6bbymdk=s180-rw', 'https://play.google.com/store/apps/details?id=com.pikpok.cf.play', 'Transform an unproven college football team into American Legends! As the head coach of a college football program you make the calls. Recruit fresh talent build an unbeatable playbook and make risky plays for big payoffs. Join forces with players from around the world to form alliances and take on rivals. With big dreams and even bigger challenges the team will rely on your leadership to take them to the top. Will they make it to the Hall of Legends? Rise to the challenge with Rival Stars College Football! FEATURES: ? Hundreds of athletes to recruit train and level up. Boost player performance and propel your team towards legend status! ? Manage YOUR team YOUR way. Develop winning strategies call the plays and make tough decisions on the field! ? Action-packed live global tournaments have you going head to head against real world opponents! Rise through the ranks to win big rewards! ? Team up with others by joining an alliance or forming your own. Share strategies chat with friends and compete against rivals. ? Witness the hard hits and big plays up close in game highlights! Rival Stars College Football is free to play but offers some game items for purchase with real money. This app includes advertising some of which may be targeted to your interests. You may choose to control targeted advertising by using your mobile device settings (for example by re-setting your device s advertising identifier and/or opting out of interest based ads). The app also includes: - In-app purchases that cost real money - The option to accept push notifications to let you know when we have exciting updates like new content - Advertising for some third parties including the option to watch ads for rewards'),
