(16389, 'Floor Plan Creator', 4, 16, 1, 5887, 4.1, 36639, 'Varies with device', 0.00, '2018-07-14', 'Varies with device', '2.3.3 and up', 'https://play-lh.googleusercontent.com/jX_kGg-7X1vbUjbh6MzfwEtjTCY0kl_h7YwgGnHPN9v_t_ZwD-o8bce6wSjN1jfrGEy9=s180-rw', 'https://play.google.com/store/apps/details?id=com.wonggordon.bgmonitor', '*** Healthline\'s Best Diabetes App of 2018! *** BG Monitor is a new diabetes tool made for how you want to manage your diabetes. Blood glucose trends are identified to notify you of needed adjustments - saving you from staring at your logbook. Insulin is automatically calculated when you enter your blood glucose and food so that you can quickly get back to what matters most. Finally a diabetes app that\'s as smart as you. TRACK EVERYTHING Record your blood glucose food insulin exercise and more. Tag your entries to find them faster or take a picture of your meal to remember exactly what you ate. SMART ANALYSIS Gain insight into your numbers without the work. Automatically identifies trends and notifies you if adjustments are needed. DETAILED STATISTICS Track your progress with comprehensive statistics and graphs. Filter your data and search by date to find exactly what you\'re looking for. SEND REPORTS IN SECONDS Don\'t waste time creating a spreadsheet. Instantly share reports of how you\'re doing with your doctor and loved ones. BUILT FOR YOU Dial in your targets and ratios to automatically calculate insulin for each meal. Supports both U.S. and international units of measurement (mg/dL and mmol/L). GET THINGS DONE Designed for speed so you can get back to what matters most. Create entries right from your home screen or record blood glucose directly from reminders. Need help? Visit https://www.bg-monitor.com/ Know another language? Help translate at https://gowong.oneskyapp.com/collaboration/project?id=47648'),
