(16413, 'CDL Practice Test 2018 Edition', 16, 13, 1, 5674, 4.9, 7774, '17M', 0.00, '2018-07-03', '1.7', '4.2 and up', 'https://play-lh.googleusercontent.com/_E2zIu_qzoXtJd4CVN8YnK0dqvbt11Ef3h466IDQAidsZE_w8L7FFoUFq-QqwcxHBM8=s180-rw', 'https://play.google.com/store/apps/details?id=com.sn.generaladaptiveapps', 'sn - 11th in \'focus\' (aa uu ff au rr ao rl sp th ki ci sn lo ba ov sh fi do ru & ti) sn is a truly modern snake. Touch and drag to move the dot connect it to as many other dots as you can without colliding with your tail. The more in your tail the harder it gets - but the dynamic doesn\'t change simple. You can also top the leaderboard and compete for the best score / longest tail. Get stuck into the addiction of sn right now a great new addition to your collection of focused General Adaptive apps. Thanks for all your support I hope you\'re enjoying the \'focus\' series thus far. Handmade in Australia General Adaptive'),
