(16440, 'AutoScout24 Switzerland - Find your new car', 16, 15, 1, 1464, 4.6, 13372, 'Varies with device', 0.00, '2018-08-03', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/Qa90bmVrFgO950-lwOLTAkHllRsO_rBD9vRwN5q1pd_i2wQePAnTs17P2jExz40W_uQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.autoscout24', 'AutoScout24 is the largest online marketplace for cars in Europe and offers about 2 million vehicles. With the AutoScout24 Android app you can access the online car and motorbike marketplace anytime from anywhere. Save your favourite search results and view them offline. In addition to the vehicle search the AutoScout24 Android App also offers a magazine area with interesting test reports and just everything about cars the purchase and sale of cars. ______________________________________________ AND THIS IS HOW YOU START YOUR CAR SEARCH ? Choose make model price and further criteria ? Conduct a local search and save it ? Sort search results by price color or further criteria ? Save your favorites ? Call seller directly via the app ______________________________________________ THE FUNCTIONS AT A GLANCE ? Car and motorbike search ? Search in whole Europe (GER FR IT ES NL AT LUX BE and RU) ? Individual arrangement of results (price registration date mileage performance and more) ? Saved Searches: Save your individual search options easily in one inquiry for the next time. ? Favorites (view favorite cars offline) ? Synchronisation of your favorites between app and web ? Picture gallery with preview and zoom ? Direct contact with the seller ? Change important data of your ads i.e. Pictures Price or Mileage ? Link and share ads with your family friends and other via email Facebook or Twitter ? AutoScout24-magazine - interesting test reports about vehicles and all about cars car purchase and sales ______________________________________________ Do you have any questions or comments? Write us to apps-com@autoscout24.com.'),
