(16517, 'Ancestry', 7, 16, 1, 15391, 4.3, 64513, 'Varies with device', 0.00, '2018-07-31', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/BMa4hX8FMAF5OYdQw1If0NIue7VAd2JgALWy0RnRRfflRViaUKTFBWlHZaokuNw0MO0=s180-rw', 'https://play.google.com/store/apps/details?id=brandenburg.bvg', 'Traffic jams the search for parking spots or a missed train connection: commuting into Berlin can be stressful. With the BerlKonig BC you now have a comfortable alternative. BerlKonig BC is a new flexible shuttle bus by the BVG operating in the outskirts of Berlin. The route connects Schulzendorf as well as parts of Waltersdorf and Zeuthen (in Dahme-Spreewald) with public transit in Berlin (U Rudow S Flughafen BER Terminal 5 S Eichwalde) Mondays to Fridays during the commuting hours. From there you can reach the city quickly by train or bus. On top of having to hold a valid VBB/BVG (A)BC ticket a ride costs just 50 Euro cents. Thanks to a wealth of virtual bus stops employed by the service the BerlKonig BC stops almost at your doorstep. This means you can now leave your personal vehicle at home during the week - not only protecting your nerves but also the environment. And this is how the BerlKonig BC works: 1. Download and register app: Download the BerlKonig BC App on your smartphone and register by simply typing your name and email address and choosing a payment method. 2. Pre-booking rides: Book your journeys up to a month in advance. Note that your ride must either start or end at a public transit station. Then select a time slot for your departure. To make the ride with the BerlKonig BC as comfortable as possible you can set recurring bookings. The app confirms these pre-booked trips just minutes later. 3. Being picked up: 30 minutes before departure you will be informed by SMS of your exact pick-up time and exact pick-up location close to your front door. You can also track the approaching vehicle in the app. Head to your nearby pickup location the BerlKonig BC will meet you there and off you go! The cost per trip is always 50 cents. In addition you need to hold a valid BVG ticket when you start your ride; if you do not have one you can purchase it from our driver or through the BVG Ticketing app With the BerlKonig BC we efficiently bundle travel wishes of several passengers between the public transit stations and the service area. In this way we bring each passenger efficiently to their destination reducing detours and congestion. Overall this means you can now leave your personal vehicle at home during the week - not only protecting your nerves but also the environment. The BerlKonig BC is funded by the Federal Ministry of Transport and Digital Infrastructure (BMVI). More information can be found at www.bvg.de/berlkoenigBC.'),
