(16755, 'BBW Dating & Plus Size Chat', 14, 15, 4, 5882, 4.4, 12632, '29M', 0.00, '2018-07-27', '3.5.0.1', '4.1 and up', 'https://play-lh.googleusercontent.com/iMc1P4fc7bMSVvQaztKcoQ5MS1J7OLu0bOkz2kVnXZTYkiJ_k3AluzkvOAntYCthgOXQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.google.android.youtube.tvkids', 'A video app made just for kids YouTube Kids was created to give kids a more contained environment that makes it simpler and more fun for them to explore on their own and easier for parents and caregivers to guide their journey as they discover new and exciting interests along the way. Learn more at youtube.com/kids A safer online experience for kids We work hard to keep the videos on YouTube Kids family-friendly and use a mix of automated filters built by our engineering teams human review and feedback from parents to protect our youngest users online. But no system is perfect and inappropriate videos can slip through so we re constantly working to improve our safeguards and offer more features to help parents create the right experience for their families. You can also customize your families experience you can turn search on or off while using YouTube Kids on TV. Or check your child s watch history with the  Watch it Again  feature. Customize your child s experience with individual profiles Create individual experiences as unique as your kids on our mobile app and use them on your TV or on the web. First download YouTube Kids from the iOS App Store or Google Play store on a mobile or tablet device then log in to create profiles. Every profile has its own viewing preferences video recommendations and settings. Select an age category that fits your child \'Preschool\' (4 & under) \'Younger\' (5-7) or \'Older\' (8+) or choose \'Approved Content Only\' mode. If you select \'Approved Content Only\' you can handpick the videos channels and/or collections that you ve approved for your child to watch. In this mode searching for videos is unavailable. Approved videos must first be selected on your mobile or tablet device. Once chosen they will be reflected on all your devices with YouTube Kids. All kinds of videos for all kinds of kids Our library is filled with family-friendly videos on all different topics igniting your kids  inner creativity and playfulness. It s everything from their favorite shows and music to learning how to build a model volcano (or make slime!) and everything in between. Other important information: Parental setup is needed to ensure the best experience possible for your kid. YouTube Kids contains paid ads in order to offer the app for free. Your kid may also see videos with commercial content from YouTube creators that are not paid ads.The Privacy Notice for Google Accounts managed with Family Link describes our privacy practices when your kid uses YouTube Kids with their Google Account. When your kid uses YouTube Kids without signing into their Google Account the YouTube Kids Privacy Notice applies.'),
