z: Get daily GK quiz. Quizzing is proven technique to recall what you studied. It will help you to memorize the questions you attempted. 5) Free eBook Download: Get unlimited free eBooks & GK PDFs for Monthly GK capsules Static GK eBooks for Banking Science Economy & all other important exam topics 6) Tests and Analyse: Learn from Daily GK Cards Blogs and Video Lessons and Practice GK Mock Test to check your Knowledge. The Analysis feature lets you not only get scorecard but also helps you analyse how well you performed and where you went wrong. Practice GK Tests of the following: - Monthly Current Affairs 2019 & 2020 - Computer Knowledge - Economy - History & Geography - Culture Books and Awards - Countries & Capitals - Polity and Governance - Sports - Bank & Insurance - Dates & Committees - Science & Technology Latest Current Affairs & GK App by Oliveboard aims at providing high-quality study material to its users to keep them updated not only about latest happenings but also about past events. It is useful for all major government exams.'),
