hey sometimes weave in too much mystic talk for my taste. But Calm instead contains guidance like  Concentrate on your body   - New York Times *  In the frenetic crazy digital world we live in sometimes it\'s necessary to take a step back and smell the roses  - Mashable *  Eliminating distraction...ended up helping me relax and realize that all the stuff I was stressing about wasn\'t that big a deal  - Tech Republic *  Found myself similarly refreshed afterwards  - TechCrunch Calm is free to download and use and there are no ads. A subset of the programs and features are free forever. Some content is only available through an optional paid subscription. If you choose to subscribe payment will be charged to your Google Account at confirmation of purchase.'),
