(17438, 'Eat Fit - Diet and Health Free', 20, 13, 1, 4470, 4.1, 2469, '3.6M', 0.00, '2014-07-23', '1.0.9', '2.3 and up', 'https://play-lh.googleusercontent.com/N5QVOw5rs2NT0Fc3aXdp5Dyp0TvayEOJgCLl_SIPzgZBLihIoT2rdaVsK115i7KUNLr4=s180-rw', 'https://play.google.com/store/apps/details?id=com.ew.eatitaly', '****The Foodies Guide to Italy**** Italy is one of the great tourist destinations in the world. Renaissance palaces Rome s Colosseum and Michelangelo s David draw millions of visitors a year . But tourism has its price and finding authentic restaurants bakeries and gelaterie is a challenge. With Elizabeth Minchili s EAT ITALY in your pocket you ll be sure that every morsel of food you put in your mouth while you re in ITALY is the best.  Savvy advice for the traveler to Italy  USA Today  It was a kind of experience you just don t get if you re wandering around by yourself  The New York Times  Expert advice on how to eat and shop in Rome  The Wall Street Journal  My favorite expert on all things edible in Italy is Elizabeth Minchilli  Huffington Post Travel HOW THIS APP CAN HELP YOU: EXPERT FOOD ADVICE: Minchilli has been reporting on the food scene in Italy for magazines and newspapers for years and is the go-to source for insiders. MORE than just restaurants you ll find bakeries wine bars food stores hotels and more. MORE lively and opinionated content. Minchilli lets you know the score telling you what you ll expect and what to look for. DELICIOUS picks in ROME VENICE FLORENCE MILAN and more cities and regions. UPDATES: Minchilli is always working on this app! Both the content and the software are always kept up to date. New restaurants and new cities and regions are always being added. PRAISE FOR MINCHILLI AND HER EAT APPS: Travel & Leisure:  Top Italian Food Guide App  Huffington Post:  The go-to food app to help me eat better.  Los Angeles Times:  Thank goodness for Elizabeth Minchilli s apps.  The New York Times:  A local expert who brings the hungry to hidden culinary landscapes.  Frank Bruni New York Times:  Trust me no one knows food in Rome like Elizabeth does.  WHAT CAN I DO WITH THIS APP? Avoid tourist traps and go straight to the best Browse through hundreds of carefully selected entries. One click website links go directly to the source Share reviews and photos Highlight favorites See what s near you and navigate your way to your next meal Access offline content anytime anywhere. View 1000 s of mouthwatering photographs. EAT ITALY is a free app. Rome Venice and Florence are available as in-app purchases. The remaining and ever-expanding cities and regions are completely free of charge. ***About the Author*** Elizabeth Minchilli has been eating her way through Italy her entire life. She is the author of nine books on Italian living including Eating Rome: Living the Good Life in the Eternal City and her most recent Eating My Way Through Italy. Her app EAT ITALY has remained a best-seller on iTunes since it was first published in 2010. She has contributed to over forty magazines and newspapers including Bon Appetit Food & Wine and The International Herald Tribune. She writes about all the good and delicious stuff on her blog Elizabeth Minchilli in Rome. You can follow her on Instagram eminchilli.'),
