(17441, 'Binaural Beats Therapy', 20, 15, 1, 13973, 4.3, 13724, 'Varies with device', 0.00, '2017-08-17', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/a0qU9vH292kX9JjXHDhUDM8xkUf7fOtVAgQ73t2jfmBQXzNbV--RAXYnLoK7NI_ayhw=s180-rw', 'https://play.google.com/store/apps/details?id=com.tmsoft.whitenoise.generator.beats', 'Generate custom binaural beats around any base frequency including Alpha Beta Delta Gamma Mu and Theta waves. Simple modern interface allows selecting Binaural Beats from 1 to 50 Hz and a Base Frequency from 20 to 1500 Hz. Binaural Beats require high quality headphones or stereo speakers. What are binaural beats? Binaural beats can help with sleep focus and meditation. They are an auditory illusion perceived when two different tones of slightly different frequency are presented to each ear. The frequencies are very low and each one is tuned specifically for each ear which is why headphones are required. What are the different types of binaural beats? - Alpha waves are associated with a restful and relaxed state that exists when both entering and exiting sleep. - Beta waves are associated with concentration and moderate alertness. - Delta waves are associated with deep sleep cycles and the release of physical awareness. - Gamma waves are associated with alertness and sensitive perception. - Mu waves are associated with a state of physical rest stillness and immobility. - Theta waves are associated with the heavy relaxation that comes from frequency deep meditation. Directions: Drag slider to select a desired Binaural Beat from 1 to 50 Hz. Next drag the base frequency to a tone that sounds pleasant to your ears. The binaural beat is generated around this base frequency. Adjust device volume using the on-screen volume slider to a comfortable level. Toggle audio playback using the Play/Pause button. Created by the audio experts at TMSOFT that brought you the famous White Noise app. Check out all our apps and sounds at http://www.tmsoft.com/'),
(17447, 'Brain Waves - Binaural Beats', 20, 14, 1, 9766, 4.4, 5038, '10M', 0.00, '2018-07-15', '5.2', '4.4 and up', 'https://play-lh.googleusercontent.com/5ZpcdH9Y9mjquZYiZlIP4rPl5JF5gms2_HovskGxLdcJuya8qhxjRYo4xfHcb-ZKumsA=s180-rw', 'https://play.google.com/store/apps/details?id=net.luizmello.brainwaves', 'With this app you can easily generate pure waves that will stimulate your concentration meditation or relaxation. Very Important - Use headphones for a better sound experience - Don\'t use this app while driving or operating heavy machinery. - Take care of your hearing is not necessary to hear these sounds at high volume. You can generate and save your own frequencies using two independent oscillators controlled by two horizontal bars with fine adjust buttons or directly by input the desired value you want (tap the left or right frequency value to open the input dialog). You can use values with two decimal points (eg 125.65). The sounds are produced in real time they are not pre-recorded sounds. This enables to play them without interruption as long you want. How it works Binaural beats or binaural tones are auditory processing artifacts or apparent sounds caused by specific physical stimuli. This effect was discovered in 1839 by Heinrich Wilhelm Dove and earned greater public awareness in the late 20th century based on claims coming from the alternative medicine community that binaural beats could help induce relaxation meditation creativity and other desirable mental states. The effect on the brainwaves depends on the difference in frequencies of each tone: for example if 300 Hz was played in one ear and 310 in the other then the binaural beat would have a frequency of 10 Hz. To experience the binaural beats perception it is best to listen to this file with headphones on moderate to weak volume - the sound should be easily heard but not loud. Note that the sound appears to pulsate only when heard through both earphones. For more info visit: https://en.wikipedia.org/wiki/Binaural_beats Important For best results please use headphones. Take care of your hearing is not necessary to hear these sounds at high volume. The bottom slide bar controls the volume but it is independent of your device\'s volume so if there is no sound or it\'s too high also set your device\'s volume to balance the sound. Also Important Latest Android versions are evolving to manage system recourses and automatically slow down the cpu usage for optimize resources. The real time audio synthesis like we use in our apps is a very sensitive process when the OS is trying to stop or decrease cpu usage for this main thread. If you have some issue playing the audio please follow the instructions in this link: https://dontkillmyapp.com Manage Presets You can save a preset directly from the main screen by clicking on the top button \'Tap to Save\' the current values are loaded automatically to the next screen. Then just type a name and click Save. To load a preset click on Presets in the main screen and then choose a preset by clicking on its name. To delete a preset simply click on the trashcan button. Running in background To let the app running in the background just press the \'Home\' button on your device. If you press the \\\'Back\\\' button the app will close. Timer Just type a value in minutes. The app will shutdown automatically when the time ends. Wave Types Theta Meditation Intuition Memory Delta Healing Deep Sleep Detached Awareness Alpha - Relaxation Visualization Creativity Sleep Theta Meditation Intuition Memory Gamma Inspiration Higher Learning Focus Beta Alertness Concentration Cognition Main features: - Meditation helper; - Concentration to study; - Relaxing Sounds; - Help to fall asleep; - Noise Block; - Anti-stress; - It will provide continuous sounds generate binaural beats in real time no loops; - Works in background just press the \'Home\' button or use in app shortcut;'),
