eful It is always good and easy to use a single Universal remote control device to control all you electronic equipments. As mobile phone has become a major gadget that people always carry with them so having an application installed on your mobile device that works as a TV remote control will make your life easier. Very easy to Contact Us CodeMatics very cordial Customer Support is here to assist you in anything you need. Our team is working continuously to include maximum TV brands and functionalities. The smart remote control app is being updated accordingly. If your brand is not listed or the TV remote control application is not working with your television please drop us an email with your TV brand and remote model. We will work on to make this application compatible with your TV brand. Features of Traditional IR Universal Remote Control: - Power ON / OFF Control. - AV / TV. - Mute / Un-Mute. - Channel Digits buttons. - Channel index and lists. - Volume Up Control. - Volume Down Control. - Channel Up Control. - Channel Down Control. - Menu Button with up / down and left / right Controls. - Red / Green / Blue / Yellow (Multiple purpose soft keys). Note: - Phone or Tablet with built in IR blaster is required for the Traditional IR TV devices. - For Smart TVs / devices both the smartTV device and user\'s mobile device must be connected to the same network. - This app is compatible with the TV brands / models currently available in the app. This is an unofficial TV remote application for these Television brands. - \'Email us\' the Model of your TV and we will try our best to make it available as soon as we possibly can. Your patience and positive feedback will be highly appreciated. ENJOY!!!! Your feedback is very important to us.'),
(17486, 'Alfred Home Security Camera', 21, 16, 1, 790, 4.5, 103305, 'Varies with device', 0.00, '2018-07-31', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/DRVzqtnMKH7ZttTNK58zqjya5s70rRPUiiGrw8lAPeCqk5cZlUfcsYKr6um3JH-oXJM=s180-rw', 'https://play.google.com/store/apps/details?id=com.ivuu', 'Over 25 million families around the world have chosen Alfred Camera to secure their home. We are the world\'s most popular and top-rated app for home security. SECURITY CAMERA FOR THE SMARTPHONE AGE People love Alfred Camera! The all-in-one app provides more features than a basic expensive security camera. You can get live stream instant intruder alert low-light filter walkie-talkie and unlimited cloud storage to store share and playback your video footage. FREE STABLE RELIABLE If you want a CCTV to keep an eye on your belongings a baby monitor to look after your newborn or a pet cam to entertain your lovely pets Alfred Camera is the best choice! SUPER EASY TO SET UP DIY your own home security camera in 3 minutes. No cost no hard skills; just one creative idea! Alfred Camera is the easiest-to-install home surveillance system with professional-grade features period. ANYTIME ANYWHERE To defend your front door and backyard you don t even need a security guard! Alfred will take care of what matters the most. Unlike traditional CCTV cameras or home surveillance cameras you can put Alfred wherever you need to strengthen security. What\'s more you can add or remove the camera whenever you like. If you rent an apartment you might want to make sure that your landlord or roommate doesn t enter without permission. When you travel you might want to make sure your hotel room is safe. In either case you need a portable video monitor. After all if anything like theft or breaking in happens the video footage will be extremely helpful. SIMPLE SECURITY AT YOUR FINGERTIPS With crystal clear live stream you\'ll always know exactly what\'s going on no matter where you are. Additionally Alfred\'s motion sensor will send you an instant alert when it finds an intruder. You can scare the intruder away by speaking through the walkie-talkie immediately. The auto-recorded videos will be kept in free unlimited cloud storage. You can download them and use them as evidence to help identify the suspect. FEATURES Alfred Camera has all of the standard features of a home security camera along with the following: - 24/7 LIVE STREAM: Watch the high-quality live video from anywhere. - SMART INTRUDER ALERT: Get instant alert when the camera picks up any movement. - UNLIMITED CLOUD STORAGE: Playback download and share your video footage at any time. - LOW-LIGHT FILTER: Reinforce security when it\'s dark. - WALKIE-TALKIE: Deter thieves interact with visitors or pets and soothe babies. - ZOOM SCHEDULE REMINDER TRUST CIRCLE SIREN and more... A housekeeper you can really trust! Works smoothly via WiFi 3G and LTE. SMART CONVENIENT ECO-CONSCIOUS First time choosing a CCTV camera? Still hoping to find good reviews on expensive baby monitor pet cam or IP camera? You can protect your home with a smarter solution. Here\'s a tip: You might not even need to buy a real CCTV camera baby monitor IP cam or IP webcam. Besides the cost of the equipment these smart home appliances often charge a monthly fee. With security apps like Alfred there is no complicated installation IP settings or contract. You only have to download Alfred to repurpose your old devices as a DIY WiFi Camera or baby monitor: pure and simple. The best home surveillance camera you can ever find: Free reliable versatile and easy to use. No hidden upfront costs or astronomical monitoring fees. Alfred is also an essential component of any home improvement or home automation project if you are interested in building a smart home or experimenting with Google Assistant. Everyone is taking advantage of their unused smartphones by turning them into video players GPS navigators or fitness devices. So why not use yours as a baby cam nanny cam pet cam webcam or IP cam? Some features of this app require Device Administrator permission.'),
