ave data to your SD card or phone Network communication: To support saving data to Google Fit Phone call: You can still receive important phone calls during workouts System tools: This permission is for starting up notifications after rebooting the phone Hardware controls: For notification vibration Fitness App Multiple abs workouts are available to help you get six pack abs. Follow your personal trainer and expert workouts six pack abs is within your reach! Short Workouts We have short workouts for people who don t have much time to exercise you will get the sweats and fast heartbeat in a few minutes. These HIIT (high-intensity interval training) can maximize the results. Workout at Home Take a few minutes a day to lose weight and keep fit effectively with our workout at home. No equipment needed just use your bodyweight to workout at home. Fat Burning Workouts & Hiit Workouts The best fat burning workouts & hiit workouts for better body shape. Burn calories with fat burning workouts and combine with hiit workouts to get the best results. Fitness Coach All workouts are designed by professional fitness coach. Workout guide through the exercise just like having a personal fitness coach in your pocket!'),
(17494, 'Apartment Decorating Ideas', 21, 13, 1, 2955, 3.9, 1478, '5.7M', 0.00, '2015-03-13', '1.2', '3.0 and up', 'https://play-lh.googleusercontent.com/4YoAHcM90YH7Pxzb8yzhUxhKdj0aqFxaZ_C4arXVgXga3EBazQgX2J3qlDIdVsbE8YEh=s180-rw', 'https://play.google.com/store/apps/details?id=co.uk.youandb.android.b', 'Say hello to a liberating new way to manage your money. B is a new digital banking service for tablet and mobile that brings together a current and savings account into one amazing personal finance app. B helps put you back in charge With tons of clever tools including a money dashboard B has everything you need to help you take control of your finances. B can give you a hand planning to save for that special something or let you know if it thinks you are getting carried away with your spending. So you can spend and save on your own terms. B can make your money simple B s clever budgeting tools have been designed to help make your everyday banking simple and intuitive. From the moment you start using the B app making a payment or checking your spending is just a few taps away. B puts you in the know The more B learns about you the more it can teach you about your money. So the more you use it the more it can help you. B looks at how you spend your money and serves up useful tips insights and stories on your spending. Key Features -B automatically and smartly tags all of your spending into categories like food travel and eating out. You can also add your own custom tags. -B lets you set up as many Savings Pots as you like and helps you decide how much you can save and when. You can even give your pots a name like  Weekend in Paris  or  Brand Spanking New Car . -With smart budgeting tools B always keeps an eye on your money and will send you alerts when it thinks you need to rein in your spending. You can also set up automatic sweeps between accounts. -B s supercharged search makes it easy to check transactions and you can filter and sort them to see exactly what you ve been spending from clothes to coffee. -B aims to surprise you with facts and money saving tips that show exactly where your money goes and how it could go further - like showing you all the things you have bought under a tenner. -As B learns more about your spending habits it ll look ahead and predict how the end of your month might work out and the best way to save money. It can give you plenty of warning if things look tight or if it looks like you ve got a little extra to spend or save. -B is powered by the people at Clydesdale Bank and Yorkshire Bank who are building on 175 years of doing what s right for customers and inspired by all the new opportunities technology brings. -Device Requirements apply subject to status & eligibility. See youandb.co.uk for full T&C s. To get full functionality both a compatible smartphone & tablet are required. -You can check if your device is compatible at youandb.co.uk/the-account/devices/ Yorkshire Bank is a trading name of Clydesdale Bank PLC. -How to Register. To register for the B app you need a B account. If you don\'t have one already visit www.youandb.co.uk for more info. -If you do have one registration is easy. First download the B app to your device. You\'ll then be guided through the process. Before you start you\'ll need: -Your customer number or user name -The mobile phone linked to your account (as we\'ll send you a text with a code for you to enter) -If you\'ve already registered for Internet Banking your B password if not don\'t worry you\'ll be asked to do this as part of the app registration. Once you\'ve registered you can start using the app straight away.'),
