(17510, 'Chakra Cleansing', 22, 12, 1, 2759, 4.6, 539, '99M', 0.00, '2018-08-02', '7.0', '4.0.3 and up', 'https://play-lh.googleusercontent.com/BV1Pzn8CLQYL5LqeoorhFS1veSFefU3cTtDbhR6QC8_wvWT6oAjbzQkyavPrUuKqDMU=s180-rw', 'https://play.google.com/store/apps/details?id=com.chakrahq.android', 'Easily define your business processes using Chakra HQ. Be it customer onboarding vendor servicing or relationship management - build all your processes in a single place and bust the information silos. Chakra Bot is also automation first meaning you can offload common tasks like allocation approval data-enrichment to our unique and flexible bot. Automation rules can be built using our point and click engine or with custom scripts running on our serverless infrastructure.'),
(17511, 'Aviary Stickers: Free Pack', 22, 17, 1, 11621, 3.5, 126862, '624k', 0.00, '2012-01-17', '1.0', '2.2 and up', 'https://play-lh.googleusercontent.com/hAc00If1spdaLYxFKjux8EgpcLctGcpY9AQoqNqsyVEECgJI_QQnnWpB5ctbJmPrtw=s180-rw', 'https://play.google.com/store/apps/details?id=com.quick18.jcgolf', 'The JC Golf Tee Times app provides tee time booking for 10 JC Golf Courses in Southern California with an easy to use tap navigation interface. Courses include: Encinitas Ranch Golf Course (Encinitas CA) Rancho Bernardo Inn Golf Course (San Diego CA) Cathedral Canyon Golf Club (Cathedral City CA) Welk Resorts San Diego (Escondido CA) Twin Oaks Golf Course (San Marco CA) Woods Valley Golf Club (Valley Center CA) Temecula Creek Inn (Temecula CA) Carmel Mountain Ranch Country Club (San Diego CA) Oaks North Golf Course (San Diego CA) Reidy Creek Golf Course (Escondido CA) The app also support promotion code discounts with a deals section course information and an account page to look up past reservations and share these reservations with your playing partners via text and email.'),
(17518, 'Binaural Beats Meditation', 22, 12, 1, 13973, 4.3, 411, '95M', 0.00, '2018-06-08', '5.0', '4.0.3 and up', 'https://play-lh.googleusercontent.com/a0qU9vH292kX9JjXHDhUDM8xkUf7fOtVAgQ73t2jfmBQXzNbV--RAXYnLoK7NI_ayhw=s180-rw', 'https://play.google.com/store/apps/details?id=com.tmsoft.whitenoise.generator.beats', 'Generate custom binaural beats around any base frequency including Alpha Beta Delta Gamma Mu and Theta waves. Simple modern interface allows selecting Binaural Beats from 1 to 50 Hz and a Base Frequency from 20 to 1500 Hz. Binaural Beats require high quality headphones or stereo speakers. What are binaural beats? Binaural beats can help with sleep focus and meditation. They are an auditory illusion perceived when two different tones of slightly different frequency are presented to each ear. The frequencies are very low and each one is tuned specifically for each ear which is why headphones are required. What are the different types of binaural beats? - Alpha waves are associated with a restful and relaxed state that exists when both entering and exiting sleep. - Beta waves are associated with concentration and moderate alertness. - Delta waves are associated with deep sleep cycles and the release of physical awareness. - Gamma waves are associated with alertness and sensitive perception. - Mu waves are associated with a state of physical rest stillness and immobility. - Theta waves are associated with the heavy relaxation that comes from frequency deep meditation. Directions: Drag slider to select a desired Binaural Beat from 1 to 50 Hz. Next drag the base frequency to a tone that sounds pleasant to your ears. The binaural beat is generated around this base frequency. Adjust device volume using the on-screen volume slider to a comfortable level. Toggle audio playback using the Play/Pause button. Created by the audio experts at TMSOFT that brought you the famous White Noise app. Check out all our apps and sounds at http://www.tmsoft.com/'),
(17519, 'Essential Resources', 22, 12, 1, 13838, 4.6, 237, '8.5k', 0.00, '2017-09-27', '1.02', '7.1 and up', 'https://play-lh.googleusercontent.com/qBEup_nEw_uGLuic7sJPWTP6y6XAmOuS3srKkGf2vHPQcw-biNdgBO0evzva03GhVgU=s180-rw', 'https://play.google.com/store/apps/details?id=com.syncfusion.xamarin.uikit', 'Essential UI Kit for Xamarin.Forms is a collection of reusable screens for Xamarin.Forms development. You can build mobile apps easier and quicker by focusing on the business logic and letting the Essential UI Kit take care of the UI part. This app helps developers explore all the screens in the Essential UI Kit. For more information go to https://github.com/syncfusion/essential-ui-kit-for-xamarin.forms'),
