(17553, 'Diary with lock', 23, 17, 1, 16001, 4.6, 815893, '4.4M', 0.00, '2018-06-30', '4.90', '4.1 and up', 'https://play-lh.googleusercontent.com/HTX4QtnaIl6JT4jn6gb9MLCvU3fGkpYeyqqfKH_eRfZkO3gEr1EpxEnvjraT4nGWHW4=s180-rw', 'https://play.google.com/store/apps/details?id=com.adpog.diary', 'Use this diary app to make your own personal notes of daily events appointments secrets and feelings. FEATURES: - Password & pin code protection - Emojis via Quick access keyboard (requires Android 4.1 or higher) - Personalize background color (Pink Purple Blue ++) - Change text-size and font-style - Reminder - Easy to use - Search - Download backup (as text-file) - Sync between devices - Private & Secure cloud storage - The most downloaded diary app on Google Play! Build from the ground up to be simple and user friendly the user interface is designed to allow you to enter new notes quickly and easily. With this Diary you can write all your private notes and secure them with a pin code. Track and write about your daily activities Make it a habit to quickly write one or more mini-notes during your day. Simply leave a few words about your workout session what happened at school or in the office during your day. In weekends you can write about all the fun you had walking your dog meeting with friends or being social with your family. This can be the daily activity log you always have wanted. Make it your personal journal and have fun reading it over in few year and share a few laughs with your friends. As this app is pure textual and contains no images or photos it runs ultra fast and smooth on any Android device and consumes minimal of available memory and disk-space! Emojis If your Android phone support it you can use emojis in all entries. Decorate diary notes with beautiful heart and love emojis or popular sport or emotional face smileys. If the phone does not yet have native support for this we recommend you try downloading a third party emoji keyboard from Google Play. Bring your diary in your pocket! In 2016 it is simple for everybody to become a lifetime diarist. Follow millions of people join this popular diary trend. This diary is perfect to use as: Write your own Autobiography This diary app can easily fit the purpose of a writing down your memoir or chronicle. Keep a log or logbook to record history. Make a habit of doing daily records document your life in your own daybook. Setup a reminder to alert you when it is time to write. Protect all personal notes by adding a pin code when it starts up. Never worry about losing memories again. Easily send a backup of diary entries directly to email for extra protection.'),
(17554, 'FOSSIL Q: DESIGN YOUR DIAL', 23, 14, 1, 5380, 4.3, 985, '16M', 0.00, '2018-05-31', '3.7', '7.0 and up', 'https://play-lh.googleusercontent.com/GxBYuJLtKn4dBfUC9LNAURvJb1H_RBn0Mokz7sH0g6JaW3bAH5o8jOhAkGKkVl8KtoA=s180-rw', 'https://play.google.com/store/apps/details?id=com.digitalfractal.gcreno', 'GC Reno app: It s time to part ways with your spreadsheets Manage your team projects and clients anytime on any device: - Instant lead access tool - Single entry estimates - Project optimization - Customized professional estimates - Clear task delegation - Project deficiencies and to-dos management - Remote document access - Ongoing team communication - Client & subcontractor directories - Exclusive access to RenoQuotes.com and WalkThru app For access to our desktop app tutorials and FAQ go to GCReno.ca.'),
(17556, 'Family Locator - GPS Tracker', 23, 17, 1, 12889, 4.4, 726074, '45M', 0.00, '2018-08-02', '16.7.1', '4.4 and up', 'https://play-lh.googleusercontent.com/IvT25zBe6yp6Y3bjBDL8shVQ1wF_raaq1FeQiIJ_IIW4m7sQ6k-_NRL2q28pNjLx2tuV=s180-rw', 'https://play.google.com/store/apps/details?id=com.senseapps.samidev.funnelteev.fg', 'Welcome to FGT Videos FGT Videos have the collection of videos for the Fans i.e playing games and making memes of the video games. The Family Gaming team brings you the premiere channel for family gamers. - FGTeeV - Funnel Vision A YouTube channel for gamers. Meet FGT Duddy his wife FGT Moomy their sons Shawn Chase & Mike & their daughter Lexi. FUNnel Vision is a family of 6 with 4 kids Lexi Michael Chase & the baby brother Shawn! We like to say HAVE A FUNnel Day like Fun \'Ol Day \'cause that\'s what we do on this channel! We Post New videos every week! Anything from Food Challenges House Vlogs Skits Fun Road Trips & Vacations Candy & food (like our Cupcake War!)! Videos with Play Doh Dressed up in Costumes (SCARE CAM VIDEOS!) Holiday videos like Easter 4th of July Halloween Thanksgiving & Christmas. **DISCLAIMER** All video content found on this app are public and are hosted on YouTube. App only allows the viewing of the content but the app does not allow users to download them. Any Content can be removed on request by the copyright owner right away. Let\'s install now.'),
