(17569, 'H Pack', 23, 15, 1, 4381, 4.3, 9412, '1.7M', 0.00, '2016-12-17', '1.5.1', '4.0.3 and up', 'https://play-lh.googleusercontent.com/sI-wgaOnGjGNQC2uCP7DXrK-WYmmLXB2rpyW_wV1yr3gqdFr1fdelNUQ7XZ_NVxMWiNi=s180-rw', 'https://play.google.com/store/apps/details?id=co.arya.vrixx', 'H Max is an online platform for managing data associated with its tutoring classes in the most efficient and transparent manner. It is a user-friendly app with amazing features like online attendance fees management homework submission detailed performance reports and much more- a perfect on- the- go solution for parents to know about their wards  class details. It s a great amalgamation of simple user interface design and exciting features; greatly loved by students parents and tutors.'),
