(17590, 'Big Days - Events Countdown', 23, 15, 1, 5561, 4.6, 39724, 'Varies with device', 0.00, '2018-06-29', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/x4ZpxwalO5t_ibutxHKB95FY2zb_CZM_9-3SYa8uFkuMb_VKKT6fRamOJYkEPlKpmA=s180-rw', 'https://play.google.com/store/apps/details?id=com.gamemavericks.bigfarming', 'Leave your little garden and start farming big. Cultivate and harvest crops on your plantation with cool machines in our farming simulator. Try huge truck fleet - each vehicle has unique functions in our farming simulator. From plow tractor to various harvest machines - drive it all on your plantation and run a prosperous farm! Big Machines Simulator: Farming features: FARMING ECONOMY Harvest and sell crops at your plantation to buy trucks fertilizers and land MULTIPLE CULTURES Carefully choose which crops to grow on your plantation to run farm well BIG TRUCK FLEET Drive various machinery - from tractor and fertilizer to combine and harvester REALISTIC CULTIVATION Do all the field works on your plantation from plowing to harvest Full scaled farm! Vast plantation huge trucks and lots of work - experience farming on bigger scale in our farm simulator! Plow miles of farm land harvest tons of crops earn lots of money and buy huge machines. Play Big Machines Simulator: Farming and think big - huge farm and machines are waiting! Realistic economy! Start with a single plantation buy and deliver fertilizers water and machines to grow and harvest crops. The more harvest you sell the more machines and farm land you can buy. Each new flourishing plantation and farm machine is a step to success in our farming simulator! Farming your way! Operate in a big open-world farming region. Drive around and find machines markets fertilizer shops farm land to buy. Complete simulator tutorial play with combine tractor and other vehicles in our farming simulator and run your plantation as you please! Try driving powerful farm machines and work on huge plantation in Big Machines Simulator: Farming!'),
