(17621, '7 Day Food Journal Challenge', 23, 13, 3, 13105, 4.5, 3346, '14M', 0.00, '2017-03-08', '3.6.3', '4.0.3 and up', 'https://play-lh.googleusercontent.com/9D3KmsMFk5o0qlQkDnxNe454LrnyKcRyD6xBioGs-CbeDuTXrF72VEKfy6qMGFDMbNA=s180-rw', 'https://play.google.com/store/apps/details?id=com.popularapp.sevenmins', 'Best of 2016 App Top Trending App and Best Self-Improvement App selected by Google Play. Featured by Google Play! No. 1 in over 19 countries and among the top 5 health apps in over 57. Now supports Google Fit and comes with the new abs workout. Over 3 million users love 7 minute workout. Scientifically proven to assist weight loss and improve cardiovascular function. If you want to lose weight get a flat tummy & strengthen your abdominal muscles try 7 Minute Workout and get a six pack while strengthening your core and toning your abs with videos that show you how to perform each exercise. The best exercises for regular people just like you and me you can do a quick-fit workout anytime anywhere. It only takes 7 minutes. This 7 minute workout has been highlighted by the New York Times as offering \'maximum results with minimal investment\'. This 7 minute workout is based on HICT (high intensity circuit training) proven to be the  safest most effective and most efficient  way to improve your muscular and aerobic fitness and make you healthier. The best workout app consists of only 12 exercises to be done for 30 seconds with 10 second breaks between each exercise. All you need is a chair and a wall. Repeat 2-3 circuits depending on how much time you have. Make it your first choice at home or at the office. Features: Google Fit support Voice guidance Adjustable circuit time Adjustable rest time Keep the screen on when you workout Beautiful character and UI design Workout log shows your complete workout time Ability to pause the workout and skip to the next or the previous exercise Notifications for daily workout Abs workout for women Permissions description: Storage? To save data to your SD card or phone Network communication: To support saving data to Google Fit Phone call: You can still receive important phone calls during workouts System tools: This permission is for starting up notifications after rebooting the phone Hardware controls: For notification vibration Fitness App Multiple abs workouts are available to help you get six pack abs. Follow your personal trainer and expert workouts six pack abs is within your reach! Short Workouts We have short workouts for people who don t have much time to exercise you will get the sweats and fast heartbeat in a few minutes. These HIIT (high-intensity interval training) can maximize the results. Workout at Home Take a few minutes a day to lose weight and keep fit effectively with our workout at home. No equipment needed just use your bodyweight to workout at home. Fat Burning Workouts & Hiit Workouts The best fat burning workouts & hiit workouts for better body shape. Burn calories with fat burning workouts and combine with hiit workouts to get the best results. Fitness Coach All workouts are designed by professional fitness coach. Workout guide through the exercise just like having a personal fitness coach in your pocket!'),
(17624, 'Candy Crush Saga', 11, 20, 1, 16940, 4.4, 22426677, '74M', 0.00, '2018-07-05', '1.129.0.2', '4.1 and up', 'https://play-lh.googleusercontent.com/ozD0Nb-6L2I8RfYiBo5e5E4xV83iMn0SGTGn_c4WTiAP382slo-ggIaMwObaClg6Gvil=s180-rw', 'https://play.google.com/store/apps/details?id=kr.jungrammer.candytalk', 'Conversation with strangers is a random chat app for anyone. Talk to strangers about my frank remarks that I have never told anyone. 1. Completely free apps. 2. No personally identifiable information and immediately connected to an anonymous person without membership. Unlike any other app no personal information is collected. 3. You can transfer images audio and videos. The image that I sent you is not captured can not be saved and will automatically delete after a certain amount of time. 4. If someone is committing an illegal act please report it. Inform the operator of the operation via the reporting function and apply sanctions to the user. Please make sure you write 5 stars when writing reviews. ? We need your good minds to continue to service this app.'),
