(17627, 'Hello Kitty Nail Salon', 11, 18, 1, 17717, 4.2, 369203, '24M', 0.00, '2018-04-17', '1.5', '4.1 and up', 'https://play-lh.googleusercontent.com/aDX4QRdSBmlOTeWAsS5NbKcggupZ6_RSUzz7kLyIY91RChNDvEv26Czcqb-1rgt6FeE=s180-rw', 'https://play.google.com/store/apps/details?id=com.tinybuildgames.helloneighbor', 'Hello Neighbor is a stealth horror game about sneaking into your neighbor\'s house to figure out what horrible secrets he\'s hiding in the basement. You play against an advanced AI that learns from your every move. Really enjoying climbing through that backyard window? Expect a bear trap there. Sneaking through the front door? There\'ll be cameras there soon. Trying to escape? The Neighbor will find a shortcut and catch you.'),
(17629, 'Clash Royale', 39, 19, 2, 13764, 4.6, 23133508, '97M', 0.00, '2018-06-27', '2.3.2', '4.1 and up', 'https://play-lh.googleusercontent.com/rIvZQ_H3hfmexC8vurmLczLtMNBFtxCEdmb2NwkSPz2ZuJJ5nRPD0HbSJ7YTyFGdADQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.supercell.clashroyale', 'Enter the Arena! From the creators of Clash of Clans comes a real-time multiplayer game starring the Royales your favorite Clash characters and much much more. Collect and upgrade dozens of cards featuring the Clash of Clans troops spells and defenses you know and love as well as the Royales: Princes Knights Baby Dragons and more. Knock the enemy King and Princesses from their towers to defeat your opponents and win Trophies Crowns and glory in the Arena. Form a Clan to share cards and build your very own battle community. Lead the Clash Royale Family to victory! PLEASE NOTE! Clash Royale is free to download and play however some game items can also be purchased for real money. If you do not want to use this feature please set up password protection for purchases in the settings of your Google Play Store app. Also under our Terms of Service and Privacy Policy you must be at least 13 years of age to play or download Clash Royale. A network connection is also required. FEATURES ? Duel players from around the world in real-time and take their Trophies ? Earn chests to unlock rewards collect powerful new cards and upgrade existing ones ? Destroy opponent s towers and win Crowns to earn epic Crown chests ? Build and upgrade your card collection with the Clash Royale Family along with dozens of your favorite Clash troops spells and defenses ? Construct your ultimate Battle Deck to defeat your opponents ? Progress through multiple Arenas all the way to the top ? Form a Clan to share cards and build your very own battle community ? Challenge your Clanmates and friends to a private duel ? Learn different battle tactics by watching the best duels on TV Royale Support Are you having