(17633, 'Block Puzzle', 32, 16, 1, 4898, 4.6, 59800, '7.8M', 0.00, '2018-03-06', '2.9', '2.3 and up', 'https://play-lh.googleusercontent.com/suwFZ5vpDsLh6MqSyqfn05gYjDsf9_nvbrNFU7r9bSeIW1xrH3zm7reu_WBKA2bJEz8=s180-rw', 'https://play.google.com/store/apps/details?id=game.puzzle.blockpuzzle', 'Simple but addictive puzzle game! \'Block Puzzle\' is a fun and classic block game! And our Block Puzzle is not just that. It is more Simple and addictive! Once you start you will not stop playing. Just have a try you will love it! HOW TO PLAY BLOCK PUZZLE? 1. Simply drag the blocks to move them. 2. Try to create full lines on the grid vertically or horizontally. 3. Blocks can\'t be rotated. 4. No time limits. WHY CHOOSE THIS BLOCK PUZZLE? ? Exquisite Game Interface! ? Easy to play and classic brick game for all ages! ? It is all FREE and No Wifi Need! ? Support leaderboard. ? Block Puzzle Classic Please Enjoy this Block Puzzle Game! The More Play and The More Exciting!!!'),
