(17658, 'Hill Climb Racing', 33, 19, 1, 4592, 4.4, 8923587, '63M', 0.00, '2018-07-02', '1.37.2', '4.2 and up', 'https://play-lh.googleusercontent.com/C7khEvxeNqq40IpLhTXreh5GX5_BajEK9otNkXWEQvLztGI3rU6DJVkZviGKb6dzZV4q=s180-rw', 'https://play.google.com/store/apps/details?id=de.esders.ir', 'Logging and evaluating measurement data is essential for the acceptance of installations and pipes by the client. But we are faced with the problem of making the measurement data available in the office for processing. Until now the devices themselves or storage media had to be physically transported for this. Esders GmbH has therefore developed the  Esders Bluetooth Module  to read out this data via the device interface following the measurement process and to forward the data to a recipient for further processing via an Android App. - Remote transmission of measurement data via Bluetooth connection of an Android-enabled end device - Transfer of the latest measurement data from the construction site directly to the office for evaluation and acceptance by the customer - Quicker invoicing for construction sites - Increased safety through constant data back-up'),
