(17689, 'Farm Fruit Pop: Party Time', 11, 15, 1, 9738, 4.4, 9305, '14M', 0.00, '2018-08-02', '1.9.2', '4.0.3 and up', 'https://play-lh.googleusercontent.com/EgSLAB34Z-w6Mo2ruWM0Lo8swYVBhU-DT_sJljb4pNa3Tx9fi2o2Fn1zgFzd_hRxfFQ=s180-rw', 'https://play.google.com/store/apps/details?id=ru.mail.games.android.luckyfields', 'It\'s time to take a break from the hustle and bustle of the city and play by your own rules. Build the farm of your dreams a pastoral paradise that\'ll make your neighbours turn green with envy! You can become a modest gardener or a successful trader in this farm games - the choice is yours. In the world of Lucky Fields everything depends on your wishes - and a little bit of luck! Create new varieties of plants and animals run your own factories and workshops and make a fortune farming. You can expect to struggle against the elements engage in lively trade make new friends and interact with players from all over the world! Help your neighbours expand your property and invite your friends - you can build an enormous trade empire and a real railroad network together! You and your friends can visit each other using your own personal trains post notices in the newspaper and trade tips with your competitors. For some people it\'s just a fun farm simulator but for others it can be a whole new world. What will Lucky Fields be for you? The choice is yours! Try out our other games: Evolution 2 World Above HAWK Space Justice Juggernaut Wars Puzzle Raiders Rush Royale'),
