(17705, 'Draw In', 3, 17, 1, 14554, 4.2, 46416, '73M', 0.00, '2018-07-23', '1.0.8', '4.1 and up', 'https://play-lh.googleusercontent.com/Tx_udBObKVDFciAy8fWDanQkF3PVBdQudAt6_SuG1zvt3LjHZp19kWNUty6d_OgV8zg=s180-rw', 'https://play.google.com/store/apps/details?id=com.timeplusq.drawnguess', 'Draw N Guess Multiplayer is one of the best competitive multiplayer games. This game is all about drawing and guessing the word online with your friends and family. The fun begins when you get connected with thousands of people around the world and start playing with them. An exclusive mobile game that can be played by anyone anytime and anywhere in the world while talking with them through group voice chat. The objective of Draw N Guess multiplayer game is one player has to draw the word and the other players should guess the word and vice-versa. A turn based drawing and guessing game mode is also available which helps to express your artistic skills. So here you get to experience the craziness of the players with their funny guesses and sketches. Highlights: * A competitive multiplayer game providing a platform to exhibit your artwork * Best Pictionary type game * 2 to 6 players can play together online * Talk while you play through group voice chat * Play at your own pace in the turn based drawing and guessing game mode. * Unlock the distinct color sets paints crayons stickers smileys and variety of brushes for best painting and drawing experience. * Guess the word of the drawing based on the artistic skill of the painter. * Draw awesome doodles in the turn based game mode. * Start with a quick game and match up with the new players around the world. * Play with your friends and family in a party mode alongside chatting and talking with them. * Find new friends showcasing your drawing and appreciate each other through chat. * Get connected socially through Facebook and share your drawings if they are really cool. * Winning the games by completing the achievements fetches you precious trophies coins and powerups. * Playing really well automatically progress your way to top the global leaderboard. How to play ? Register an account by logging in using Facebook or Google. Or play as a guest. Click PLAY NOW --> QUICK GAME The fun begins here! If it s your turn to draw start drawing pretty pictures for the given word. If it s your turn to guess start making funny guesses. Beware!!! To win a round you need to be the first one to guess the word. So hold on tight and start making guesses! You get bonus points too if you play really well. The fun doesn\'t stop here. You can also play with your DRAW N GUESS friends online by clicking PLAY NOW --> PLAY WITH FRIENDS You can play live games with your family friends or other players from all around the world. Turn Based Game Mode: Enjoy the fun and addictive turn-based drawing and guessing game with infinite time on the clock in this mode. Sketch paint and show your creativity with colors. You can draw something for the given word and you could also guess what other artists have drawn and challenge your friends and family to find your drawing in this mode. If you have any queries or if you encounter any difficulty when playing Draw N Guess please drop a mail to us at support@timeplusq.com Sounds simple but it\'s unbelievable how amazingly fun and addictive Draw N Guess Multiplayer can become! So what are you waiting for? Download Draw N Guess Multiplayer and start having fun!!! If you like the Draw N Guess Multiplayer game please support us by rating the game.'),
