trategy campaigns in this multiplayer RPG competition. - Upgrade and equip your characters with epic abilities and gear. - Enter in the market to trade hero chips and badges. - Explore a new digital world and fight to save your fellow Disney & Pixar heroes! Discover why EVE from Wall-E Elsa from Frozen Baymax from Big Hero 6 Moana Scar from The Lion King and Maleficent are teaming up in this battle-packed RPG starring some of your favorite Disney & Pixar heroes! Battle in the Arena and defeat all challengers! Survive in the arena using the best combat attacks. Combine speed skills strategy plus fighting experience in your team and make alliances with a suitable guild to win multiplayer battles in this RPG starring some of your favorite Disney & Pixar heroes. You can download and play this game for free. Please be informed that it also allows you to play using virtual currency which can be acquired as you progress through the game or by paying with real money. This game contains advertising which will redirect you to a third-party site. Visit our official site: https://www.disneyheroesgame.com/ Terms of Use and Privacy Policy: http://perblue.com/disneyheroes/terms/'),
