(17750, 'Final Fantasy XV: A New Empire', 39, 17, 2, 4554, 4.0, 484981, 'Varies with device', 0.00, '2018-06-15', '3.30.4.83', '4.1 and up', 'https://play-lh.googleusercontent.com/G5cS8kqZnNdAdZEbxl7WZT1ZUD66fQYb-c-EyMprbTqtY9_ivrhJ53qGxKVhpP4oiw=s180-rw', 'https://play.google.com/store/apps/details?id=com.epicactiononline.ffxv.ane', 'Alexis Ren is waiting for you! Join the adventure! Be the hero of your own Final Fantasy XV adventure in the brand new mobile strategy game Final Fantasy XV: A New Empire! Build your own kingdom discover powerful magic and dominate the realm alongside all of your friends! Final Fantasy XV: A New Empire is a mobile adventure that lets you rewrite a favorite classic to fulfill your unique destiny. Journey through vast kingdoms gather magical resources and build the strongest Empire in Final Fantasy history! Fight fire with magic to defend friends and defeat foes alongside millions of players from around the world! Do you have the strength and strategy to control the Crystal and rule the Realm? ? Experience your very own epic FFXV adventure on your mobile phone ? Jump into the action with Noctis Cindy and all of your favorite FF15 characters ? Fight alongside friends and against foes in legendary battles against millions of players from around the world! ? Build up your large army and best strategy to win in real-time action-packed battles ? Create the ultimate Guild or join up with already-powerful forces ? Strategize with your guild to crush enemies and beasts in real-time battles ? Compete for the Crystal against players from all over the world ? Travel the Realms and collect rare resources to build an epic Empire ? Become a legend by taking control of the Crystal and ruling the Realm An epic world with no rules: only magic. Will your magic grow to stand the test of time or will your empire be defeated? Embark on your own Final Fantasy XV mobile adventure alongside Alexis Ren. Your legend starts now in the new MMORPG: Final Fantasy 15: