(17753, 'Honkai Impact 3rd', 1, 15, 3, 17282, 4.7, 59017, '82M', 0.00, '2018-07-03', '2.2.1', '4.3 and up', 'https://play-lh.googleusercontent.com/zqyLbcj4YH4Nxj2G7u5Us-rjAlYstLmshQ1ZkSs5YusuNROJOh30kVuIsdvjn_GjDFI=s180-rw', 'https://play.google.com/store/apps/details?id=com.miHoYo.bh3global', '[Game Introduction] miHoYo\'s flagship product and Genshin Impact\'s companion game! Hyperion command system ready. Processing login request... Verified. Attention all units! Safety catches unlocked! Download engine transferring high concentrations of energy. Login countdown: 10 9 8... \'Captain on the bridge.\' Welcome to Hyperion Captain! From today onwards you are our Captain! Come fight for all that is beautiful in the world with us! HD cel-shaded graphics infinite combo ultra-tight controls... Experience next-gen real-time action! Epic storyline spanning works immersive stage dialogues celebrated VA lineup... Become the center of the legend! More elements including Valkyrie customization open-world exploration base building racing shooting and co-op spice up the game like never before! Get along with a diverse cast of Valkyries and their bonds will become your strength! Join Valkyries in the war against Honkai to save the fantastic Honkai-verse! [New Version Content] [SP Battlesuit | Haxxor Bunny] \'Hey wanna hear my new plans?\' New SP battlesuit [Haxxor Bunny] debuts! She can summon drones to aid in battle and provide powerful Ice DMG buffs with standby QTE and Ultimate! [Battlesuit Event | Arc: Light Bound] You must rise above the clouds if you dream to reach the stars. But when that time comes will the starry sky be enough for you? New battlesuit event available! Explore an expansive map to find rewards including [Haxxor Bunny] Fragments and Twilight Paladin\'s new outfit [Verdant Sky]! [Story Chapter XXIII | The Solo Stage After resolving the Herrscher of Sentience incident momentary peace returned to Hyperion. Yet the rampaging mechas and missing people foreshadow a new crisis... Story Chapter XXIII will be released in early May! Earn 4-star event stigma SP battlesuit fragments and Crystals! Honkai Impact 3rd Subscription and Google Subscription Explained 1. Types of Subscription [Adventure Commander] ($3.99 for 30 days)/($9.99 for 90 days)/($17.99 for 180 days) gives the following daily rewards during subscription: Stamina Potion x2 200 Asterite 1000 Mithril 50% Captain EXP Chip x1 [Valkyrie Guild] ($9.99 for 30 days)/($25.99 for 90 days)/($47.99 for 180 days) gives the following rewards daily during subscription: Valkyrie Fragvyom x1 (Gives one of the following by choice: Night Squire Fragment x1 Stalker: Phantom Iron Fragment x1 Yamabuki Armor Fragment x1 Valkyrie Pledge Fragment x1.) Valkyrie Lucky Chest x1 (Gives random battlesuit fragment x1 and ADV EXP Chip x1.) 2. Collecting Subscription Rewards Subscription rewards are issued by in-game mail upon your first login daily. If you have not received your subscription rewards please restore your subscriptions or log in again. 3. About Auto-renewal Subscriptions on Google Play renew automatically unless you unsubscribe manually. Please note that uninstalling the game does not cancel auto-renewal. Your account will be charged for renewal within 24 hours before a subscription period ends. If you wish to cancel your subscriptions you will need to turn off auto-renewal at least 24 hours before a subscription period ends. Failure to do so would result in your account being auto-charged for renewal. 4. User Agreement https://honkaiimpact3.mihoyo.com/global/en-us/terms 5. Privacy Policy https://honkaiimpact3.mihoyo.com/global/en-us/privacy 6. Canceling Subscription Use an Android device to log in to Google Play with the correct account tap the \'Subscription\' in \'Menu\' to find the subscription you would like to cancel (e.g. Honkai Impact 3rd) and choose \'Cancel Subscription\'. Customer Support Should you encounter any issues please feel free to reach out to our in-game customer support. Customer support team: honkai3rd_global@mihoyo.com Official site: https://honkaiimpact3.mihoyo.com/global/zh-cn/ Facebook page: https://www.facebook.com/global.honkaiimpact/'),
(17759, 'Farming Simulator 18', 36, 13, 1, 5421, 4.5, 18125, '15M', 4.99, '2018-07-09', 'Varies with device', '4.4 and up', 'https://play-lh.googleusercontent.com/fBrh0fhnDn4_ClaeY9JW3d18hhYq8KtZiKPCWhpdD1_LNcZ85siuWIoiW8hEaS8b7A=s180-rw', 'https://play.google.com/store/apps/details?id=com.giantssoftware.fs18.google', 'Become a modern farmer in Farming Simulator 18! Immerse yourself in a huge open world and harvest many types of crops take care of your livestock - cows sheep and pigs - take part in forestry and sell your products on a dynamic market to expand your farm! You have access to a huge selection of over 50 farming vehicles and machines faithfully recreated from over 30 of the biggest names in the industry including AGCO s most respected brands: Challenger Fendt Massey Ferguson and Valtra. Drive and use brand new equipment and harvest sugar beet potatoes wheat canola corn and for the first time sunflowers. With a deep and powerful simulation experience a vast open world and a wide fleet of vehicles including brand new machines Farming Simulator 18 invites you aboard the most complete handheld farming simulation ever created! Features of Farming Simulator 18 include: - Use realistic tractors and trucks from some of the biggest agriculture machine makers - Plant and harvest six different crops: Wheat canola corn sugar beet potatoes and sunflower - Breed pigs and sell them for profit - Feed your cows and sheep to produce and sell milk and wool - New front loader attachments expand your options when transporting bales or wood - Manage AI helpers for better results or let them drive your vehicles to a destination of your choice - New 3D graphics show even more detail on your machinery and the southern US environment - Harvest wood with dedicated machinery and sell the timber - Play with friends in local multiplayer mode for WiFi and Bluetooth'),
(17761, 'Call of Duty:Black Ops Zombies', 1, 13, 3, 15919, 4.2, 13004, '46M', 6.99, '2016-12-20', '1.0.11', '2.3.3 and up', 'https://play-lh.googleusercontent.com/Mc8L__KYuIvhdhY5TkznO4WVqvOqIQ2pDoCmCtxyr8V2dZ7E8oG6_Lhj8AmoRRsHcA=s180-rw', 'https://play.google.com/store/apps/details?id=com.callheroes.pjcallmasks', 'I thought I would share my pj heroes masks knowledge in this fun and unique UNOFFICIAL call game! Do you love pj heroes masks ? Do you want to make a call with pj heroes masks ? You\'re in the right Place! CATBOY - OWLETTE - GEKKO - ROMEO - LUNA GIRL - NIGHT NINJA - PJ ROBOT - NINJALINOS - WOLFY KIDS - AN YU - MOTSUKI - SPLAT MONSTER - ARMADYLAN - Among us are waiting you! Call PJ Heroes Masks Talk NOW is a Prank App to enjoy it with your friends! You can\'t made a real call but what inside the app seems like you will made a call with the pj heroes masks !!! We hope you like it :) Features: * Beatiful UI design * Fake Voice Call with PJ heroes Masks. * Fake Video Call with PJ heroes Masks. * Fake Call Schedule with PJ heroes Masks. DISCLAIMER: This app is not affiliated with pj heroes masks. We do NOT provide any Games hacks or anything illegal other pj heroes masks related product. This app is only for joking with friends is not an official application.'),
(17764, 'Angry Birds 2', 11, 19, 1, 12287, 4.6, 3883589, '57M', 0.00, '2018-07-26', '2.21.1', '4.1 and up', 'https://play-lh.googleusercontent.com/w4xy9B_V3VJx4clPMxop7ph-JqMuMePzkjpgvigKLEFsmGL87r8PZ6Ft57RoT2nJ3vAh=s180-rw', 'https://play.google.com/store/apps/details?id=com.rovio.baba', 'Join hundreds of millions of players for FREE and start the fun slingshot adventure now! Team up with your friends climb the leaderboards gather in clans collect hats take on challenges and play fun events in all-new game modes. Evolve your team and show your skills in the most exciting Angry Birds game out there! Get to know all of the iconic characters and experience the fun gameplay that has captured the hearts of millions of players. Features: ? DAILY CHALLENGES. Have a minute? Complete a daily challenge and earn some quick rewards. ? LEVEL UP your characters with feathers and up their scoring power. Build the ultimate flock! ? JOIN A CLAN to take down the pigs with friends and players around the world. ? COMPETE in the ARENA. Compete with other players for some friendly bird flinging fun and prove who is the best. ? COLLECT SILLY HATS. Collect hats with different fun themes to level up your flock s fashion game and take part in special events. ? IMPRESS THE MIGHTY EAGLE in special challenges in Mighty Eagle s Bootcamp and earn coins to use in his exclusive shop. ? LOTS OF LEVELS. Play hundreds of levels with more added in regular updates and limited time events. ? LEADERBOARDS. Compete with your friends and other players and prove who is the best on the global leaderboards. ? CHOOSE YOUR BIRD. Choose which bird to put in the slingshot and defeat the pigs with strategy! ? MULTI-STAGE LEVELS. Play fun challenging levels with multiple stages - just watch out for Boss Pigs! ? FREE to download! --- Angry Birds 2 is completely free to play. Although Angry Birds 2 can be downloaded for free there are optional in-app purchases available. --- This game may include: - Direct links to social networking websites that are intended for an audience over the age of 13. - Direct links to the internet that can take players away from the game with the potential to browse to any web page. - Advertising of Rovio products and also products from third parties. Although some features are available offline this game may require internet connectivity for certain features. Normal data transfer charges apply. Note: When the game is played for the first time there is a one-time download of additional content that cannot be completed while offline. Terms of use: http://www.rovio.com/terms-of-service Privacy Policy: http://www.rovio.com/privacy'),
(17765, 'Fallout Shelter', 36, 17, 3, 4690, 4.6, 2719142, '25M', 0.00, '2018-06-11', '1.13.12', '4.1 and up', 'https://play-lh.googleusercontent.com/LeLl3fr-6zbWzGfC-0aGUmQeicv4tpY9SEvFaDFBmTR_xDLbTqAen8Ls-Tbb-98ZF0o=s180-rw', 'https://play.google.com/store/apps/details?id=com.eximlabs.pocketAC', 'Pocket AC is a collection of tools and reference tables for cinematographers camera assistants operators DITs and videographers developed by a camera assistant. It features various calculators and charts to help prep and execute productions. In addition the included camera log allows ACs to quickly log shots and email the setups of the day. Tools: -Depth of Field and Split Focus -Digital Runtime Filesize and Compression -Diopter and Split Diopter -Exposure -Field of View with preview and support for focal reducers (aka \'Speed Boosters\') -Flicker Free Shutter -Focal Length Equivalents -Focus Chart -Footage Length and Runtime -Insert Slate (sync beep BETA) -Mired Shift and Filter Suggestions -Screentime and Runtime -Shutter Angle and Exposure Time -Solar Elevation -Unit Converter (Area filesize illumination length temperature weight) Reference Tables: -Camera Specifications (Over 140 Film and Digital Cameras) -Film Stocks -Filter Factors -Lens Catalog (Over 1100 Lenses) Camera Log Features: -Collaborate on the same camera log with other Pocket AC users in real-time (beta) -Camera Report Mode to log takes and circle takes -Built-in Presets to make logging faster -Supports multi-cam productions -Table and List view -Insert Slate view -Email Log as PDF CSV format for Excel or HTML format for web browsers -Production Details offer statistics about the production (Avg lens total setups avg setups per day etc.) Some cameras supported include: -Arri Amira and Alexa (all models including XT Mini LF Mini LF and 65) -Blackmagic Cinema Camera Micro Mini Pocket Pocket 4k URSA URSA Mini URSA Mini Pro URSA Mini Pro 12k -Canon 5D MKII 5D MKIII 5D MIV 7D C70 C100 C100 MKII C200 C300 C300 MKII C300 MKIII C500 C500 MKII C700 C700 GS C700 FF -Digital Bolex -Kinefinity Mavo LF Mavo Terra 4k -Nikon D3100 D5 D5000 D800 D810 D850 Z5 Z6 Z6ii Z7 Z7ii -Panasonic AF100 DVX100 EVA1 HMC150 GH2 GH3 GH4 GH5 GH5S Varicam -Phantom Flex4k Flex Miro 320S VEO4K-PL -Panavision DXL DXL2 -Red One MX Epic Scarlet Epic Dragon Scarlet Dragon Epic-W (Helium) Weapon 6k Weapon 8k S35 (Helium) Raven Monstro Gemini Komodo -Silicon Imaging SI-2K -Sony EX1 EX3 F3 F5 F55 F65 FS5 FS7 FX9 A7S A7R A7Sii A7Rii A7Riii Venice -16mm and 35mm formats -Z Cam E2 -Digital Runtime Calculator supports Aja Ki Pro Mini Sound Devices PIX 240 DPX -Store up to 5 Custom Camera Settings Please feel free to email me at pocketAC@gmail.com with any questions or suggestions especially if you\'d like to see any specific cameras or lenses added.'),
(17767, 'Best Fiends - Free Puzzle Game', 11, 17, 1, 12907, 4.6, 1480189, 'Varies with device', 0.00, '2018-08-02', '5.8.1', 'Varies with device', 'https://play-lh.googleusercontent.com/KH27Vn2dU6TmLogIwee-AfYd67T_0PHnj252bbIkDcwoe4dSUcZdTQ5uAevmArw1bQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.Seriously.BestFiends', ''),
(17770, 'Choices: Stories You Play', 36, 17, 3, 11186, 4.6, 807338, '93M', 0.00, '2018-07-30', '2.3.5', '4.0.3 and up', 'https://play-lh.googleusercontent.com/kBpIE20o1Xcug7Y5a2i_2GYo3Pwz00EQR15wW6ZW-hRBZbjt8bVWJtDv-epmKNokSSi7=s180-rw', 'https://play.google.com/store/apps/details?id=com.pixelberrystudios.choices', 'One choice can change everything! With romance drama horror and more Choices has the best collection of story games in the world! ? Customize your hair outfits and character look. ? Fall in love solve crimes and embark on epic fantasy adventures ? Pick your story from our constantly growing library with weekly chapter updates ? Control what happens next in immersive visual stories! Current stories include: ? THE FRESHMAN - Welcome to Hartfeld University! In this college drama you ll make new friends for life and find true love romancing your schoolmates. Will you date bookish James party girl Kaitlyn football hero Chris... or all three at once? - Dress your character in fashion-forward outfits for events like a sorority rush. - Choose a date for the elegant and romantic Winter Formal. ? THE CROWN & THE FLAME - Your enemies stole your kingdom but now the time has come for you to raise an army master magic and reclaim your crown! Assume the role of the hero in this interactive narrative adventure. - Form alliances and relationships to build your army. - Dress in elegant fashions and powerful armor. - Crush enemies in an epic battle! ? PERFECT MATCH - Sign up for the high-tech matchmaking services of Eros Incorporated and master the dating game! Create your look meet your perfect match and fall in love in this thrilling mystery story! - Customize your date to be your perfect match. - Roleplay as a guy or a girl. - Investigate a mystery with twists you won t see coming! You might also love: ? BLOODBOUND - You\'re applying for a job with brilliant CEO billionaire Adrian Raines. Urban fantasy meets romance in this sexy vampire thriller! ? HIGH SCHOOL STORY - It\'s your first day at a new high school! Make friends find love and attend the Homecoming dance. Relive your teen years in your very own High School Story! ...PLUS more new stories and chapters EACH WEEK! FOLLOW CHOICES: facebook.com/ChoicesStoriesYouPlay twitter.com/playchoices instagram.com/choicesgame Choices is free to play but you are able to purchase game items with real money. You may limit the ability to make in-app purchases by creating a PIN in the Settings menu from within the Google Play Store. PRIVACY POLICY & TERMS OF SERVICE - Please read our privacy policy at http://www.pixelberrystudios.com/choices-privacy-policy/ - By playing Choices you agree to our terms of service http://www.pixelberrystudios.com/choices-terms-of-service ABOUT US Choices is from the team that has been bringing you narrative games for over a decade. We created the top 25 hit games Surviving High School and Cause of Death the first games with episodes for EA. After leaving EA our team regrouped as Pixelberry in a small office set out to continue creating story driven games with heart and launched the two interactive hit games High School Story and Hollywood U. Our team has now grown to over a dozen of the most experienced game writers in the industry. In our 10 years of creating story games together we ve seen heartbreak marriages great adventures and even Pixelbabies. Stay tuned for more new interactive story games to pick from in Choices! - The Pixelberry Team'),
(17775, 'Game of Thrones: Conquest', 39, 15, 3, 14393, 4.0, 90218, '97M', 0.00, '2018-08-03', '1.8.225278', '6.0 and up', 'https://play-lh.googleusercontent.com/2_FkNbprf0AIfQWB_LZKyGVLJjEUdeqpbZCYbML4gIK77P9vYbFSEXgBVBmtSu3a0B8=s180-rw', 'https://play.google.com/store/apps/details?id=com.nappsstudio.gamespeedbooster.free.best.gamelauncher.livestream', '\'Game Booster - Speed Up & Live Stream Games\' is an extremely powerful game booster that will give you optimal performance while playing Games. You can live stream your games of YouTube or live stream games on Twitch.This Game Booster app simply frees up your phone memory. This tool can close unused apps/tasks to boost you games after you permissions. Best part of this game booster is that it offers \'Game Mode\' where you can apply specified settings for each gaming mode. Either you can turn on or off Gaming modes or auto boosting. Game booster will facilitate you in setting your brightness differently for each game that you play in specific gaming mode. * FEATURES Of The Game Booster * 1. Live Stream Games You can live stream games of YouTube and Twitch. 2. One-Tap Game boosting Kills unnecessary tasks and apps and frees up memory by just a tap. 3. Game Play Mode You can select a gaming mode that will help you in better performance optimisation for a Game it will allow you to choose brightness and on/off data mode. 4. Custom Mode Creation Create your own Boost Mode and assign a mode to your favourite games When you will start that particular game the associated mode will start it self. You can make configurations of Bluetooth Brightness Screen RotationSounds and Data using. 5. Screen Recording You can record games while playing and you can share your recording on social media. This Game booster is free to use and supported by ads.'),
(17778, 'FINAL FANTASY BRAVE EXVIUS', 34, 16, 3, 12548, 4.6, 745684, '83M', 0.00, '2018-07-17', '3.0.2', '4.0.3 and up', 'https://play-lh.googleusercontent.com/luRLQuthk19VvlYGSNUwhP6v1SDFkBnH7pDtwml1b5WLYM25EAz49XeYaRDFyYiynyQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.square_enix.android_googleplay.FF4AY_GP', 'FINAL FANTASY IV: THE AFTER YEARS is available on Android devices! With a full 3-D remake FINAL FANTASY IV: THE AFTER YEARS can now be played as never before. Take part in the epic sequel that unfolds nearly two decades after the events of FINAL FANTASY IV. Classic characters make their return alongside several new heroes such as Ceodore son of Cecil and Rosa. - Ten Playable Tales Begin your journey with \'Ceodore\'s Tale.\' Complete it to unlock the tales of six additional characters which can be played in any order and then return to the core story with \'Kain\'s Tale\' \'The Lunarian\'s Tale\' and \'The Crystals.\' A total of ten tales in all and all contained in FINAL FANTASY IV: THE AFTER YEARS. - Active Time Battle Take control of exhilarating combat made possible by the non-stop action in Square Enix\'s iconic battle system. - Lunar Phases Feel the moon\'s presence in combat as its waxing and waning influences the potency of attacks and abilities of all combatants. Lunar phases cycle naturally with the passage of in-game time or when resting at an inn tent or cottage. - Band Abilities Combine the strength of your party members to awesome effect with Band abilities that can be unlocked through in-game events or by leveling your characters\' Affinity. - Minimap Keep an eye on your current location and nearby surroundings or tap for quick access to the world map. - Google Play Game Support Step up to meet all-new challenges offered by dozens of achievements. Seventeen years have passed since the war\'s end and the son born to King Cecil and Queen Rosa of Baron has grown into a young man. Prince Ceodore has enlisted in the airship fleet known as the Red Wings eager to meet the expectations demanded of his blood and station. Yet once more another moon has appeared in the sky and with it vast hordes of monsters intent on destruction. The brief peace enjoyed by the Blue Planet now stands threatened under the shadow of impending catastrophe. -------------------------------------- FINAL FANTASY IV: THE AFTER YEARS cannot be launched on devices running Android 4.4 with Android RunTime (ART) enabled. Please ensure the default runtime is selected before launching the game. --------------------------------------'),
(17780, 'Fate/Grand Order (English)', 34, 14, 3, 8823, 4.4, 16601, '55M', 0.00, '2018-07-26', '1.18.0', '4.0 and up', 'https://play-lh.googleusercontent.com/FtEhBLowUVdi6uwXBjW2Nj1i52eOo6BNrG5T_eL-fy8QhtfIRMe7n2M-Lg0UnLXxlYg=s180-rw', 'https://play.google.com/store/apps/details?id=mw.whatsme', 'WhatsMe app allows you to open chat with anyone on WhatsApp without save his/her number on your phone as we all know that we can\'t open chat with someone without save the number on your contact but with WhatsMe you can do it with easiest way just by writing the number of your friend or anyone you want and click open chat and a conversation with the number you wrote will appear and you can send message. Also WhatsMe allows you to open conversation with yourself and as we also know that WhatsApp doesn\'t allow to open chat with yourself in WhatsApp but you can do it with WhatsMe. WhatsMe is easy to use because it\'s not complicated  has just textbox to write the number and button to open the chat with the number you wrote.');
