(17783, 'Dungeon Hunter Champions: Epic Online Action RPG', 34, 15, 3, 12999, 4.2, 26247, 'Varies with device', 0.00, '2018-07-26', '1.1.40', '4.0.3 and up', 'https://play-lh.googleusercontent.com/Z2eFTDNBOoa1aCRy3n0XKdkQh5OKu_eIXd8EXJeDwZs_rfmChKG_2YouHYvqUHpLNQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.shinybox.smash', 'New Features: Graphics Overhaul/Enhancements - We have added several levels of graphical additions to Dungeon Quest. Dynamic Shadows have been added to all areas. Players have full control over the quality of the shadows through the options menu. Legend and Eternal Legend Crafting - Our new Legend Crafting System allows you to Salvage your unwanted Legend and above items in return for Crafting Dust. If you have already unlocked a Legend item you can now navigate to the LegendEx and create it for Dust. If you haven\'t unlocked the item you\'ll be able to unlock creation of the Legend item with Dust! This provides a new way to target the Legend items you want while not being a slave to random chance. Eternal Item Codex Tracking - Not only will you be able to create Legends item from the LegendEx in Patch 3.0 you\'ll also be able to create Eternal Legends from the brand new Eternal Tracking Section of the Codex. Pet Crafting System - To facilitate customizing your pets a bit more we\'ve enabled the Diamond through Fluorite and Topaz crystals on Pets. The only difference is that these Crystals will consume 5 of each type instead of the usual 1 crystal. Bug Fixes and System Adjustments: Stat Change and Reset - Having near 300 stat points was always a bit tedious to assign and respec so we\'ve cut down the amount of stat points you gain per level from 3 to 1 and have tripled the effectiveness of each Stat. We\'ve also improved the speed a bit of stat assigning. Better Gold Purchase Value THANK YOU for supporting Dungeon Quest and for helping us make even better games! With recent economy changes and improvement in past patches the gold purchase had become unfortunately outdated. Each purchase now yields 100 TIMES the amount of gold as they did before! *************** Embark on a journey to find the best loot and defeat all challengers in this truly free-to-play Offline Action RPG. Featuring randomized loot dynamically generated dungeons and 4 acts each with their own legendary boss awaiting. Journey through unlimited floors of increasingly difficult enemies while collecting the best items possible while competing with your friends in our Battle Arena competitive leagues. Equip your Wizard Warrior or Rogue with infinitely customization weapons and armor to help destroy the elemental evils plaguing the land. There are always new ways to vanquish your foes! Upgrade your gear with our Crystal and Mythstone crafting system. Make your character even more powerful using our Gear-Based Skill and Talent system. Tired of playing alone? Bring your other characters into combat with you to gain experience and loot alongside your hero using our Hireling system. Or maybe you\'ll come across one of the many endearing companions included in our Pet system! Features Include: - Play for as long as you want not content or pay walls - Equip your Wizard Warrior or Rogue with amazing randomized loot you find on your adventure! - Never fight in the same dungeon twice! Climb your way through more than unlimited randomly generated floors. - Test your skill against one of 4 Legendary bosses at the end of every Act! - Bring your other characters into your adventures using the new Hireling System! - Manage your player AI to create your own army of adventures! - Native Controller integration for bluetooth with HID support! - Customize the dungeon\'s difficulty and rewards by choose between 8 enemy power levels. - New Pet System that lets you choose a follower to aid in your journey. We are dedicated to making Dungeon Quest the best ARPG on mobile! New content will be added regularly so follow us on either our forums Twitter or Facebook to get the latest news!'),
(17788, 'Doodle Jump', 3, 18, 1, 8382, 4.3, 1083571, 'Varies with device', 0.00, '2018-07-20', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/t6IbLRuE1lY5-tuGuSKINhXTooUVMvOFEC4dxlAA1L1FAuqDxQe5wFPS5GGMt5Y_hJU=s180-rw', 'https://play.google.com/store/apps/details?id=com.lima.doodlejump', ''),
(17789, 'Crossy Road', 1, 19, 1, 6122, 4.5, 4230886, '60M', 0.00, '2018-08-01', '3.1.0', '5.0 and up', 'https://play-lh.googleusercontent.com/2yH_JCxn7D9FttXZViPhmvIEDfRhio5qdLdWJLxcIfh8PjIkVeBgt_Gj7q21dIRp97g=s180-rw', 'https://play.google.com/store/apps/details?id=com.yodo1.crossyroad', 'Join over 200 MILLION players worldwide and experience Hipster Whale\'s massive viral #1 hit! Same device multiplayer: Compete against your friends and family on the same device. Play Crossy Road on the Big Screen with Android TV! Why did the Chicken cross the road? Why did the Pigeon leave THAT there? Why did Specimen 115 abduct that cow? Why did Unihorse eat all that candy? FEATURES: - Play Crossy Road on your big screen with Android TV - Collect over 150 retro-styled pop art inspired characters - Cross roads train tracks and rivers - endlessly hop forever - Dodge traffic in a candy wonderland with the Android Robot - Simple pure innovative gameplay - Free to play Have any problems or suggestions? You can reach us at inappsupport-googleplay@crossyroad.com. **DON\'T LOSE YOUR CHARACTERS!** - Go to game Settings and Sign-in with Google Play to save your characters game progress scores and achievements! - After signing in your progress will be saved to your Google Play account - To restore your game progress go to Settings and click Restore Game to restore all of your characters - You can only restore saved progress that was saved from version 1.0.6 onwards - We are working to support saving from multiple accounts on a single device in a future version. The current version works well with one account per device or one account across multiple devices. The game require access to the following Permissions ---------- - Read device state and identity - READ_PHONE_STATE permission - The game requires the LOCATION permission to target and deliver video-based advertising: The game implements opt-in video ads that players can watch to earn free coins if they choose. Watching video ads is voluntary if players want to speed up the rate they earn coins to win new characters. We require the Location permission to provide location based video ads to provide more relevant ads to players.'),
(17791, 'Earn to Die 2', 33, 18, 3, 10342, 4.6, 1327265, '99M', 0.00, '2017-04-12', '1.3', '2.3.3 and up', 'https://play-lh.googleusercontent.com/ejj1-KcF2Nd74PqwhnvwNOH2hPmmc8nyG9T8hgciouUAJBB_Da7ErUDV_ItlXcrvFeg=s180-rw', 'https://play.google.com/store/apps/details?id=com.notdoppler.earntodie2', 'Drive your car through a zombie apocalypse in this massive follow-up to the chart-topping hit Earn to Die! An evacuation ship is waiting on the other side of the country. The only thing that stands in your way: city after city overrun by zombies . With only a run-down car and a small amount of cash you face a familiar situation... to drive through hordes of zombies in order to survive! BRAND NEW STORY MODE Earn to Die 2 introduces a massive new Story Mode five times longer than its predecessor. The game departs its familiar desert setting and delves into the depths of cities infested by zombies. MULTI-TIERED LEVELS: Levels are now multi-tiered! Drive across decayed highway overpasses via underground tunnels or smash through epic zombie filled factories. Whichever path you choose to take you won\'t be able to escape the zombie hordes - your only choice is to smash through them! BUILD A ZOMBIE-SMASHING MACHINE Unlock and upgrade 10 different vehicles including a sports car a fire truck and even an ice-cream van. Each vehicle can be equipped with a range of upgrades such as armored frames roof-mounted guns boosters and more. Those zombies will stand no chance. DESTRUCTIBLE VEHICLES Vehicles are now fully destructible. Hang on for your life as your vehicle gets smashed to smithereens if you aren\'t too careful. MORE ZOMBIES. MORE DESTRUCTION. MORE MAYHEM. What are you waiting for? That rescue ship isn\'t going to wait forever! Prepare yourself for a wild ride - and seriously there is nothing like smashing through zombie-filled factories! Earn to Die 2 is a bigger and better version of the original web series which includes Earn to Die 2012 and Earn to Die 2: Exodus. Earn to D