(17841, 'Dog Run - Pet Dog Simulator', 36, 17, 1, 13813, 4.7, 48615, '24M', 0.00, '2018-05-22', '1.4.12', '4.1 and up', 'https://play-lh.googleusercontent.com/KTIP_8TBV5RCYLlycJ9OPQ53wBYtjXDmyCj9QhPgs7pEzHxZraYleihWrZdc9VdaEQs=s180-rw', 'https://play.google.com/store/apps/details?id=com.swiftapps.dogsimulator2015', 'The best MULTIPLAYER Dog Simulator available on Android! Play as a real puppy - jump bark destroy the house and do whatever you want. Now with a multiplayer mode you can play your friends and people all over the world. Cute puppies and fun adventures are waiting for you! ONLINE MULTIPLAYER Play online with animal lovers all over the world. Play together with other dogs meet new friends and compete with them for the best score. See if anyone can match your skills as a naughty dog. You can create your own games which can be joined by your friends. DOGS AND PUPPIES If dogs are your favourite pets then this is the game for you. Play as your favourite dog breed: corgi shiba and husky puppies are waiting for you. If you love bigger dogs select one of the collies bulldogs or a greyhound to bring even more cuteness to the game. And if that s not enough try a wolf direwolf or a giraffe (well it s a sneaky greyhound dressed as a giraffe). UPGRADE AND DRESS YOUR DOG When you press either single player or the multiplayer button in the menu you always go to the scene where you can change your dog and dress it as you like using blue arrows on the both sides of the dog and buttons on the top of the screen. You can dress your doggy with multiple hats collars and funny glasses. Then everyone can see your cool outfit in multiplayer games. LOCATIONS There are six locations. First awesome house were you smash some objects and learn the game. Second nice garden with a dog that will follow you and a grill party to ruin. Third is a shop with lots of objects that can be smashed into pieces. Fourth and fifth are on a huge farm full of animals and people where you can chase sheep to get points. The last one is a crazy town with tons of stuff to destroy and funky missions. TIME CHALLENGE In every level in the single player mode there is a rotating clock. When you run into it you can activate time challenge mode. In this mode you have to destroy as many objects and do as many interactions as fast as possible. For the points you earn the stars and more gold. NIGHT MODE Score one star in the last level to unlock a secret night mode. It contains new time challenges for every stage with increased difficulty and even bigger rewards. See if you re a true expert. SIMPLE CONTROLS You can use the joystick on the left to move your dog jump button on the right to make it fly and swipe to look around. You can use the hit button on the right to smash objects with your awesome dog power. QUALITY SETTINGS The game will automatically detect which quality settings to apply for your device but you can change them in the settings menu. FACEBOOK AND SOCIAL SHARING At the end of the time challenge the popup will show up allowing you to post your score on Facebook or Twitter. You can also share the image of your dog on in the scene where you change dogs and dress them.'),
(17843, 'Coloring & Learn', 16, 16, 1, 2014, 4.4, 12753, '51M', 0.00, '2018-07-17', '1.49', '4.0.3 and up', 'https://play-lh.googleusercontent.com/W2EFsVjSVhpLniWgHUipvGwOMhkqyehzYqVI1pwwxAjH3uwPaLteIivi6wSvGIDbeg=s180-rw', 'https://play.google.com/store/apps/details?id=com.bimiboo.drawing', 'Coloring and drawing for kids contains 128 coloring pages for toddlers to enjoy. Drawing app is perfect for girls and boys ages 2 to 8. Painting game helps babies to develop creativity fine motor skills and hand eye coordination. Doodle game for kids features: - 128 coloring pages for toddlers. - Drawing app for kids features 8 themes: animals princesses cars school musical instruments food Halloween and Christmas. - Baby doodle games for kids with simple interface. - 16 coloring pages are available for free. Age: 2 3 4 5 6 7 year old children. Great for preschool. Our painting game runs perfectly without Wi-Fi. There are no ads inside our app. We are always glad to receive your feedback and suggestions.'),
