(17850, 'Happy Fruits Bomb - Cube Blast', 11, 14, 1, 8404, 4.5, 2150, '20M', 0.00, '2018-02-01', '1.0.3122', '4.0.3 and up', 'https://play-lh.googleusercontent.com/JN34PdHqn_TQw6IW9SMUXg08p1yPhn1GvVB-YbYbuuYOhnhcsxlalzaPb1lcAhVaKNs=s180-rw', 'https://play.google.com/store/apps/details?id=com.game5mobile.lineandwater', 'The glass is sad because it\'s empty. Your job is to draw a line to make the glass filled up with liquid and smile again! Try to find the best way to complete each level. You can come up with your own solution so be creative and don\'t be afraid to think out of the box! Some levels might look easy but let\'s see if you can actually get the 3 stars. features : * dynamic mechanism. Draw lines freely to complete levels! * Simple smart and fun puzzles but can be challenging too * Lots of levels with more coming soon! * Fun and relaxing theme that will make you stay for quite some time'),
