(17895, 'Fuzzy Seasons: Animal Forest', 36, 13, 2, 3103, 4.8, 12137, '63M', 0.00, '2018-08-06', '149', '4.1 and up', 'https://play-lh.googleusercontent.com/kqFFQ_-x4_mKtc7nyIM_W_LRjrzitnfAswqrOx0LDD0OFvV_HhaU0hFpViM3yCpQWg=s180-rw', 'https://play.google.com/store/apps/details?id=com.crossbug.myessentialoiloffice', 'This app bring all the most-sought after YL resources into a single app. My Essential Oil Office is intended to be used by all Young Living members but some options are only available for MagnifiScent Oilers team members. In this day and age everything is at our fingertips (literally as icons on our phone!). We want to be able to find information within a few clicks + cheaper options the better ? Combining this two needs this FREE mobile app is an essential addition to help our team members to easily manage the most used Young Living resources. No additional need to have 1 app for oil information 1 app for oil recipes another for managing orders etc...Everything is now bundled in a single app! Among the features include: ?Managing your Young Living Virtual Office via YL Login (e.g: Place ER orders) ?Essential Rewards Reminder ?Oils Education (e.g: Everything about oils!) ?DIY Recipes (Lemon Rosemary chicken anyone?) ?Seed To Seal Information ?Ningxia Red Information ?Savvy Minerals Information ?Young Living Blog Posts ?Young Living YouTube Videos ?Event Calendar (e.g: DIY classes Zoom Sessions ER Promo dates etc) ?Useful Documents (e.g: real-time update of OOS products) ?Audio Podcast (e.g: Interview with Adam Green Lindsey Moreno) ?Young Living Important Contact Info ? Meet the team (Find out more about the MagnifiScent Oilers family) And many more upcoming features! As part of our business team you will gain additional access to our exclusive ?Business Members Access? tab to grow your team too. Ain t that another reason to join our team?! After all essential oils are a lifestyle change. A Journey. You need someone who will be able to support you along the way instead of just selling you a kit and then disappear? If you are looking to explore Young Living Essential Oils why not drop us a PM or ? text: https://wa.me/60164855465 to know more about our team? We are looking to grow our team around the world ? Do share your feedback (especially what you like to see in the app) and please rate the app on Google Play Store :)'),
