(17995, 'Hello Kitty Lunchbox', 11, 16, 1, 17717, 4.2, 51838, '15M', 0.00, '2017-11-21', '1.6', '4.1 and up', 'https://play-lh.googleusercontent.com/aDX4QRdSBmlOTeWAsS5NbKcggupZ6_RSUzz7kLyIY91RChNDvEv26Czcqb-1rgt6FeE=s180-rw', 'https://play.google.com/store/apps/details?id=com.tinybuildgames.helloneighbor', 'Hello Neighbor is a stealth horror game about sneaking into your neighbor\'s house to figure out what horrible secrets he\'s hiding in the basement. You play against an advanced AI that learns from your every move. Really enjoying climbing through that backyard window? Expect a bear trap there. Sneaking through the front door? There\'ll be cameras there soon. Trying to escape? The Neighbor will find a shortcut and catch you.'),
