(18002, 'ABCmouse.com', 15, 16, 1, 2053, 4.3, 50887, '91M', 0.00, '2018-07-03', '7.2.0', '4.4 and up', 'https://play-lh.googleusercontent.com/KscsJAqOoD01cDuvYuwO8hbIxDnGUJRK1sOFN0PTCLlMl6Ulz1_RxQPB0ZXldTHD8Q=s180-rw', 'https://play.google.com/store/apps/details?id=com.bizurk.duel_calculator', 'This is the Ultimate Duel Calculator for fans of popular card games like Yu-Gi-Oh! and others to keep track of their life points and score. This app features a unique way for 2 players to share 1 phone. Ultimate Duel Calculator features: - Attack (Swipe forwards) - Heal (Swipe backwards) - Coin Flip - Dice - Undo - Redo - More! This app contains beautiful original sound effects and animations to help enhance the dueling experience and make the game more fun for everyone!'),
(18021, 'Essential Anatomy 3', 25, 12, 4, 13838, 4.1, 1533, '42M', 11.99, '2014-08-07', '1.1.3', '4.0.3 and up', 'https://play-lh.googleusercontent.com/qBEup_nEw_uGLuic7sJPWTP6y6XAmOuS3srKkGf2vHPQcw-biNdgBO0evzva03GhVgU=s180-rw', 'https://play.google.com/store/apps/details?id=com.syncfusion.xamarin.uikit', 'Essential UI Kit for Xamarin.Forms is a collection of reusable screens for Xamarin.Forms development. You can build mobile apps easier and quicker by focusing on the business logic and letting the Essential UI Kit take care of the UI part. This app helps developers explore all the screens in the Essential UI Kit. For more information go to https://github.com/syncfusion/essential-ui-kit-for-xamarin.forms'),
(18028, 'Diabetes & Diet Tracker', 25, 9, 1, 6913, 4.6, 395, '19M', 9.99, '2018-07-16', '6.5.1', '5.0 and up', 'https://play-lh.googleusercontent.com/capa3FyuyEwxtSNsV-PpWMT2dtF2raWqxclv5D7U4JGvhKqE2dii2zX2adWOzchmX-I=s180-rw', 'https://play.google.com/store/apps/details?id=org.filmoflix', 'Filmoflix - Films et Series en HD Gratuit : est la meilleure application que vous pouvez trouver sur la toile qui vous permet de regarder en Streaming HD VF VOSTFR. Des films et series TV gratuitement. Des films et series sont diffuses en Francais sous Formats MP4 Aucun paiement n est requis aucune inscription n est obligatoire. Les contenus sont actualises chaque semaine Nous ajoutons des films et series (saisons et episodes) des que vous faites la demande. Comme cela vient d\'etre mentionne plutot si jamais vous ne trouvez pas votre Film ou serie utilisez le formulaire pour en demander. Vous avez meme la possibilite de caster a partir de votre televiseur afin de projeter l\'image sur la tele et suivre les films & series en famille. CARACTERISTIQUES : ***************** - Contenue regulierement mis a jour (chaque jour sur demande) - Possibilite de Demander des films et serie par les utilisateurs - Caster les videos sur TV - Possibilite de rechercher des Films et series - Possibilite de creer une liste de lecture - Possibilite de constituer sa propre liste de films favoris (necessite l\'inscription) COTENUE ET VIE PRIVEE: ************************** Nous ne stockons aucun contenu sur nos serveurs. Les Films et series proposes dans l\'application proviennent des sources tiers. Vos informations ne sont collectees que dans le but de mieux offrir une experience utilisateur. Nous pouvons stocker votre adresse email votre numero de telephone au pendant l\'utilisation de notre application mais vous avez la possibilite de le faire supprimer sur demande.'),
(18069, 'GoodRx Drug Prices and Coupons', 25, 15, 1, 13697, 4.8, 59158, '11M', 0.00, '2018-07-26', '5.4.8', '4.1 and up', 'https://play-lh.googleusercontent.com/Keb1h2cmd_jPqzPR-eow8XhEzAa9-Ko0_L5g-KWT0cCjjCqlPBoMM0hBrDnk_WBUw-0=s180-rw', 'https://play.google.com/store/apps/details?id=com.subsplashconsulting.s_HP68H8', 'The Community Bible Church App connects you to sermons on-demand sermon notes family resources and more.'),
(18071, 'FollowMyHealth', 25, 15, 1, 17781, 4.6, 73118, '37M', 0.00, '2018-05-10', '3.3', '4.4 and up', 'https://play-lh.googleusercontent.com/UE9ly0vbu1t4YlkjAZ9znbDH_4s9DFUV2n2ydvB5iLMdhfuV8EyE6POYVZ6uXyVVJo4=s180-rw', 'https://play.google.com/store/apps/details?id=com.vistechprojects.millimeterpro', 'Millimeter is a screen ruler app. It uses full screen of Android device for distance and length measurements as caliper or tape measure. Place an object on the scale paper screen and simply touch and move rulers to measure it. Check features for more details. Pro version measures area circle radius and diameter angles ratio and splits into equal parts angle NO POP-UP ADS on your screen in the app unlike other free ruler apps on market. Best and real full screen ruler. ? ANY DEVICE can be calibrated for accurate measurements in Calibration Mode where common standard objects (coins credit cards etc) can be used as a reference. More about app: goo.gl/aF9L9Q ? posts about app: http://goo.gl/304nJB ? What you can do in Pro version of the app: - Calibrate Millimeter with custom or standard objects (?) - Ruler Mode for measure in metric and imperial units: mm and inch - Use fractions for inch units - Use app as standard ruler - Use full screen mode for better user experience in Ruler mode - Additional vertical ruler for 2D measurements (?) - Area measurement for 2D measurements (?) - Calculate W/H ratio of the rectangular objects in 2D - Parts Mode to split length or objects in equal parts - Thread per inch ( TPI ) measurement pattern (?) in Parts mode (https://youtu.be/M1Qrbs2bgCY) - Spirit / bubble level for checking incline or tilt angle ? - Circle Mode to measure circular objects (?) - Split circle into equal sector / angle - Protractor / Goniometer Mode - measure angles (?) - Lock / Unlock rulers in any mode for better usability (?) - Set exact size length diameter number of parts manually with keyboard input (?) - Change background to BW night mode for power saving (?) and better visualization (?) - turn on/of fine grid (1 mm for millimeter units) - Read interactive Help / Guide about all available features in a mode Use this screen ruler in different areas to measure small objects that fit your phone or tablet screen : jewelry jewels rings ?  stones screws bolts buttons diameter nuts knitting needles knitting pattern washers insects mosaic tile hooks thread frame wrap angle etc. Units: millimeter (mm) inch (in). Fractions are supported for inch units. Supported languages: - English German Russian Japanese and French languages. ? If you have any problems with the app on your device please contact support@vistechprojects.com first and we will help you. Thank you. VisTech.Projects Team. Note: measurement range limited by size of your screen and with fine calibration the app gives you accuracy comparable to standard ruler or measure tape.');
