(18076, 'Blood Pressure', 25, 16, 1, 7901, 4.2, 33033, '7.4M', 0.00, '2018-07-24', '3.27.3', '4.1 and up', 'https://play-lh.googleusercontent.com/TN8XXOEBUc7QnmS2EXiD_zERYGSoBwYNMdlo6uFAfqUuZhhYnnowyshz5YtLZqeMR-A=s180-rw', 'https://play.google.com/store/apps/details?id=com.szyk.myheart', 'Control your blood pressure with multiple build-in features like measurements analysis statistics graphs comprehensive reports your doctor will love and many other tools to analyse high or low blood pressure! Thanks to this app you will discover by yourself what when and how different factors influence your blood pressure! Please keep in mind that this app does NOT measure blood pressure! Key features: ? Very friendly and easy in use user interface ? Save edit or update your measurement ? Describe your records: ? Tags - write short descriptions and use them repeatedly ? Date and time of BP measurement ? The values (systolic diastolic pulse and weight) ? Description ? Blood oxygen saturation ? Support for multiple users. ? Interactive charts ? Statistics and blood pressure factors ? MAP - Mean Arterial Pressure ? PP - Pulse Pressure ? 24h average ? Chart ? Cards with comparison of different time periods and factors ? and much more! ? Export data: ? CSV ? PDF - detailed reports ? graphs and statistics from app ? Import CSV files from app or OMRON connect ? Reminders - helps to monitor blood pressure on a daily basis ? Filters - unlimited possibilities in your hand. Decide what data the application will show analyse or export! ? Appearance - Customise the appearance of the application to your needs ? Light and Dark theme ? Customizable colors for values of systolic diastolic pulse and weight. Especially useful for color blind users ? Categories: Choose from various blood pressure standards like JNC7 JNC8 ESH/ESC Isolated Hypertension Hypotension ? Backups all your blood pressure data so no need to worry about loosing them Visit Support page with more detailed instructions http://www.klimaszewski.mobi/help Remember that you still need to have a blood pressure monitor in order to read the measurement. In addition this application does not replace professional medical treatment and care!'),
(18078, 'Doctor On Demand', 25, 15, 1, 4789, 4.7, 18674, 'Varies with device', 0.00, '2018-07-27', '3.25.0', '4.4 and up', 'https://play-lh.googleusercontent.com/qVZjQkmNzzuigMu7vbglU_Ql08Y9Tq3bCmaf-esVasmm_IXhrYKuoeIT3s7VGru1xto=s180-rw', 'https://play.google.com/store/apps/details?id=com.bubadu.doctorkids', 'With the help of this game you can see what is like to be a doctor and treat kids in a children\'s hospital. You can make them healthy again and put a smile back on their faces. Children are coming to the clinic and they need your help to get better. Once you appoint the little patients to the right doctor s office you can have fun playing interactive minigames and treat kids in no time. Game presents different kinds of doctors and treatments with many colorful objects to match patients  characteristics. Every doctor s office includes a unique minigame to make treatment even more fun. And don t forget about the ambulance car that is always in a hurry. Within this game you can do the following: Appoint your patients to the dentist to brush and fix their broken teeth. Diagnose patients to heal them from strange diseases. Make an eye examination test to improve kids  eyesight. Use a microscope to make some lab tests and eliminate viruses. Use the X-ray machine to scan bones. Drive an ambulance car and give first aid to patients. Treat an ear infection and take a hearing test in the Xylophone minigame. Features: - beautiful high quality HD graphics - intuitive easy to use user interface - infinite gameplay with numerous combinations - many different patients in various clothes - offers 7 unique doctor s offices: dental care eye check skin rashes cure lab test and X-ray ear doctor ambulance car with emergency room (ER doctor) - includes 7 thematic minigames - tons of colorful plasters bandages braces glasses and syrup flavours This game is free to play but certain in-game items and features also some of those mentioned in game description may require payment via in-app purchases which cost real money. Please check your device settings for more detailed options regarding in-app purchases. The game contains advertising for Bubadu s products or some third parties which will redirect users to our or third-party site or app. This game is certified compliant with the Children s Online Privacy Protection Act (COPPA) by FTC approved COPPA safe harbor PRIVO. If you would like to know more about the measures we have in place for protecting child privacy please see our policies here: https://bubadu.com/privacy-policy.shtml . Terms of service: https://bubadu.com/tos.shtml'),
(18079, 'BioLife Plasma Services', 25, 13, 1, 8514, 3.5, 250, '23M', 0.00, '2018-07-09', '1.2.0', '4.4 and up', 'https://play-lh.googleusercontent.com/b-22jPZG83OZfbU0ig9JsUHpyp-CtMWaJiGKB5DWTYmpOHhVPW5-jfF4ugrVKJUu4xk=s180-rw', 'https://play.google.com/store/apps/details?id=com.Aslikolkatakachalta.jadu.com.Aslikolkatakachalta.jadu', 'Kolkata Ka Qadeemi Book Kitaab Mashoor Zamana Asli Kolkata Ka Chalta Jadu Jadu Asli Amal Daraaz Download Amliyaat Jaduvi Kitaab Books PDF Free Devloper By Sajjid Ali - Love Story Life'),
(18083, 'Anthem Anywhere', 25, 14, 1, 8040, 2.7, 2657, '24M', 0.00, '2018-07-27', '8.0.226', '4.4 and up', 'https://play-lh.googleusercontent.com/6I-ntAODhM6zfAIZYOwGjCC-u_kKbk12Vn5a20wVdc2H6x2oc3q1gHsyhtbhlierWSTW=s180-rw', 'https://play.google.com/store/apps/details?id=com.lc.raisedsilvertheme', 'This theme will change the look of your desktop/home screen and application drawer icons and must be selected from Nova or Apex launcher. This app cannot be launched directly and must be selected in a one of the supported launchers. If you have issues please email me at lcdroiddev@gmail.com and/or review the instructions below. If you find bugs or have suggestions please email me as posting a review will not provide the details of your issue or suggestion. INSTALLATION - Make sure Nova Launcher or Apex Launcher is compatible with your device before downloading. The theme may work with other launchers. - Apex Launcher: Go to Apex Settings ? Themes ? Downloaded ? select the theme you just installed. - Nova Launcher: Go to Nova Settings ? Look and Feel ? select the desired theme. The theme has no permissions or advertisements.'),
(18084, 'Blood Donor', 25, 14, 1, 701, 4.2, 4476, '20M', 0.00, '2018-07-31', '1.6.2', '4.1 and up', 'https://play-lh.googleusercontent.com/bL9E_qcCFNqQwADLLvUE7dfqaJF3-ZB_07JaJHyDQbaMydIO52WsfXtTGqt7EzEgP50=s180-rw', 'https://play.google.com/store/apps/details?id=com.rohiapps.bloodpressureRecorder', 'Blood pressure recorder app is blood pressure History manager app which is very help full application for BP patient to manage history. Using this blood pressure history tracker app you can save record Monthly and daily basis. BP Tracker diary app and blood pressure Diary gives you good data base facility to save weight and pulse history date wise and compare the entries. You can manage and analyzed your report of blood pressure in a single blood pressure Diary app. Normal Blood Pressure Range is as fellow: Systolic less than 120 mmHg Diastolic less than 80 mmHg Pulse Rate 70 mmHg Normal weight 70 kg Using Blood pressure recorder & BP diary info you can see the monthly and daily record info and measure Blood pressure graph. Using BP info graph you can see the graph of BP record Using BP tips you can view the BP control tips and guide to handle pressure Tips & information to Control blood pressure Avoid eating Sugar Avoid eating frozen pizza Avoid eating Pickles Avoid eating t canned soups Avoid eating canned or bottled tomato products Avoid eating Chicken skin and packaged foods To eat these things To Eat Bananas To Eat Dark chocolate To Eat Leafy green vegetables To Eat Garlic To Eat Fermented foods Blood Pressure recorder diary and blood pressure diary is simple and good app to keep record of all Blood pressure units systolic diastolic pulse rate on hourly  daily weekly basic to manage all history of bp reading. It very important for bp patient to keep blood pressure in control other vise Hypertension and hypotension may result in cause of different diseases. Blood pressure diary 2019 is also a blood pressure tracker app to get all detail and history of bp reading of last days and current Blood pressure recorder & Bp diary help you to manage bp history. Blood pressure Tracker & Bp diary help you to see the graph of bp Blood pressure recorder & Bp diary help you to see the be control tips Note: Blood pressure recorder & bp diary does not measure Bp. Its only mange history of patient which he entered. We will always welcome your feedback to improve the app. Thanks'),
(18088, '1800 Contacts - Lens Store', 25, 15, 1, 10784, 4.7, 23160, '26M', 0.00, '2018-07-27', '7.4.1', '5.0 and up', 'https://play-lh.googleusercontent.com/uBXSQUBUC4lIOUhkJEAJaj-r-Y6ZffyYCjjjTMPKBkab-w8R9hEsvhhmt4Wv6bbymdk=s180-rw', 'https://play.google.com/store/apps/details?id=com.pikpok.cf.play', 'Transform an unproven college football team into American Legends! As the head coach of a college football program you make the calls. Recruit fresh talent build an unbeatable playbook and make risky plays for big payoffs. Join forces with players from around the world to form alliances and take on rivals. With big dreams and even bigger challenges the team will rely on your leadership to take them to the top. Will they make it to the Hall of Legends? Rise to the challenge with Rival Stars College Football! FEATURES: ? Hundreds of athletes to recruit train and level up. Boost player performance and propel your team towards legend status! ? Manage YOUR team YOUR way. Develop winning strategies call the plays and make tough decisions on the field! ? Action-packed live global tournaments have you going head to head against real world opponents! Rise through the ranks to win big rewards! ? Team up with others by joining an alliance or forming your own. Share strategies chat with friends and compete against rivals. ? Witness the hard hits and big plays up close in game highlights! Rival Stars College Football is free to play but offers some game items for purchase with real money. This app includes advertising some of which may be targeted to your interests. You may choose to control targeted advertising by using your mobile device settings (for example by re-setting your device s advertising identifier and/or opting out of interest based ads). The app also includes: - In-app purchases that cost real money - The option to accept push notifications to let you know when we have exciting updates like new content - Advertising for some third parties including the option to watch ads for rewards'),
(18089, 'Blood Pressure Log - MyDiary', 25, 14, 1, 2086, 4.7, 8348, '2.6M', 0.00, '2018-04-13', '1.4.6', '4.0 and up', 'https://play-lh.googleusercontent.com/AyLm-_TpO1GOAmi5AKQnILsCXvh1cacumnumYW6WMzOgQT956K_SX3uPEcrGe4E6oDQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.zlamanit.blood.pressure', 'Blood Pressure Log with reminders lots of statistics and ability to export data. The app does NOT measure the blood pressure. Adding blood pressure measurements is very easy thanks to a clean user interface and a dedicated keypad. The blood pressure log can be viewed not only in a table but also in a number of charts and statistics. You can print the log or send it directly to your doctor. Blood Pressure Log ?-?Log the blood pressure readings ?-?Add the cuff location and the body posture ?-?See interactive charts statistics and a summary ?-?Print reports or share the data by email ?-?Import data exported from other apps (using the CSV format) Additional Features ?-?Track weight glucose and oxygen saturation ?-?Define custom ranges for low and high blood pressure ?-?Add custom tags and description to each measurement ?-?Customize ranges for low and high blood pressure ?-?Filter the displayed data Export Data ?-?Save to a file or send by email ?-?Generate reports for the MS Word ?-?Create Excel spreadsheets ?-?Export to CSV or XML data formats Problems ideas or questions?Contact: info@mydiary-bloodpressure.com'),
(18094, 'CVS Caremark', 25, 14, 1, 10541, 3.5, 3707, '10M', 0.00, '2018-07-28', '4.36', '4.4 and up', 'https://play-lh.googleusercontent.com/ZKNXSxb0c-3jUbXzwDihnDAub279LIQEHhEJGp_j3IqypwVZ8weYKOLoeUs83d9ZcvQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.alomair.mod.cveditor', 'A social network and virtual platform that allows you to introduce yourself connect with others and share information about business opportunities and other interests. The platform provides the following services: 1- Resume (CV) Create your own CV and your business card and share it with lots of ready-made templates. 2. Career opportunities Keep up with the new career opportunities through many sources and apply to them with easy. 3. Postings and advertising Add your own postings and advertise yourself to appear to many followers. The CV contains two types: 1- Public CV: Create your CV and your business card which you can access from any device and share with lots of ready-made templates once you sign in to your account. 2- Private CV: Create your CV and business card on your device and share it with lots of ready-made templates. Notes: * Public CV appear in the list of job seekers and anyone can search for it and see it according to the privacy settings in your account. * Private CV not be seen by anyone except you.'),
(18096, 'Ada - Your Health Guide', 25, 15, 1, 575, 4.7, 87418, '14M', 0.00, '2018-07-16', '2.25.0', '4.4 and up', 'https://play-lh.googleusercontent.com/nrZjgITchOX_fQwykerw8eflueGYxVkhJPjeC8Kot_MFSLEhf6TmmaHRj0I_21eXigg=s180-rw', 'https://play.google.com/store/apps/details?id=com.ada.app', 'Ada helps you and your loved ones check symptoms and discover what might be causing them - day or night without an appointment. Whatever s bothering you from stomach problems to headache Ada s free symptom checker can help you find answers and let you know if you should see a doctor. Join the 10 million people who have already downloaded the world\'s most popular symptom check.? Doctors trained Ada for years so you can get a prediagnosis within minutes. How do free symptom checks work? You answer simple questions about your own or someone else s health and symptoms. Ada s AI assesses your answers against its medical dictionary of thousands of disorders and medical conditions. You receive a personalized assessment report that tells you what could be wrong and what to do next. What can you expect from an assessment? - Data privacy and security - we apply the strictest data regulations to protect you and keep your information private. - Smart results - our core system connects medical knowledge with intelligent technology. - Personalized health information - your guidance is personal to your unique health profile. - Assessments for loved ones - if you assess someone else their information stays separate from your own. - Health checks - your assessments include information that may be relevant and helpful to your doctor. - 24/7 access - you can use the free symptom checker anytime anywhere. What can you tell Ada? Ada answers medical questions of every kind. Here are some of the most common searches: Symptoms - Fever - Allergic rhinitis - Loss of appetite - Headache - Abdominal pain and tenderness - Nausea - Fatigue - Vomiting - Dizziness Medical conditions: - Common cold - Influenza infection (flu) - Viral sinusitis - Diabetes - Tension headache - Migraine - Chronic pain - Fibromyalgia - Arthritis - Allergy - Irritable bowel syndrome (IBS) - Anxiety disorder - Depression Categories: - Skin conditions such as rashes acne insect bites - Pregnancy - Children s health - Sleeping problems - Indigestion issues such as vomiting diarrhea - Eye infections Disclaimer The Ada Health App is a Class I medical device in the European Union. Registration in other markets is pending. CAUTION: Ada cannot give you a medical diagnosis. Contact urgent care immediately in an emergency. Ada does not replace your healthcare professional\'s advice or an appointment with your doctor. We want to hear from you. If you have any feedback or just want to get in touch reach us at hello@ada.com'),
