(18194, 'Blood Pressure(BP) Diary', 25, 15, 1, 701, 3.7, 3596, '8.4M', 0.00, '2018-07-18', '4.0.9', '4.0.3 and up', 'https://play-lh.googleusercontent.com/bL9E_qcCFNqQwADLLvUE7dfqaJF3-ZB_07JaJHyDQbaMydIO52WsfXtTGqt7EzEgP50=s180-rw', 'https://play.google.com/store/apps/details?id=com.rohiapps.bloodpressureRecorder', 'Blood pressure recorder app is blood pressure History manager app which is very help full application for BP patient to manage history. Using this blood pressure history tracker app you can save record Monthly and daily basis. BP Tracker diary app and blood pressure Diary gives you good data base facility to save weight and pulse history date wise and compare the entries. You can manage and analyzed your report of blood pressure in a single blood pressure Diary app. Normal Blood Pressure Range is as fellow: Systolic less than 120 mmHg Diastolic less than 80 mmHg Pulse Rate 70 mmHg Normal weight 70 kg Using Blood pressure recorder & BP diary info you can see the monthly and daily record info and measure Blood pressure graph. Using BP info graph you can see the graph of BP record Using BP tips you can view the BP control tips and guide to handle pressure Tips & information to Control blood pressure Avoid eating Sugar Avoid eating frozen pizza Avoid eating Pickles Avoid eating t canned soups Avoid eating canned or bottled tomato products Avoid eating Chicken skin and packaged foods To eat these things To Eat Bananas To Eat Dark chocolate To Eat Leafy green vegetables To Eat Garlic To Eat Fermented foods Blood Pressure recorder diary and blood pressure diary is simple and good app to keep record of all Blood pressure units systolic diastolic pulse rate on hourly  daily weekly basic to manage all history of bp reading. It very important for bp patient to keep blood pressure in control other vise Hypertension and hypotension may result in cause of different diseases. Blood pressure diary 2019 is also a blood pressure tracker app to get all detail and history of bp reading of last days and current Blood pressure recorder & Bp diary help you to manage bp history. Blood pressure Tracker & Bp diary help you to see the graph of bp Blood pressure recorder & Bp diary help you to see the be control tips Note: Blood pressure recorder & bp diary does not measure Bp. Its only mange history of patient which he entered. We will always welcome your feedback to improve the app. Thanks'),
(18198, 'Airway Ex - Intubate. Anesthetize. Train.', 25, 11, 1, 8319, 4.3, 123, '86M', 0.00, '2018-06-01', '0.6.88', '5.0 and up', 'https://play-lh.googleusercontent.com/GEwulG7h3b1iYQwkAvwFoXwH_hTbCVYgbqfawqelVZbVZFQDwxYlLV5dTd4yBebT-7tj=s180-rw', 'https://play.google.com/store/apps/details?id=com.levelex.airwayex', 'Perform challenging airway procedures sharpen your intubation skills and earn CME with Airway Ex the first professional video game for practicing Anesthesiologists CRNAs and medical professionals who perform airway procedures. In Airway Ex you can: - Explore realistic airway procedures recreated from real cases submitted by doctors - Train on the latest endoscopic devices with realistic range of motion lens optics and scope behaviors - Earn Continuing Medical Education (CME) credits when you play through cases - Get scored on skill speed damage bleeding navigation recall and more - Treat patients that are responsive with changes in tissue behavior breathing bleeding and fluids/secretions - Monitor responsive Sp02 and HR vital signs based on stability or distress caused to virtual patient MORE ABOUT AIRWAY EX: Our app provides unprecedented medical realism enabled by the accurate simulation of human tissue dynamics realistic scope optics and moving fluids to recreate life-like airway procedures. We also provide a new modality for continuing medical education (CME) offering AMA PRA Category 1 Credits(TM) for completing airway procedures in-app. Virtual patient cases are modeled from actual surgical procedures submitted by doctors. Each case is vetted by medical experts with clinical simulation training experience from top hospitals. Airway Ex lets you train using ultra-realistic patient scenarios with high-quality immersive simulations. Find out more at www.levelex.com/games/airway-ex.'),
