ge in Spread Combination file. This feature also enables users to place Multi-leg orders as supported by respective exchanges. Watchlist:- Create multi-asset watchlist View your own holding watchlist on screen. Alerts:- Set price alerts for instant updates via mobile notifications based on real-time market feeds More products:- Invest in US Market through PL Vested & Enter Bid in IPO in just few clicks. Download PL Trade Plus Trading App for a seamless stock market investment experience. Open Demat Account and start your trading experience in just a few clicks! Why Online Trading Account with Prabhudas Lilladher:- Open Demat Account in 7 mins and initiate trading Get access to PL s award-winning research across our Technical Derivatives and Fundamental ideas Experience our fast trading platforms- Trade Plus APP & WEB and ODIN Diet Customer Support:- For any further assistance you can call us on 1860210222 or send an email to customerconnect@plindia.com. For more details Visit our website - https://www.plindia.com'),
