uct 4. You can also add products to your wishlist with a single tap 5. To place the order choose among easy payment options like Flipkart Pay Later Cardless Credit Cash on Delivery (COD) debit card credit card net banking or UPI enabled PhonePe 6. Track your orders inside the app get notifications on personalized offers price drops order status exclusive launches and upcoming sale events _____________________________________ Permissions In addition to basic permissions the Flipkart shopping app needs access to other functions on your device for it to support the above features - - Device and App History: To detect critical crashes and recover the app state - Identity: For native login functionality with your Google account - Phone: Read call logs to check eligibility for Buy Now Pay Later option - SMS: To auto-verify OTPs and determine your eligibility for Flipkart Pay Later Cardless Credit _____________________________________ You can contact our 24x7 customer support for any product or delivery related issues. Download Flipkart app now and start shopping!'),
