(18454, 'Flickr', 30, 17, 4, 4444, 4.3, 251951, '16M', 0.00, '2018-07-11', '4.7.3', '4.4 and up', 'https://play-lh.googleusercontent.com/BwNdcCGATpj4OK7Zq8r7KRLDefexOLSeoL1ccp5dKyH7IG0sFPNnSz8JrkwhNf_7lng=s180-rw', 'https://play.google.com/store/apps/details?id=ae.justfixuae.justfix', 'We repair broken or cracked iPhones smartphones iPads MacBook iMac and laptops in Abu Dhabi. JF got a call from a customer I was as like always with shattered iPhone but I received his call and he said just a few days ago his youngest daughter was playing in the living room with the family\'s iPad device. Not Exactly within a few moments the iPad fell to the floor and broken the entire screen. There was a spider web looking crack covering his newly purchased iPad device. Alas! Fortunately he knew the company in Abu Dhabi that specializes in Apple products cracked screen repair and replacement. He call to JF and we had an appointment set up with him a few hours later on his door step. JF feeling good to help them.'),
(18459, 'Cymera Camera- Photo Editor, Filter,Collage,Layout', 30, 19, 1, 12473, 4.4, 2418135, 'Varies with device', 0.00, '2018-07-12', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/7Zy-tLXcGSmbwA2nW7fNzO9ixXcXNJ1465MsJEHMAknd4TNTKmCgVS3N3xWEbdoYFIXy=s180-rw', 'https://play.google.com/store/apps/details?id=com.cyworld.camera', 'Cymera Photo Editor is a free selfie camera App for all Android users. New effects in 2021 ?Enjoy the new collection of beautiful Spring Season effects! ? You will dive into amazing frames collages filters and stickers of spring-season cherry blossom and flower stickers that will definitely look awesome on your pics. Decorate and edit your photos with spring-season effects to create personalized eCards that are inspirational funny and beautiful!? We have updated our photo editor with new effects such as selfie camera beauty camera face tune healthy skin tool photo crop tool for YouTube Thumbnail Instagram and Facebook cover. With Cymera you can use body retouch feature blur background live filters stickers makeup effects and much more! We offer a 100% free tools for all users. You can post your photo or selfie directly to Instagram Facebook WhatsApp and Twitter in just one tap! Main Features - Real-time Selfie Filters. - Crop tool for YouTube Thumbnail Instagram and Facebook cover. - DSLR Blur Effect. - Selfie filter & beauty makeup tool. - Collage Maker & Poster tool. - Insta 1:1 square & blur background for Instagram. - Add Beautiful Smile. - Smaller & V-shaped face. - Body and Face Editor. - Vintage Natural Neon Lomo Film Sketch Fisheye and more. - Skin Glow tool. - MEME editor. - Adjust brightness contrast color temperature and saturation. - Import Directly From Google Photos. ?Beauty Camera - Professional beauty tools for your skin makeup slim or face reshape remove wrinkles erase face pimples and dark circles. - Hundreds of amazing beauty filters and makeup effects. - Real-time beauty camera selfie effects & makeup camera ?Amazing Filters - Perfect instant selfies with +150 filters. - Free filter packages for selfie nation flags air shape vintage-feel pastel colors film-effect black & white. - Lens flare effects or light laked effects. - Create your own collection of favorite filters. ?Camera Lenses and Silent Mode - 7 different and fascinating camera lenses. - Anti-shake timer touch shooting out-focusing options. - Silent mode to shoot wherever you want without disturbing others. - Bluetooth connection is available for selfie sticks with remote. ?Simple and Easy for Collage - Choose photos from your gallery and instantly see them laid out in a cool collage. - Crop tool that helps you to customize your YouTube thumbnails. With Cymera you can take a video sized image and fit it to the Instagram size requirements and even add text and texture to the frame. - Different types of grid to combine photos (up to 9 photos) into one. - Change the size of the photo grid. 100% match on Instagram Facebook Twitter Youtube Thumbnail. ?Body Retouch Photo Editor - Instantly taller lengthen your legs reshape your body. - Stunning feature to Slim your waist. - The best photo editor to lift your hip. - No more bow legs. Get a sexy shaped legs in few seconds. ?Super Easy and Fast Editing Tools - Brightness contrast mosaic rotate and more. - High quality resolution for clean and clear photos. - Advanced red eye removal function. - Color splash feature. ?Upgrade with Unique Items - Cartoon stickers including animal face beauty filters light effects frame. - Brush tool for hand writings and drawings. - Variety of fonts. ?Retouch or Adjust Photos Instantly - Automatic face recognition including enlarge eyes smile and slim feature. - Skin corrections using skin glow and concealer tool. +200 kinds of natural hair and face makeup tool. Sharing Photos & Smart Gallery - Organize photos by date location selfies etc. - Send or share your photos on your social media channel or other instant chat. Cymera Photo Editor Language Support Korean English Spanish German Japanese Chinese Thai Portuguese Russian Indonesian Turkish and Vietnamese.'),
