(18483, 'HD Camera for Android', 30, 17, 1, 9502, 4.1, 351254, '4.0M', 0.00, '2018-06-29', '4.6.0.0', '4.2 and up', 'https://play-lh.googleusercontent.com/9BkxV5WHU52lvF3dSy7RvGtbw_eCIb-aoiGzRkg80AY98QEZuqa54gtzR9fl6DImO3VI=s180-rw', 'https://play.google.com/store/apps/details?id=photo.android.hd.camera', 'This is an native android system camera app. HD Camera utilized all advantage of your phone or tablet. Let you snaps quick and easy photos and videos. Key features: - camera and video features - 3 modes: camera video recorder & panorama - Pinch to zoom - smart panorama shooting - Countdown Timer - Dynamic user interface (phone/tablet) - Wide screen pictures - Picture quality setting - White balance settings(Incandescent Fluorescent Auto DaylightCloudy) - Screen mode settings(Action Night Sunset Play) - Exposure - Location targeting - Configurable volume keys - Photo Callage - Photo crop and photo editing. Although in the current market there are have many kinds of camera applications but we still think this android native application is the most efficient and able to meet a user needs. Here only as a supplement for those devices are not installed android native system provides an additional option. Notes: The special permissions for use 1 android.permission.ACCESS_FINE_LOCATION HD Camera can remember your photos and videos location if you wish. Other apps can access this information along with your saved images. 2 android.permission.READ_CONTACTS After you take a photo you can share with others. HD Camera need to read the contacts information and help you share photos via email SMS or other apps. ------------------ Disclaimer? This app is based on native android camera code and licensed under the Apache License. code: https://github.com/CyanogenMod/android_packages_apps_Camera2 Apache Licens: http://www.apache.org/licenses/LICENSE-2.0.html'),
