cial to us. We ll do whatever it takes to get you better no matter what! A Premium subscription unlocks Fitivity s entire collection of over 500+ apps. For any app get access to all content. Fitivity Premium gives you access to thousands of HD videos 55000 workouts and over 10000 weeks of sports and fitness training! Use a single email to use your Fitivity Premium subscription on up to five (5) total Android devices. Get Fitivity Premium for as low as $5.99/month! Perfect for the family! Let the kids choose from hundreds of sports dance and martial arts apps while the parents get into the best shape of their lives! If you re a coach give your team an advantage with a subscription to Fitivity! Payment will be charged to your credit card through your Google Play account at confirmation of purchase. Subscription renews automatically unless cancelled at least 24 hours prior to the end of the subscription period. There is no increase in price when renewing. Subscriptions can be managed and auto-renewal turned off in Account Settings in Google Play after purchase. Once purchased refunds will not be provided for any unused portion of the term.'),
