(18586, 'Golfshot: Golf GPS + Tee Times', 38, 14, 1, 14992, 4.3, 7543, '25M', 0.00, '2018-07-11', '1.31.0', '4.1 and up', 'https://play-lh.googleusercontent.com/ZEGjMuvI1b3S5GfE2ZniFhYsR_o-hkNw9CqvfHMDNp4ysnf0arr0KfFZydH9LH-miw=s180-rw', 'https://play.google.com/store/apps/details?id=co.akiliandme.curiousreader.liketodo_french', 'QU\'EST-CE QUE VOUS AIMEZ FAIRE ? Apprenez a connaitre Akili et ses amis et ce qu\'ils aiment faire ! Qui aime sauter au sommet d\'une montagne ? Qui est le peintre a la palette coloree ? Et qui est celui qui ne peut pas s\'arreter de danser ? Tout cela sera revele dans cette histoire enrichissante. Partagerez-vous avec Akili ce que vous aimez faire ? PRINCIPALES CARACTERISTIQUES * LISEZ en choisissant parmi trois niveaux de difficulte * EXPLOREZ des mots des images et des idees grace a differentes fonctions interactives * ECOUTEZ l\'histoire integrale ainsi que les mots individuels * CHOISiSSEZ ou Akili ira ensuite - faites vous votre propre histoire * AKILI raconte toute l\'histoire elle-meme * AMUSEZ-VOUS en apprenant a lire TELECHARGEMENT GRATUIT AUCUNE PUBLICITE AUCUN ACHAT DANS L\'APPLICATION ! Tout le contenu est 100% gratuit cree par les associations Curious Learning et Ubongo. L\'EMISSION DE TELEVISION - AKILI AND ME Akili and Me est un dessin anime ludo-educatif d\'Ubongo createur d\'Ubongo Kids et d\'Akili and Me - de magnifiques programmes d\'apprentissage realises en Afrique pour l\'Afrique. Akili est une petite fille curieuse de 4 ans qui vit avec sa famille au pied du mont Kilimandjaro en Tanzanie. Elle detient un secret : chaque nuit lorsqu\'elle s\'endort elle entre dans le monde magique de Lala Land ou elle et ses amis les animaux apprennent tout sur le langage les lettres les chiffres et l\'art tout en developpant leur gentillesse et en s\'attaquant a leurs emotions et aux changements rapides de la vie des tout-petits ! Avec une diffusion dans 5 pays et un suivi international en ligne massif les enfants du monde entier adorent partir a l\'aventure avec Akili ! Regardez les videos de Akili and Me en ligne et consultez le site www.ubongo.org pour savoir si l\'emission est diffusee dans votre pays. A PROPOS D\'UBONGO Ubongo est une entreprise sociale qui cree des ludo-educations interactives pour les enfants d\'Afrique en utilisant les technologies dont ils disposent deja. Nous divertissons les enfants pour qu\'ils APPRENNENT et AIMENT APPRENDRE ! Nous nous appuyons sur le pouvoir du divertissement la portee des medias et la connectivite des appareils mobiles pour offrir des programmes ludo-educatifs cibles et de haute qualite. A PROPOS DE CURIOUS LEARNING Curious Learning est une association a but non lucratif qui se consacre a la promotion de l\'acces a des contenus d\'alphabetisation efficaces pour tous ceux qui en ont besoin. Nous sommes une equipe de chercheurs de developpeurs et d\'educateurs qui se devouent pour donner aux enfants du monde entier une education a l\'alphabetisation dans leur langue maternelle basee sur des preuves et des donnees. A PROPOS DE L\'APPLICATION Lire avec Akili - Plusieurs Lieux Differents ! a ete cree grace a la plateforme Curious Reader developpee par Curious Learning pour creer des experiences de lecture interactives et captivantes.'),
