(18614, 'Cricbuzz - Live Cricket Scores & News', 38, 18, 1, 3210, 4.5, 838765, 'Varies with device', 0.00, '2018-05-18', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/LGAwt1hJ_6eK0Y4Vr9MgtGt6ne4tHhXHqUNf4x6OpuWVmF8xs1DxGJTh3PviEYB0wA=s180-rw', 'https://play.google.com/store/apps/details?id=com.cricbuzz.android.vernacular', 'Cricbuzz the No. 1 Cricket App on Google Play now brings Cricket in Hindi Tamil Kannada Telugu Marathi and Bengali. The app provides ball-by-ball coverage of all international cricket matches (Test ODI and T20) Indian Premier League (IPL) ICC Cricket World Cup Champions League T20 Big Bash and other major domestic tournaments from across the globe in regional languages. Top Features: - Live cricket scores and ball by ball updates that helps you stay close to the action. - Squads Playing XI Umpires Venues - all the information you need about ongoing matches. - Upcoming matches - what\'s up for tomorrow next week next month? - Results of recent matches - in case you want to look at the scorecard of a game that you recently missed. - Player profiles - Cricket is all about the players - runs wickets and everything else. Important Note: - Some handsets do not support certain regional languages. So if you are not able to find any of the above mentioned languages in the list it is a device specific issue. - For the Complete Cricket App in English (which includes ball by ball commentary news photos rankings archives and much more) download this version of the Cricbuzz App here: https://play.google.com/store/apps/details?id=com.cricbuzz.android'),
