(18621, 'Expedia Hotels, Flights & Car Rental Travel Deals', 41, 17, 1, 4696, 4.1, 136626, '14M', 0.00, '2018-08-06', '18.30.0', '5.0 and up', 'https://play-lh.googleusercontent.com/tg70Viipx73KZE8vjUeGgFqQt9NMDoDVSeU2jQBRBxXvjrn4_9LrNfE22IvqMCm4Rgzn=s180-rw', 'https://play.google.com/store/apps/details?id=com.expedia.bookings', 'Exclusive savings on hotels flights cars and travel for the ultimate travel experience. Book your hotels flights rental cars things to do and bundle deals on the app and get Double Expedia Rewards points! Over 500000+ hotels worldwide including some of the best hotels in the US including boutique hotels luxury hotels airport hotels hostels B&Bs and resorts. Free cancellation on most hotels. Because flexibility matters. From planning to booking the Expedia App is designed to enhance your travel and hence acknowledged as Webby for People\'s Voice: Best Travel App. Save with mobile-exclusive hotel deals and stay one step ahead with flight hotel and car alerts and view your trip details anytime anywhere. Save big when booking bundle deals: - Select your perfect hotel and ideal flight - Keep an eye out for Unreal Deals - View your flight and hotel details together and marvel at all you ve saved Save big on hotel rooms: - Save up to 25% with mobile-exclusive hotel deals for tonight or any night - Sort by price free cancellation deals or reviews to find a hotel perfect for you - Read real reviews from verified hotel guests Find your perfect flight: - Choose from hundreds of airlines - Sort by price no change fees flights duration or departure and arrival time - Book all class types from economy to first class seats Get going as soon as you land: - Enjoy round-trip car rentals from any airport - with no cancellation fee - Reserve a car rental up to 30 minutes in advance - Choose from our selection of standard car rentals luxury autos SUVs and more Discover and book things to do: - Browse and book activities for hundreds of destinations worldwide - Get tickets for tours shows and theme parks museums and more - Reserve airport shuttles and ground transportation Book in a flash and get rewarded for your travel: - Already signed in? Complete your booking in less than 30 seconds - Earn double Expedia Rewards points on all your purchases Your trip companion no matter the device: - View upcoming trip details hotel address information and get maps for directions - Receive alerts for flight delays hotel check-out times and more - Share itineraries with family and friends via email or text message - Get inspired with our curated tablet travel collections Download the Expedia App for hotels flights cars rentals activities and bundle deals today! *Limited quantity while supplies last. Terms and conditions apply. Only available for customers residing in the US. *Savings based on all vacation package bookings with Flight + Hotel on Expedia.com from September 2013 through February 2014 as compared to price of the same components booked separately. Savings will vary based on origin/destination length of trip stay dates and selected travel supplier(s). Savings not available on all packages. The Expedia app uses information for analytics personalization and advertising. By using our app you agree to our privacy and cookies policies.'),
(18623, 'Hopper - Watch & Book Flights', 41, 16, 1, 6111, 4.4, 52029, 'Varies with device', 0.00, '2018-06-29', 'Varies with device', '5.0 and up', 'https://play-lh.googleusercontent.com/uJoI8abM1ueLSR2aM4hyt3Z43LHZaLbH3GKsN9pj7m9dxUgw7TWLM1SKAVk2vVSgZ80=s180-rw', 'https://play.google.com/store/apps/details?id=com.h8', 'This application contains aerial photograph V sign face tracking. And these function of preview take photos  picture recording can come true by HuiYuan\'s UAV. You can also through the classic body feeling or rocker model to control the UAV.'),
(18626, 'CityMaps2Go Plan Trips Travel Guide Offline Maps', 41, 15, 1, 10634, 4.3, 64713, '58M', 0.00, '2018-06-09', '10.9.8 (Play)', '5.0 and up', 'https://play-lh.googleusercontent.com/ogj5IhlxUAWmhMoNSjxuSew7vRqPbOCrkS2WQtOdOWLB4tqQcSaR7oCAy4FcSTs6cbA=s180-rw', 'https://play.google.com/store/apps/details?id=com.OppanaGames.CarSim', 'You will really feel like you are behind the wheel of a car. Cruise around the city in your car with friends and experience how cool and difficult it can be at the same time. Explore the city and perhaps you will find something interesting. You have a 360-degree view of the cabin. Fun companions are waiting for you to join them in the game. Set up a race according to your own rules! Turn on the music and let\'s go!!!! The game offers online mission races (in multiplayer mode) where you can compete with real players defeat them and earn more money. Tips: 1. Do not speed. Drive carefully in order to avoid crashing or damaging your car. 2. Beware of the traffic police. If you speed then you will get a ticket. 3. Pay attention to the interactive hints. 4. Don\'t forget to fill up your car with gas at the gas station. 5. It is cheaper to pay a bribe than the official ticket. 6. For your convenience please keep the doors locked when driving. Please note: The input area for the interactive buttons is around the center of the screen. The side areas with the control buttons are inactive. To successfully activate the interactive parts of the game you must first drag the component of interest to the center of the screen while in 360-degree mode. Press to confirm your selection. Game features: - Fun interactive game with endless replay value. - Daily bonuses. - First-person mode. - Richly detailed car models. - Many of the components inside the car are interactive. - You can modify and tune your car in a large number of ways. - Interesting map of the city and its environs. - Interactive gas station. - Fun quest- and arcade-style missions. - Additional multiplayer-mode missions. Additional bonus! The game contains an additional 6 cars. One of the cars has a dead battery the second lacks one entirely and the third is missing a wheel... Find a way to get them going again and they will be yours!!! Hint! There are 3 ways to acquire new cars: for free at a discount or by buying the car in the showroom. Bonus! Police cruiser. Play the beta versions. Follow us! Tell us your wishes for new features and comments about the game. Download and play OPPANA GAMES! And enjoy yourself! https://www.facebook.com/OppanaGames https://vk.com/oppana_games'),
(18630, 'Hotels.com: Book Hotel Rooms & Find Vacation Deals', 41, 17, 1, 5359, 4.5, 260121, 'Varies with device', 0.00, '2018-07-04', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/tdRQUtbbTmiSU9_eIkm6bSc8XgJ9_QCzz8a5XvKGzIa3rla2PME17x-RgixZNymFeQ=s180-rw', 'https://play.google.com/store/apps/details?id=jp.co.gagex.virgoEN', ''),
(18631, 'Booking.com Travel Deals', 41, 19, 1, 10013, 4.7, 1830388, 'Varies with device', 0.00, '2018-08-06', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/olJBnzmegLV8tmHgmJxovGrB85s-DtPsxwV0_cvfdYth953-8gO6it54UKwJ0C0iVK0=s180-rw', 'https://play.google.com/store/apps/details?id=com.narendramodiapp', 'Official Mobile App of Narendra Modi. It brings to you latest information instant updates & helps you contribute towards various tasks. It provides a unique opportunity to receive messages and emails directly from Prime Minister Narendra Modi. Download the app and get the latest updates anywhere anytime! Highlights of the Narendra Modi App: - Receive the latest news and updates - Attractive infographics that illustrate the work of the NDA government to transform India. - Exclusive opportunity to receive E-Mails & Messages directly from PM Narendra Modi. - \'Mann Ki Baat\' with the PM Narendra Modi. - Exciting features that empower you to contribute towards making a positive difference in society. - Watch Videos on our section NaMo TV Watch Latest PM speeches - Thoughtful forums where you can share your ideas views and deliberate with a wide range of people. - Small Tasks Big Satisfaction: Contribute & earn Badges through the to-do tasks. - Your chance to Interact with PM Narendra Modi & share Ideas & Suggestions. - Never miss out thoughts from PM Modi read his Blogs. - Be the first to get NaMo merchandise and contribute to BJP with micro-donations - Read about PM Modi s Governance initiatives & achievements. - Learn more about PM Modi s efforts augmenting India s Global Recognition. - Receive personalised Birthday Greetings from the PM You can access the app even as a guest without entering your email address or phone. This is unlike most other Apps where some sort of info is required.'),
(18632, 'Hostelworld: Hostels & Cheap Hotels Travel App', 41, 15, 1, 9167, 4.4, 17878, '28M', 0.00, '2018-07-16', '6.7.1', '4.1 and up', 'https://play-lh.googleusercontent.com/t-U90dj_yfo-a6NOKZgKGtW-__LEJYbxVSPLg7uVfKi6EVCOjBRofL82aPx7KNRus5w=s180-rw', 'https://play.google.com/store/apps/details?id=md.richgoldstein.hscompendium', 'Get ready access to the most important information you need when playing Hades\' Star. Facts figures and other information is ready at your fingertips in the Hades\' Star Compendium as well as several interactive tools - Income calculator White Star calculator Ship Builder Tech Levels and more. The HS Compendium App has built in Discord Bot integration communicating with the Hades Star Compendium Bot to share your data with your corp-mates search their technology and plan your White Star battles. Hades\' Star Compendium is not developed by Parallel Space Inc the company that developed Hades\' Star. Some content used by permission. I created Hades\' Star Compendium as a fan of the game for my own purposes as an exercise. As it evolved it became clear that this was something worth sharing. It is my intention to continue to develop and evolve this app and I hope you will enjoy it. I welcome your feedback contributions and constructive criticism. See you in game! - McGoldric'),
(18633, 'Google Trips - Travel Planner', 41, 16, 1, 5882, 4.1, 26871, 'Varies with device', 0.00, '2018-07-26', '1.10.0.205086730', '4.1 and up', 'https://play-lh.googleusercontent.com/ueGpEvJks4AbMSYUhACHbrFCQKQIC2fDCVjo4dCA5sr_NBJb6u1TEn_BV3OuWlJL6ETA=s180-rw', 'https://play.google.com/store/apps/details?id=com.google.android.apps.docs.editors.sheets', 'Create edit and collaborate with others on spreadsheets from your Android phone or tablet with the Google Sheets app. With Sheets you can: - Create new spreadsheets or edit existing files - Share spreadsheets and collaborate in the same spreadsheet at the same time. - Work anywhere anytime - even offline - Add and respond to comments. - Format cells enter or sort data view charts insert formulas use find/replace and more. - Never worry about losing your work - everything is saved automatically as you type. - Get insights instantly quickly insert charts and apply formatting in one tap - with Explore. - Open edit and save Excel files. Permissions Notice Contacts: This is used to give suggestions of people to add to files and share with. Storage: This is used to save and open files on USB or SD storage.'),
