(18642, 'AT&T Navigator: Maps, Traffic', 41, 17, 1, 12328, 3.6, 32862, '14M', 0.00, '2016-12-06', '5.10.6.2.8466393', '4.1 and up', 'https://play-lh.googleusercontent.com/ZAQnUaTjYapZEJAYS_QQSJyWZohovZdxrsFvDn0j7lumkd5ZyxkfWddIm4DYyQrFyQ=s180-rw', 'https://play.google.com/store/apps/details?id=nl.ruudghielen.mxvideos', 'Watch Motocross highlights or complete motos in 3 different categories: - MX (Motocross) - SX (Supercross) - ATV MX (Quads & Trikes) For each category we select the best Motocross videos on the web. After a race we try to update the app asap with new videos. The Championships we offer: - FIM MXGP and MX2 - AMA Motocross 450 and 250 - AMA Supercross - AMA ATV MX National - FIM EMX (European) Quads - KNMV ONK (Dutch) Quads The MX Videos app is free to install.'),
