(18646, 'AirAsia', 41, 17, 1, 6988, 3.9, 98585, '37M', 0.00, '2018-07-16', '5.0.4', '4.4 and up', 'https://play-lh.googleusercontent.com/_-ayBhqX4DwwMH7YLKnHXBvN088UdGD3TPPuZfOSsAy8bMk1HiBeI4f1LWwaX8rDyA=s180-rw', 'https://play.google.com/store/apps/details?id=com.intellinet.mgsupport', 'Pragati is an Mobile Auditing tool designed to be used by the MG Service team for Auditing dealer on various parameters as per the audit guidelines defined by the MG. Pragati equips the ASM/ RSM and other service team members to carry out quick and hassle free auditing at dealers under their network. Inbuilt dynamic scoring capability automatically generates the Pragati score for each dealer immediately after audit and helps service team & dealer principal identify & work on improvement opportunities. Information captured through the Pragati app is instantly available in back office and thus helps back office team to keep the dealer progress under check.'),
(18647, 'Goibibo - Flight Hotel Bus Car IRCTC Booking App', 41, 17, 1, 5125, 4.3, 459851, 'Varies with device', 0.00, '2018-08-01', '3.9.7', '4.3 and up', 'https://play-lh.googleusercontent.com/ViBXRs7y4D1bG4aBUbJQJ-02j_u77T3YVDOLIBMxHig5ZDAZoHjPP56hL_YIAqaOaQ=s180-rw', 'https://play.google.com/store/apps/details?id=je.food.app', 'With over 50 local restaurant menus Food.je is the easiest way to order food for delivery or takeaway in Jersey. Food.je is Jersey s premier online ordering portal for local takeaway food delivery. We\'re partnered with some of the finest takeaway restaurants in Jersey so if you fancy Pizza Chinese Indian Italian Fish n\' Chips Portuguese Thai or any other cuisine we\'re sure to have something to suit your taste. Ordering takeaway in Jersey has never been easier and it\'s 100% FREE to use! Ordering your takeaway is easy: - Choose a restaurant - Build and place your order online from the restaurants menu - That\'s it! The restaurant delivers your food or you collect it - You receive an instant SMS and email letting you know how long your order will be What Else? Food.je lets you; - See the location of restaurants using Google Maps and Street View - Check restaurants opening and closing hours - Keep up-to-date with the latest deals and offers - Re-order your favourite meals - Book a table at your favourite restaurants - Pay online with card or cash for a speedy checkout - Save your delivery details and phone numbers for faster checkout'),
(18648, 'Allegiant', 41, 15, 1, 5190, 3.1, 5572, '21M', 0.00, '2018-07-12', '5.16.1', '4.4 and up', 'https://play-lh.googleusercontent.com/d81M3xYlBfyNQsYNg44-DJ6ehyJwNBjP_Vb6B8gy7t66bn1nzISRNJUyNE2Q76hebBQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.redtrackr.jehovahministry', 'Jehovah\'s Witnesses Ministry App is the perfect tool for all our brothers and sisters in the field ministry. CORE FEATURES ? Change the dashboard view ? Set your goals and see your progress! ? Manage your reports (detailed views) ? Easily add new reports ? Integrated timer (you can even turn off your smartphone) ? Send reports via Email SMS or WhatsApp ? Transfer extra minutes to next month ? Manage your return visits ? Add different types of contacts (brothers bible studies return visits absentees) ? Locate contacts on map ? Call contacts from the App ? Available in more than 15+ languages ? ..and a lot of more features!'),
(18649, 'Amtrak', 41, 15, 1, 2197, 3.7, 16815, '28M', 0.00, '2018-07-15', '3.1.3', '5.0 and up', 'https://play-lh.googleusercontent.com/ssM2NZMZCmwQoEyrRapczzDhBaLByTabq7kV7BYXCoHU9GsWoThJBr-PCepXewKhx78=s180-rw', 'https://play.google.com/store/apps/details?id=com.brain.braincrazy.puzzle.mind.iq.challenge', '? What do you know about your IQ? Do you want to discover your IQ? ? Try playing it to see how smart and creative you are. Just play a few minutes a day you\'ve exercised your mind made easy. Every day you get a fresh workout to keep you challenged. ? Flexibility intuition out of thought imagination brainstorming are things you need to overcome challenges. Brain Crazy helps you train your brain and test your abilities. Sometimes the answers go beyond what you think that\'s when you open your mind not restricted to thinking. Challenge your friends now! ?Features:? * Fun riddles fun puzzle game * Rich imagination * Don\'t just think interact * Intuition is sometimes more important than logic * What you see is not necessarily true think about the nature the roots * Brain joke * Ability to distinguish flexible * No matter your age or skill level Brain Puzzle Crazy helps you overcome questions through suggestions and Brain training for everyone ? Try playing Brain Crazy and training your brain. You can become a logic master mind! Think different - that\'s the difference for you to overcome challenges. Let the mind thrive and fly away'),
(18651, 'Flight & Hotel Booking App - ixigo', 41, 16, 1, 17021, 4.4, 45562, 'Varies with device', 0.00, '2018-07-30', '4.0.9.1', '4.1 and up', 'https://play-lh.googleusercontent.com/lltMxKtLbbU5OkhkqYuiuzwMm1IlmW7v3r1dGhSJSwDrF7n5WnYqZEzK-f80J59UEWk5=s180-rw', 'https://play.google.com/store/apps/details?id=com.i6.AirplaneRCSimulator3d', 'Flight Simulator: RC Plane 3D is the most fun RC or Plane Simulator you will get to play here. Start off on the easy levels learning how to fly your small airplane after which you get to land it. Once your past these few learning levels that where it gets exciting you get to fly the plane through small gaps and obstacles. You only have a set amount of battery life to get the plane through all the hoops and through to the landing spot.'),
(18658, 'Foursquare Swarm: Check In', 41, 17, 3, 5169, 3.9, 421800, 'Varies with device', 0.00, '2018-07-27', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/81tvpT59weJbOGWT9jQ8_9RtcGXKCcVv59BU7Wl6PnS7okIgrS4iTCgwWpPQY2FRKw=s180-rw', 'https://play.google.com/store/apps/details?id=com.joelapenna.foursquared', 'Foursquare City Guide will lead you to the perfect spot -- anywhere in the world. Get helpful positive tips from our trusted global community and keep track of where you you\'ve been and where you want to go all in one place. Looking to check in or become Mayor of your local coffee shop? Download our sister app Foursquare Swarm. With Foursquare City Guide you can: -Join a community of people just like you who love to explore and seek out hidden gems. -Read short tips written by real people all over the world. (No negative rants or businesses paying for positive reviews.) -Make lists for any occasion! Keep a running to-do of neighborhood hot spots or places you want to try while traveling. -Add tastes rate places and lifelog where you ve been to get hyper-personalized recommendations. -Follow friends brands and influencers and uncover the best experience possible with millions of tips about off-the-menu items speakeasy entrances wifi passwords and much more. -Keep a history of the places you ve been. Never forget a memory photo or the name of that incredible pizza place you went to while visiting Rome. -Find exactly what you re looking for. Faster. A note on battery: We\'ve spent years developing the location technology that powers Foursquare City Guide making it extremely power efficient. But as with all apps of this type please note that continued use of GPS running in the background can dramatically decrease battery life. By using Foursquare you agree to the Terms of Service (http://foursquare.com/legal/terms) Privacy Policy (http://foursquare.com/legal/privacy) and Cookie Policy (http://foursquare.com/legal/cookiepolicy).'),
