ers from your phone book seats in advance add flights to your calendar or send them via email and get up-to-date arrival and departure times for all of your flights. Additionally lounge users can access the British Airways Lounge Wi-Fi password. - Flight status and schedules Search and track all British Airways flights for the latest arrival and departure times. - Exclusive features for Executive Club Members Executive Club members can use our app to check their Avios Tier Points and full transaction history. Those using TAG our digital bag tag can also update it within the app after checking in. Not an Executive Club member yet? Join for free on ba.com. - Permissions We need access to your calendar and email to let you add and share bookings. We also need access to your camera and Location and Bluetooth Services to link with TAG our digital bag tag. Please refer to the \'Application Licence Agreement\' linked on this page to view the terms of use of this application and use of mobile boarding passes. By downloading the BA application you agree to the terms of the Application Licence Agreement. https://www.britishairways.com/en-gb/offers/terms-and-conditions/british-airways-license-agreement'),
