(18694, 'Cheapflights - Flight Search', 41, 16, 1, 7578, 4.4, 47780, '19M', 0.00, '2018-07-31', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/6gWDOy0QSwYyZU8VastX7TRPn3hy6mYqtBEABf4ioSiTiVNqIZq1sqQvBDc-DoG3UfN9=s180-rw', 'https://play.google.com/store/apps/details?id=com.cf.flightsearch', 'The Cheapflights app helps you search compare and book cheap flights from hundreds of airlines and travel agents globally. We re a team of passionate savvy explorers here to make it easy for you to find the cheapest flights to your next travel destination. With Cheapflights you can: ? Compare cheap flights from hundreds of airlines and travel agents worldwide ? See the cheapest days to fly with our Price Calendar and Chart Views ? Use Smart Value to find the best flights by balancing price and flight duration ? Save and compare flights from your search results and book later ? Log in and save your flight preferences for a faster more personal experience across all your devices. Millions of people find cheap tickets with us every year. Want to be one of them? Whether you have your eye on last minute flights domestic flights international flights cheap airline tickets and low-cost airfare the cheapest flights and deals are just a download away. Our flight comparison service is simple and completely free to use. All you need to do is search filter and book your flights. We will then send you directly to the airline or travel agent to book your plane tickets without any hidden fees. _____________________________________ SEARCH ? Search and compare cheap flights to your destination for free ? Find the cheapest days to fly with our interactive Price Calendar and Chart View ? Find just what you re looking for by searching for flights by city or airport _____________________________________ FILTER ? See just the flights that fit your price range airport airlines number of stops take-off and landing times ? Filter results by the cheapest flight the quickest flight or a happy balance between the two ? Save flights from your search results to compare and book later ? Log in to apply your flight search criteria across all your devices for a seamless experience ___________________________________ BOOK ? Take a look at checked baggage and seat reservation fees so you re always prepared before booking ? Stay up-to-date on maximum carry-on or hand-luggage sizes and weights to avoid extra baggage costs ? See a snapshot of your selected flight dates and times so you can review before booking ? When you ve found your perfect flight tickets we will send you directly to the airline or travel agent to book _____________________________________ So let s get started. Go ahead and download the Cheapflights app now and search for flights to any city or airport anywhere in the world. And if you re having any issues with our app please let us know so we can make things right. You can get in touch with us at: flight.apps@cheapflights.com'),
(18701, 'Choice Hotels', 41, 15, 1, 1166, 4.4, 17915, 'Varies with device', 0.00, '2018-07-18', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/xTC02ZLFjJJhAzJPtBUtbOoCS8u_jeHCfnSp8Eol3BfgsLvKQStGsUcVZP1hxqR4zlSl=s180-rw', 'https://play.google.com/store/apps/details?id=com.applicationexpress.imautoreply', 'Are you busy? Unavailable? Do you need an tool to automatically reply to anyone who contacts you via almost all Chat platforms? IM Auto Reply is the solution. IM Auto Reply allows you to automatically reply to any Chat application using personalized text! - plus many more features! Important Notice: If the application is not supported on your device please contact us using the email address below. Please make sure that you have chosen to receive notifications from and have not muted the application you choose for Auto Reply. If the device does not receive notifications the application will not be able to detect messages and so will not reply automatically. SMS Auto Reply SMS automatic replies are now available in this application. However due to Google Permissions policies we cannot access SMS s directly. If SMS automatic replies do not work on your device please install an SMS application that supports replies to notifications such as Textra! IM Auto Reply provides you with THE way to reply to almost ALL instant messaging applications when you are away. All you need to do is - 1) Specify the apps you want IM Auto Reply to respond to 2) Add predefined or personalized text 3) Hit Start! IM Auto Reply will take care of the rest replying to anyone who contacts you via the applications you specify. You can set-up IM Auto Reply to reply in 3 different ways- a) Every Time - a reply is sent each time you receive a message b) Once Only - a single reply sent to the first message c) After a Specified Time - a reply sent at a time you specify. You can exclude certain contacts from receiving replies by - 1) Choosing the ALL contact reply method 2) Clicking the  Exclude Contact  tab; and then 3) Specifying the contacts you want to exclude. You can set IM Auto Reply to send a customized message depending on the message you receive by contact and application. 1) Select  Custom Reply  tab 2) A?d a contact (Case Sensitive) and specify an application 3) Click the  Add Message  bubble next to the name. (You will then be moved to a new page.) 4) Click the message bubble to add a new message 5) Type the received message and its reply and press  Add  (You can use * for any message received.) Once you receive a message from the specified contact IM Auto Reply will send the custom text.'),
