(18712, 'Ascape VR: 360 Virtual Travel', 41, 13, 1, 12550, 4.1, 890, '7.6M', 0.00, '2017-08-09', '4.0.38', '4.4 and up', 'https://play-lh.googleusercontent.com/_cOtao4ITz9PYr9XRLiP4JyWgOSyMlOylB3MxiRC6dufa2DLjIdMYs4tkYB_-DCTVWA=s180-rw', 'https://play.google.com/store/apps/details?id=com.squareenixmontreal.deusexgo', 'Challenge all-new turn-based logic puzzles and solve a futuristic mystery in Deus Ex GO the next tactical board game from the makers of the award-winning HITMAN GO and LARA CROFT GO. Puzzles in Deus Ex GO challenge you to utilize a mixture of stealth espionage and raw intelligence as you guide secret agent Adam Jensen across a visually stunning storyline. Sneak hack and fight your way past enemies and augment Adam with futuristic upgrades to solve the GO series  most intricate puzzles yet! DEUS EX GO FEATURES: STRATEGY BASED LOGIC PUZZLES - Turn based logic puzzles challenge you to outsmart guards turrets drones and other fierce enemies - Challenge over 50 unique puzzles in a mysterious new storyline SPECIAL EVENTS - New time-limited puzzles! - Challenge them all and prove your puzzle solving skills MYSTERY & ADVENTURE - Adventure through an intricate and mysterious storyline set in a beautiful vision of the future HACK AUGMENT & CONTROL - Augmented puzzles - Overcome puzzles and obstacles using Adam s iconic augmentations - Intelligence isn t always enough! Turn invisible hack enemy turrets and even change the layout of the map itself LEVEL EDITOR - Create your own puzzles in an elegant intuitive Puzzle Maker - Share your levels to challenge the community INFINITE BRAIN TEASERS - New brain teasers and puzzles are always available in Infinite Mode - Puzzles are curated by your play data so each challenge is personalized Following Hitman GO & Lara Croft GO Square Enix Montreal brings yet another beloved franchise to mobile with this unique take on this near future dystopian world. Adventure awaits in all-new GO series puzzles! Can you unravel the mystery?'),
(18713, 'Cheap hotel deals and discounts  Hotellook', 41, 15, 1, 17115, 4.5, 7153, 'Varies with device', 0.00, '2018-07-30', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/F8GhJVX4u3O-D3_lV3wi9Xf_NOEB3hdOpSS6626F1xl9Gl1CI2BF5BA9NdeJ4b0FgsDW=s180-rw', 'https://play.google.com/store/apps/details?id=com.ixigo', 'Loved by Indian travellers ixigo is an intelligent AI-based travel app made in India that helps you organize book and track your trips. ixigo is currently one of the top 10 most downloaded transactional e-commerce apps in India. Earn ixigo money on our flight booking app & spend 100% on next flight booking! ixigo predicts flight fares for upcoming flights sends fare alerts for air tickets & helps you save upto 40% on flight tickets. Download best flight booking app of India now & book flights at the cheapest airfares. Enjoy other unique features such as smart holiday calendar flight status & bus bookings. Once you download the app enjoy amazing benefits: BEST DEALS ON FLIGHT BOOKINGS - Book flight tickets for both domestic & international flights. Complete your flight booking on the ixigo app & get upto ?2021 off on all flights. Use code: INSTANT - Best flight booking app in India for cheapest air tickets or deals on flight tickets of all major airlines: Indigo Spicejet Go Air Vistara Air Asia Air India Air Costa KLM Singapore Airlines Kuwait Airways Qatar Airways Malaysia Airlines Thai Airways British Airways Emirates Etihad Air Arabia Cathay Pacific Saudi Arabian Airlines American Airlines Delta Airlines Continental Airlines & more. Stay Updated with Latest Travel Restrictions or Guidelines in India & the World Latest information about flight news travel guidelines through ixigo s COVID-19 flight travel guide. FREE FLIGHT CANCELLATION with \'ixigo Assured\' - Starting at just Rs.469 per passenger. - Full refund guarantee of upto Rs.5000 - Travel insurance cover of upto Rs.10000 baggage loss (upto Rs. 5000) etc. FLIGHT STATUS & FLIGHT TRACKER - Track flight delays changes & cancellations for Indigo Spicejet Go Air Air Asia Air India Vistara Lufthansa Emirates airlines with our real-time live flight tracker - Booked from somewhere else? Easily add your trips via PNR & check PNR status of flight anytime. - Track all flights departing or arriving at any airport with Flight tracker when you are receiving someone at airport AUTOMATED WEB CHECK-IN - Take advantage of our automated web check-in feature. Check-in from the app within seconds. SMART FARE ALERTS - We keep a record of your preferred flight booking ticket or air ticket & send you fare alerts based on search history. - Get to know when the flight fare drops so you know exactly when to book flights/cheaper air tickets. HOLIDAY CALENDAR - Get information about upcoming holidays & long weekends to plan your trip. BUS BOOKING ixigo is favourite bus ticket app of India. Book bus tickets online for your destination & select seats based on preference. CURRENT BUS TICKET OFFERS ON OUR BUS TICKET BOOKING APP: Book bus tickets on the ixigo bus ticket app & save upto Rs.500. Use Code: BUS500. Use ixigo bus ticket ka app for: - jharkhand bus ticket booking app bus ticket booking app tamilnadu - ksrtc bus ticket booking apps hrtc bus booking apsrtc bus booking upsrtc bus booking rsrtc bus booking msrtc bus booking & ksrtc bus ticket booking apps. MANAGE TRIPS - Manage all flight train & bus ticket bookings easily. View booking details check-in for flights & share trip details. Save details so you don t have to enter these every time you make a new flight ticket or bus ticket online booking. AWARDS - India s fastest-growing travel company - Growth Champions 2020 by ET & Statista - New Code of Work Award 2020 by Wheebox & People Strong - \'Future of Workplace Award\' at the ObserveNow HR & Workplace Summit 2019 - Best UI/UX app of 2018 by Google at the India App Summit **Please Note** For any problems & feature requests please use  feedback  option on our app. Alternatively please share details here: https://bit.ly/2HiBLqo'),
(18714, 'GPS Status & Toolbox', 41, 17, 1, 2705, 4.5, 149723, '4.1M', 0.00, '2018-06-13', '8.1.171', '4.0 and up', 'https://play-lh.googleusercontent.com/pwoXwTOFjTRDhhGugpChmVve-CI7fpw5ytrzeZP0w-5OcbzITkYqTkPsX5bQtv3AEN0=s180-rw', 'https://play.google.com/store/apps/details?id=com.caynax.sportstracker', 'Stay fit - track value of distance speed burned calories steps (pedometer) and much more during running cycling walking rollerskating and other sports and fitness activities. Lose body fat and improve cardiorespiratory fitness with Caynax GPS Sports Tracker. ? Fast light and user-friendly app. ? No registration needed. ? Small size (below 10MB). ? Supports over 30 languages ? All for free. Main features: - Application uses Android device GPS(BEIDOU GLONASS) to track your activity. - Track your progress live on map (Google Maps or OpenStreetMap). - Record the activity route. - Use TTS (Text To Speech) to get voice information about workout duration distance speed burned calories pace and more. - Auto pause - app will automatically pause when you are not moving. - Set workout goals (time or distance) to improve your stamina. - Use dark view in the evening or during strong sun exposure - Share your activities on social networks (Facebook Google+ etc.) - Browse workouts history (+ store application data on GoogleDrive). - Monitor your workouts statistics - compare your results in daily weekly and monthly intervals. - Customize workout dashboard to display information most important to you. - Add activities to schedule to create reminders (notification). - Take photos in interesting places and view them on the map. - Metric (meters kilometers) and imperial (miles yards) units support - Android Wear support - Import/export workout to GPX and TCX format Available indicators: Distance Speed Steps Duration Movement Time Calories Altitude Pace Ascent Descent Available sports and fitness activities: Cycling Running (Jogging) Hiking Swimming Nordic Walking Cross country skiing Kayaking Rollerskating Rowing Skateboarding Skating Snowboarding Wheelchair Motorbiking Scooter Mountain biking Stand Up Paddling (SUP) Horse riding. Application contains in-app advertisements.'),
