(18723, 'Google', 40, 21, 1, 5882, 4.4, 8033493, 'Varies with device', 0.00, '2018-08-03', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/DKoidc0T3T1KvYC2stChcX9zwmjKj1pgmg3hXzGBDQXM8RG_7JjgiuS0CLOh8DUa7as=s180-rw', 'https://play.google.com/store/apps/details?id=com.google.android.googlequicksearchbox', 'The Google app keeps you in the know about things that matter to you. Find quick answers explore your interests and stay up to date with Discover. The more you use the Google app the better it gets. Search and browse: - Nearby shops and restaurants - Live sports scores and schedules - Movies times casts and reviews - Videos and images - News stock information and more - Anything you d find on the web Get personalized updates in Discover*: - Stay in the know about topics that interest you - Start your morning with weather and top news - Get updates on sports movies and events - Know as soon as your favorite artists drop new albums - Get stories about your interests and hobbies - Follow interesting topics right from Search results Unstable connection? - Google will automatically optimize results to improve loading on bad connections - If Google cannot complete a Search you ll get a notification with the search results once you regain connection Learn more about what the Google app can do for you: http://www.google.com/search/about *some features of Discover might not be available in all countries');
