(18728, 'Cache Cleaner-DU Speed Booster (booster & cleaner)', 40, 19, 1, 7407, 4.5, 12759663, '15M', 0.00, '2018-07-25', '3.1.2', '4.0 and up', 'https://play-lh.googleusercontent.com/tZQv5nDpjaXwfmsFfMgHa4C-KDmm8qjfN0PQ91bDzQEgBhAOMzAaxHxsdeukrDQ96o8v=s180-rw', 'https://play.google.com/store/apps/details?id=com.tansh.jcjewellers', 'Established in the year 1988 we  JC Jewellers  are renowned leading Manufacturer Wholesaler and distributor of a comprehensive range of Precious Gems and Jewellery. Headquartered in the heart of Chennai city offering precisely designed jewellery. Our products range comprises Ladies Gold Chain Gold Necklace Gold Curb Design Chain Gold Mariner Design Chain Gold Rope Design Chain Gold Pendant Set and much more. At  JC Jewellers  we are driven by the customer-centric approach; hence we aim to attain maximum customer satisfaction by offering premium quality Gold Chains. All our assortment of precious metal jewellery is crafted by using optimum quality metals gems and latest techniques. We offer our high-grade range of jewellery in different patterns colours designs finish and sizes as per the taste of our customer s requirements. Therefore our jewellery is in high demand because of its latest designs antique look stunning shine easy to wear and glossy apprentice. Backed by a team of highly skilled specialists we can achieve our aim and set new goals for the future. We have equipped a team of quality checkers who precisely checks all the jewellery on a certain set of parameters to ensure their quality and finish. We also ensure our customers are to accomplish their orders within the predetermined time frame.'),
(18731, 'Device Help', 40, 19, 1, 4674, 4.2, 28860, 'Varies with device', 0.00, '2018-07-18', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/m-GfcoZxeyKA7bT5Te7Q-ERw_TNcAEtwg0ChxHrEWUY4nk5rn-Ih3J4YFLzEaLRuYlND=s180-rw', 'https://play.google.com/store/apps/details?id=com.evozi.deviceid', 'Simple app to get your Device Info/ID/local IP/MAC addresses & Serial that allow you easily copy and share the ID of your mobile device. An ideal tool for developers customer support and user. NOTE: this app doesn\'t send your ID to the internet so your information is safe. For paranoid users you can get Device ID without any network permission at : https://www.evozi.com/l.php?go=deviceid_no_network This will disable Local IP Address and MAC address. Supported : Google Services Framework Key ID Android ID IMEI Subscriber ID (IMSI) SIM Card Serial WiFi MAC Address Ethernet MAC Address Bluetooth MAC Address Bluetooth Paired MAC Address Hardware Serial Device Build Fingerprint Please leave some suggestion. Permission Explanation : INTERNET is used to get your local IP address BLUETOOTH is used to get your Bluetooth MAC address READ_PHONE_STATE is used to get your IMEI IMSI and SIM Serial ACCESS_WIFI_STATE and ACCESS_NETWORK_STATE is used to get your MAC address READ_GSERVICES is used to get your Google Services Framework ID You are allowed to disable the permission using root app such as Permission Manager if you are paranoid --------- For user that wanted to get both SIM Serial in DUAL SIM Phone The default SDK does not have support to handle dual SIM phones. The function will only return one number most likely from the first active SIM card. --------- Links : Facebook : https://www.facebook.com/evozi/ Beta Testing Group : https://www.facebook.com/groups/evozi/ NOTICE : Instead of rating 1 or 2 starplease email to support@evozi.com or leave a comment so that we can fix or improve it.'),
