(18736, 'Calculator - free calculator, multi calculator app', 40, 17, 1, 5022, 4.6, 25592, '7.5M', 0.00, '2018-07-31', 'v8.0.1.8.0629.1', '4.2 and up', 'https://play-lh.googleusercontent.com/gBGm_fDKVI3AAVjSk1oR6_0sLLHbFU1rayVBiRnibBs30eAziYi-PbUEDLjzWvRSfxU=s180-rw', 'https://play.google.com/store/apps/details?id=com.hld.anzenbokusucal', 'Use the best calculator photo vault to hide photos hide pictures hide videos. Calculator Photo Vault is the Vault app can secretly Hide Photos Hide Videos and other files without anyone knowing as gallery lock installed in your phone looks as just a beautiful calculator and works very well. Your files will be secretly stored in vault and can only be viewed after a Numeric PIN is entered on calculator panel of this app. Top Features: ?Vault: Through the AES encryption algorithm encrypt the content that you do not want to share with others and the file format size without any restrictions but also support taking pictures and recording videos. ?Browser: An inbuilt private browser for your safe browsing of private websites and downloading of photos from web and lock instantly inside photo vault and leaves no tracks in your system. ?Shake Close: Shake the phone can quickly close the app so that everything in your control. ?Intruder Selfie: Automatically takes Intruder selfie when someone tries to break in your privacy by entering wrong password. ?Fake Vault: Create Fake vault with different password for storing fake photos and videos. ?Fingerprint Unlock: To provide you with a faster more secure way to unlock. ?Colorful Theme: A variety of fashionable colors any match to create your exclusive theme. ?Calculator: Offers all the regular and scientific calculator functions in a simple stylish and easy to use. ------------------------------ FAQ ------------------------------ How to open? Enter your password and press \'=\' button to open. What can I do if I forgot my password? In case you forget your password simply enter a number \'11223344\' into Calculator and press \'=\' button then retrieve your password by entering answer of your security question. How to restore encrypted file? Long press on the encrypted file will enter the edit mode you can restore it by using the restore button in the action bar. Are my hidden files stored online? Your files are stored only on your device so please make sure to backup all your hidden files before transferring to new device or factory reset. Change password? Please go to the app\'s \'Settings > Safe > Lock Type\' to change the unlock password. More FAQ: http://t.cn/EGakpdV Need Help? Feel free to mail us at: FishingNetTech@yeah.net'),
(18737, 'ASUS Sound Recorder', 40, 17, 1, 431, 4.5, 34126, 'Varies with device', 0.00, '2018-07-13', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/Hyedd-vjRpgJHAVdth6SkLaAKyxT_qJvRCzNYFX7qQ-IRZZihygR-29IWlcXORvBmN4=s180-rw', 'https://play.google.com/store/apps/details?id=com.asus.aihome', 'The ASUS Router app unlocks the power to manage your network in just a few taps whenever you want wherever you go. We are aiming to provide the best Wi-Fi and Internet-surfing experiences you have ever had with these comprehensive features. Key Features: 1. Router Monitoring and Remote Management 2. AiMesh 2.0 Network Topology 3. Client Device Management -Bandwidth limiter -Block Internet access -Customizable device icon and nickname 4. More Features - Firmware Update - QoS - Parental Controls - Network security scan - Router setting backup - IP Binding - WOL (Wake-on-LAN) - Port forwarding (RT models)/ OpenNAT (ROG Models) - Schedule Reboot - USB Ejection - ASUS Notice ASUS Router app supports the following routers. - All ZenWiFi line up - All 802.11ax line up - All ROG Rapture line up - All TUF Gaming line up - Selected DSL routers - Lyra/Lyra mini/Lyra Trio/Lyra Voice (needs to be at least 3.0.0.4.384 version) - Blue Cave - RT-AC5300 - RT-AC3100 - RT-AC88U - RT-AC3200 - RT-AC2900 - RT-AC2600 - RT-AC2400 - RT-AC2200 - RT-AC87U/R - RT-AC86U - RT-AC85U - RT-AC85P - RT-AC65P - RT-AC57U - RT-AC68U/R/P/W/UF - RT-AC65U - RT-AC1900 - RT-AC1900P/U - RT-AC1750 - RT-AC1750 B1 - RT-AC66U/R/W - RT-AC66U B1 - RT-AC66U+ - RT-AC1300UHP/ G+ - RT-AC1200 - RT-AC1200G/HP/G+/ E/ GU - RT-AC58U - RT-AC56U/R/S - RT-AC55U - RT-AC55UHP - RT-AC53 - RT-AC52U B1 - RT-AC51U/ U+ - RT-ACRH17 - RT-ACRH13 - RT-N66U/R/W/C1 - RT-N18U - RT-N19 - RT-N14UHP - RT-N12E B1/C1 - RT-N12HP B1 - RT-N12VP B1 - RT-N12+ B1 - RT-N12D1 - 4G-AC53U - 4G-AC68U *ASUS Router App does not support the following models: DSL-AC88U DSL-AC88U-B DSL-AC3100 DSL-AC87VG DSL-AC68VG DSL-N55U_A1 DSL-N55U_B1 D