(18895, 'Best Wallpapers QHD', 29, 17, 3, 8964, 4.4, 294701, '5.1M', 0.00, '2018-03-17', '2.85', '4.0.3 and up', 'https://play-lh.googleusercontent.com/QTyOu1krhbXKrTvt7HlvU6yrnHW5Wvse489dLN5EEq35wV9Nf1fL_h136u8ZF9DeUcQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.manchesterapps.quotesandstatus', 'Best Quotes and Status is an app that provides large collection of quotes for different categories. There are more than 85000 quotes and more than 100 categories. Everybody nowadays uploads photos/videos on social apps like Whatsapp Facebook Instagram & Tiktok where they need a nice caption to get attention from the viewers so this is app can help them easily find best captions for the social media posts. You can also use these quotes on your books painting wall mobile application website etc. ? HOW TO USE? ? ? Browse categories and select one based on your need/mood. ? There are number of quotes available for each category. ? You can COPY the quote and use it anywhere you want. ? You can SAVE that quote AS IMAGE in your GALLERY. ? Tap on quote to change BACKGROUND of the quote. ? You can LIKE quotes and manage your liked quotes separately. ? More importantly this app works offline! * Any feedback? Contact us at manchesterapps@gmail.com.'),
(18896, 'Dog Licks Screen Wallpaper', 29, 16, 1, 13813, 4.3, 63624, '10M', 0.00, '2017-11-20', '11.0', '4.0.3 and up', 'https://play-lh.googleusercontent.com/KTIP_8TBV5RCYLlycJ9OPQ53wBYtjXDmyCj9QhPgs7pEzHxZraYleihWrZdc9VdaEQs=s180-rw', 'https://play.google.com/store/apps/details?id=com.swiftapps.dogsimulator2015', 'The best MULTIPLAYER Dog Simulator available on Android! Play as a real puppy - jump bark destroy the house and do whatever you want. Now with a multiplayer mode you can play your friends and people all over the world. Cute puppies and fun adventures are waiting for you! ONLINE MULTIPLAYER Play online with animal lovers all over the world. Play together with other dogs meet new friends and compete with them for the best score. See if anyone can match your skills as a naughty dog. You can create your own games which can be joined by your friends. DOGS AND PUPPIES If dogs are your favourite pets then this is the game for you. Play as your favourite dog breed: corgi shiba and husky puppies are waiting for you. If you love bigger dogs select one of the collies bulldogs or a greyhound to bring even more cuteness to the game. And if that s not enough try a wolf direwolf or a giraffe (well it s a sneaky greyhound dressed as a giraffe). UPGRADE AND DRESS YOUR DOG When you press either single player or the multiplayer button in the menu you always go to the scene where you can change your dog and dress it as you like using blue arrows on the both sides of the dog and buttons on the top of the screen. You can dress your doggy with multiple hats collars and funny glasses. Then everyone can see your cool outfit in multiplayer games. LOCATIONS There are six locations. First awesome house were you smash some objects and learn the game. Second nice garden with a dog that will follow you and a grill party to ruin. Third is a shop with lots of objects that can be smashed into pieces. Fourth and fifth are on a huge farm full of animals and people where you can chase sheep to get points. The last one is a crazy town with tons of stuff to destroy and funky missions. TIME CHALLENGE In every level in the single player mode there is a rotating clock. When you run into it you can activate time challenge mode. In this mode you have to destroy as many objects and do as many interactions as fast as possible. For the points you earn the stars and more gold. NIGHT MODE Score one star in the last level to unlock a secret night mode. It contains new time challenges for every stage with increased difficulty and even bigger rewards. See if you re a true expert. SIMPLE CONTROLS You can use the joystick on the left to move your dog jump button on the right to make it fly and swipe to look around. You can use the hit button on the right to smash objects with your awesome dog power. QUALITY SETTINGS The game will automatically detect which quality settings to apply for your device but you can change them in the settings menu. FACEBOOK AND SOCIAL SHARING At the end of the time challenge the popup will show up allowing you to post your score on Facebook or Twitter. You can also share the image of your dog on in the scene where you change dogs and dress them.'),
