kup list of downloads and settings; - profiles for each type of connection; - automatic operation on schedule; - support quick autoadd download. Clean Interface: - light material design; - filter by types and status; - left menu with quick options; - context menu for easy management; - sorting downloads by order size and name; - open completed files through favorite apps; - information about downloading: speed size time; - support pause resume restart for downloads; - creation of advanced profiles for sites; - fine-tuning for each download; - widget on home screen. Extended Notifications: - icon with progress and speed in notification panel; - transparent progress-bar on top of all windows; - completion notification by sound and vibration. Built-in ADM Browser: - support of multiple tabs; - advanced media downloader; - list of history and bookmarks; - easy sending file to downloader; - download mp3 from popular archives; - interception of mp4 video from tubes; - easy downloader for all types of files; - download accelerator for social networking; - option \'User-Agent\' for forgery the browser. Media sniffer: - download streaming music and video; - download m3u8 and MP-DASH video; - convert ts to mp4 after finished. Simple control for downloads: - press on the download to start/stop the process; - press on the completed download to open the file; - long press on download to display the context menu. Add URL links in ADM: - press on link and from window \'Complete action using\' select ADM Editor; - long press on a link to display the context menu press \'Share\' or \'Send\' and from window \'Share via\' select ADM Editor; - copy link after program intercept it from clipboard and send in ADM Editor or use \'Add\' button and paste the link. ADM is the best android download manager for you! ADM shows ads. To disable buy Advanced Download Manager Pro. Advanced Download Manager does not support YouTube under the rules.'),
(18970, 'Do It Later: Tasks & To-Dos', 31, 18, 1, 14128, 4.5, 123412, 'Varies with device', 0.00, '2018-04-13', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/bWR2kKrjQ4vT2TgYzMXNkfFcgP-UPqqf5SjTrKMmMjAcqI2aSYc1gVpVoGVPqZ5Mw7E=s180-rw', 'https://play.google.com/store/apps/details?id=br.com.tapps.donotdisturb', '');
INSERT INTO `APP_data` (`id`, `name`, `genre_id`, `number_of_installs_id`, `content_rating_id`, `developer_id`, `rating`, `number_of_reviews`, `size`, `price`, `date_updated`, `current_version`, `android_os_support`, `img_url`, `google_app_url`, `description`) VALUES
(18977, '7 Weeks - Habit & Goal Tracker', 31, 14, 1, 13105, 4.4, 6011, '4.3M', 0.00, '2015-12-19', '3.2.1', '4.1 and up', 'https://play-lh.googleusercontent.com/9D3KmsMFk5o0qlQkDnxNe454LrnyKcRyD6xBioGs-CbeDuTXrF72VEKfy6qMGFDMbNA=s180-rw', 'https://play.google.com/store/apps/details?id=com.popularapp.sevenmins', 'Best of 2016 App Top Trending App and Best Self-Improvement App selected by Google Play. Featured by Google Play! No. 1 in over 19 countries and among the top 5 health apps in over 57. Now supports Google Fit and comes with the new abs workout. Over 3 million users love 7 minute workout. Scientifically proven to assist weight loss and improve cardiovascular function. If you want to lose weight get a flat tummy & strengthen your abdominal muscles try 7 Minute Workout and get a six pack while strengthening your core and toning your abs with videos that show you how to perform each exercise. The best exercises for regular people just like you and me you can do a quick-fit workout anytime anywhere. It only takes 7 minutes. This 7 minute workout has been highlighted by the New York Times as offering \'maximum results with minimal investment\'. This 7 minute workout is based on HICT (high intensity circuit training) proven to be the  safest most effective and most efficient  way to improve your muscular and aerobic fitness and make you healthier. The best workout app consists of only 12 exercises to be done for 30 seconds with 10 second breaks between each exercise. All you need is a chair and a wall. Repeat 2-3 circuits depending on how much time you have. Make it your first choice at home or at the office. Features: Google Fit support Voice guidance Adjustable circuit time Adjustable rest time Keep the screen on when you workout Beautiful character and UI design Workout log shows your complete workout time Ability to pause the workout and skip to the next or the previous exercise Notifications for daily workout Abs workout for women Permissions description: Storage? To save data to your SD card or phone Network communication: To support saving data to Google Fit Phone call: You can still receive important phone calls during workouts System tools: This permission is for starting up notifications after rebooting the phone Hardware controls: For notification vibration Fitness App Multiple abs workouts are available to help you get six pack abs. Follow your personal trainer and expert workouts six pack abs is within your reach! Short Workouts We have short workouts for people who don t have much time to exercise you will get the sweats and fast heartbeat in a few minutes. These HIIT (high-intensity interval training) can maximize the results. Workout at Home Take a few minutes a day to lose weight and keep fit effectively with our workout at home. No equipment needed just use your bodyweight to workout at home. Fat Burning Workouts & Hiit Workouts The best fat burning workouts & hiit workouts for better body shape. Burn calories with fat burning workouts and combine with hiit workouts to get the best results. Fitness Coach All workouts are designed by professional fitness coach. Workout guide through the exercise just like having a personal fitness coach in your pocket!'),
(18987, 'Any.do: To-do list, Calendar, Reminders & Planner', 31, 17, 1, 1042, 4.5, 298843, 'Varies with device', 0.00, '2018-08-05', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/zgOLUXCHkF91H8xuMTMLT17smwgLPwSBjUlKVWF-cZRFjlv-Uvtman7DiHEii54fbEE=s180-rw', 'https://play.google.com/store/apps/details?id=com.anydo', '? \'#1 to do list app out there  - WSJ ? Editor\'s Choice by Google Over 30M people rely on Any.do to stay organized and get more done. It\'s a simple to do list app with reminders planner & calendar - all in one. ? \'A MUST HAVE APP\' (Lifehacker NYTimes USA TODAY). Any.do is a free to-do list planner & calendar app for managing and organizing your daily tasks to-do lists notes reminders checklists calendar events grocery lists and more. ? Organize your tasks & to-do list - ADVANCED CALENDAR & DAILY PLANNER - Keep your to-do list and calendar events always at hand with our calendar widget. Any.do to-do list & planner support daily calendar view 3-day Calendar view Weekly calendar view & agenda view with built-in reminders. Review and organize your calendar events and to do list side by side. - SYNCS SEAMLESSLY - Keeps all your to do list tasks reminders notes calendar & agenda always in sync so you ll never forget a thing. Sync your phone s calendar google calendar Facebook events outlook calendar or any other calendar so you don t forget an important event. - SET REMINDERS - One time reminders recurring reminders Location reminders & voice reminders. NEW! Easily create tasks and get reminders in WhatsApp. - WORK TOGETHER - Share your to do list and assign tasks with your friends family & colleagues from your task list to collaborate and get more done. --- ALL-IN-ONE PLANNER & CALENDAR APP FOR GETTING THINGS DONE Create and set reminders with voice to your to do list. For better task management flow we added a calendar integration to keep your agenda always up to date. For better productivity we added recurring reminders location reminders one-time reminder sub-tasks notes & file attachments. To keep your to do list up to date we ve added a daily planner and focus mode. INTEGRATIONS Any.do To do list Calendar planner & Reminders Integrates with Google Calendar Outlook WhatsApp Slack Gmail Google Tasks Evernote Trello Wunderlist Todoist Zapier Asana Microsoft to-do Salesforce OneNote Google Assistant Amazon Alexa Office 365 Exchange Jira & More. TO DO LIST CALENDAR PLANNER & REMINDERS MADE SIMPLE Designed to keep you on top of your to do list tasks and calendar events with no hassle. With intuitive drag and drop of tasks swiping to mark to-do\'s as complete and shaking your device to remove completed from your to do list - you can stay organized and enjoy every minute of it. POWERFUL TO DO LIST TASK MANAGEMENT Add a to do list item straight from your email / Gmail / Outlook inbox by forwarding do@Any.do. Attach files from your computer Dropbox or Google Drive to your to- tasks. DAILY PLANNER & LIFE ORGANIZER Any.do is a to do list a calendar an inbox a notepad a checklist task list a board for post its or sticky notes a task & project management tool a reminder app a daily planner a family organizer an agenda a bill planner and overall the simplest productivity tool you will ever have. SHARE LISTS ASSIGN & ORGANIZE TASKS To plan & organize projects has never been easier. Now you can share lists between family members assign tasks to each other chat and much more. Any.do will help you and the people around you stay in-sync and get reminders so that you can focus on what matters knowing you had a productive day and crossed off your to do list. GROCERY LIST & SHOPPING LIST Any.do task list calendar agenda reminders & planner is also great for shopping lists at the grocery store. Simply create a list on Any.do share it with your loved ones and see them adding their shopping items in real-time.'),
(18989, 'Easy Voice Recorder', 31, 17, 1, 3811, 4.4, 205191, '7.1M', 0.00, '2018-06-20', '2.4.5', '4.1 and up', 'https://play-lh.googleusercontent.com/dWhFDwsXEsL4nhB3jsvejCsnE7JBqOBLkYOh22wP8fwEx5sOAWyEpb5wr2b9smBocas=s180-rw', 'https://play.google.com/store/apps/details?id=com.coffeebeanventures.easyvoicerecorder', 'Easy Voice Recorder is your everyday companion to record important moments. Capture meetings personal notes classes songs and much more without time limits! For students Record classes and lectures with clear quality even when the teacher is not right in front of you. Listen to these recordings as many times as you want to help you study for that next exam. With no time limits and the option to choose a compressed format it\'s easy to record the longest classes and lectures. For business Capture interviews and meetings from your phone tablet or smart watch then share them with your colleagues through email or your favourite messaging app. Take advantage of powerful widgets and shortcuts to start a new recording right from the home screen. For musicians and for everyone With many options to fine-tune the recording the app is great for rehearsals and for capturing melodies that pop into your head. Try new ideas fast hear the results and make adjustments on a new take. Quickly switch between voice notes meetings & lectures and music & raw sound with easy to use settings and presets. Here is what you get: ? Record to high-quality PCM and MP4 or use AMR to save space. ? Quickly start a new recording with widgets and shortcuts and record in the background. ? Share recordings easily through email or your favourite app or set one of them as a ringtone. ? Android Wear support - record from your smartwatch. ? Light and dark themes and many other cool features. Want more? The Pro version also includes the following features (available on supported devices): - Upload new recordings automatically to your Google Drive or Dropbox. - Record to MP3 and AAC in addition to all the formats available in the free version. - Record using a Bluetooth microphone. - Trim recordings and remove unwanted sections with Edit mode. - Manage and organize your recordings with folders and save recordings to your SD card. - Control the recorder from anywhere using the notifications bar or through our Tasker and Locale plugins. - Bonus features: record in stereo import files skip silence volume boost custom bitrates and more. Easy Voice Recorder is exactly what the name says: an easy to use audio recorder and sound recorder. Reliable fast and flexible it adapts to your needs. Need help? Please note that Easy Voice Recorder is not a call recorder and can t record phone calls on most phones. If there are any problems please contact us at support@digipom.com. We are always happy to assist you. Terms of Use Terms of Use: http://www.digipom.com/end-user-license-agreement-for-applications/ Privacy Policy: http://www.digipom.com/privacy-policy-for-applications/ Permission details Photos/Media/Files - Save recordings to your external storage. Microphone - Record audio from your microphone.'),
(18990, 'Dashlane Free Password Manager', 31, 15, 1, 1999, 4.6, 73695, 'Varies with device', 0.00, '2018-08-06', 'Varies with device', '5.0 and up', 'https://play-lh.googleusercontent.com/EuiZnkT8aEKjXDLX74DTp1VRIwWaeRa8Dvo-LOGAxy1FPQ8GzABTIRenksiM-A7Oz48g=s180-rw', 'https://play.google.com/store/apps/details?id=com.bigbasket.mobileapp', 'bigbasket is India s leading online supermarket shopping app trusted by 6 million+ happy customers and counting! Install the bigbasket app now and get your groceries delivered in 25+ cities across India. Shop from a vast range of 20000+ products including farm-fresh fruits and vegetables groceries home & household essentials pet care needs organic products beauty and hygiene imported and gourmet & more at the best prices. Enjoy hassle-free online grocery shopping and contactless home delivery at just a click of a button. FEATURES AND SERVICES What to expect from us? * Wide range of products including fresh fruits and vegetables: Choose from a vast collection of 20000+ products across 1000+ national and international brands including Aashirvaad Amul Bisleri Cadbury Complan Fresho Haldiram Himalaya Horlicks Kellogg s Lays Lizol Nandini Nescafe Nivea Nutella Patanjali Saffola Sunpure Surf Excel Vim Zespri to name a few. And yes we have a full range of fresh fruits and vegetables procured directly from farmers! * Enjoy low prices and great offers: Buy at low prices with great offers including discounts bundle pack offerings promotions. * Fast and Secure Checkout: Pay by net-banking credit and debit cards options and e-wallets. * Assured quality: We source most of our fruits vegetables and private label staples (bb Royal bb Popular) directly from farmers. * On-time every-time: We take pride in timely delivery and if you get any of the products after the stipulated time you are entitled to a 10% refund. * Search in 7 languages: Our app supports searching for items in seven regional languages. Search for  vendakkai  or  bhindi  or  ladies finger  we ll get it right automatically. * Last-minute shopping? Sweets from the neighbourhood? : We have you covered with our 90-minute express delivery and specialty store offerings (only in select cities) * Easy search options: Easily shop from your past purchases with the help of SmartBasket else use our various search options: scan the bar code search give voice commands use filters on categories or brands. PRESENT IN 25+ CITIES We deliver in the following cities: Ahmedabad-Gandhinagar Anand Bengaluru/Bangalore Bhopal Chandigarh Chennai Coimbatore Delhi NCR (including Gurgaon/Gurugram and Noida) Hyderabad Indore Kanpur Kolkata Lucknow Mohali Mumbai Mysuru Nagpur Panchkula Patna Pune Surat Vadodara Kochi and Vishakapatnam. FEEDBACK / APP SUGGESTIONS: At bigbasket your shopping experience is our priority and we would love to know how we can improve our app as well as services. If you have any suggestions to improve our app please mail us at productteam@bigbasket.com. For any inputs on our service we are at customerservice@bigbasket.com https://www.facebook.com/Bigbasketcom or 18601231000.'),
