(19153, 'BluTV', 43, 15, 3, 6323, 3.9, 28835, 'Varies with device', 0.00, '2018-07-26', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/RGQu8zEYwPdZeV20tFkzJQ4DMlOKq1sANFt5c97g0bbTz6jOwvqQ3ymNbY-QECF-mIFb=s180-rw', 'https://play.google.com/store/apps/details?id=com.healthfintess.blood.pressure.checker.logger.bp.tracker.record.diary.pulse.history.info.free', 'Control your blood pressure with multiple build-in features like measurements analysis statistics graphs comprehensive reports your doctor will love and many other tools to analyze high or low blood pressure! Features: ? Send PDF reports to your physician/doctor. ? Keep your data safe with automatic backups. ? Configurable date/time formats & measurement units. ? Set up reminders to take bp measurements or medication. ? Log blood pressure & pulse readings using fast keyboard data entry. ? Understand what the numbers mean & monitor blood pressure trends with statistics & interactive charts. ? Support for common blood pressure classification guidelines (ACC/AHA ESH/ESC JNC). Blood Pressure Diary : Evaluation Info Log History Tracker has been made for the people who need constant management for BP weight and pulse. According to American Heart Association (AHA) normal range of blood pressure are Systolic 91 ~ 120 mmHg and Diastolic 61 ~ 80 mmHg. Organized: - In order to be organized & use hand sets for health use specially designed - BP info tool. Add notes postures location along with body weight. History: - Always have an access to older records with Blood Pressure Info App. Trends: - Can see trends on line graphs & bar graph with date & compare statistics on graph & control High BP. Data Record: - You are able to enter your data & view those records in graphs & lists. Report: - BP Journal App announces the analyzed changes & the average value of total entered data in 7 days 30 days & 60 days. Goal setting: - You are able to set the target for your readings. Graph: - You are able to view the measured data as a whole graph divided by year month week & day. Diary & Memo: - By entering a memo in the recorded data you are able to record thought at the moment of measurement Note: This app DOES NOT measure blood pressure nor Blood Pressure History. To measure blood pressure reliably use a clinically-validated bP monitor. It is not possible to measure blood pressure with fingerprint scanner on the smart phone.'),
