(19217, 'Financial Times', 27, 15, 2, 14353, 4.2, 27104, '8.2M', 0.00, '2018-08-03', '2.42.1.9', '4.4 and up', 'https://play-lh.googleusercontent.com/QZwQshUIUQQgI9E7bC7bWPdoMViEcrQld2a9-9S8nvyrBW0Szt-G_x7pU4dJpvb0Dm8=s180-rw', 'https://play.google.com/store/apps/details?id=com.ft.news', 'Get the international business news analysis market data and company information you need to stay well-informed. FEATURES - Breaking news alerts direct to your lock screen - Read anywhere even when you re offline with automatic downloads of the latest edition - Follow topics that matter to you and save articles with myFT - See the latest comments on articles and share your opinions - Monitor your Markets Data portfolio and browse securities HOW TO ACCESS To gain full access to our award-winning content please sign in using your Financial Times account. FEEDBACK The FT app is supported for Android 5 and above. If you have any feedback on our app please email appfeedback@ft.com. To get support please chat with us at help.ft.com'),
(19220, 'Digg', 27, 13, 3, 16256, 3.9, 6105, 'Varies with device', 0.00, '2016-03-11', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/1cLhLnZgUG7jjtzPF1GvWKqSYBwdXNpJdblN31pTs7XIwYL2lDInl680gjC7_F1tdQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.churchlinkapp', 'The Tithe.ly Church App is the leading container app serving nearly 4k churches. Tithe.ly Church App offers a completely customized app experience for churches and their congregations. Download the app for free and select your church to get started! If your church is not on Tithe.ly please go to https://get.tithe.ly/church-app and signup today! What does the Tithe.ly Church App offer my church? - Customized app icon to match your church brand. - Listen & download sermon audio and podcasts. - Watch your church\'s live stream and recorded videos. - Event and calendar information and add them directly to your device or share them with a friend. - Use your church\'s Prayer Wall to post and reply to prayer requests. - Read Blog entries or bulletins posted by your church or pastor. - View photos posted by your church or ministry. - Keep up to date on your church\'s Facebook & Twitter streams. - Receive important alert push notifications. - Map integration to your church and church events. - Add bulletins and announcements. - Free E-Giving and instant one click access. - More!'),
(19224, 'Bloomberg: Market & Financial News', 27, 17, 1, 2101, 4.2, 61692, '27M', 0.00, '2018-07-25', '5.9.1.1347176.a3ca6ab274', '4.4 and up', 'https://play-lh.googleusercontent.com/_qTb7fdtj18tYn1AyKLX1-kGvhzgJctx9sHpxk95ktK0hn9ruGnkJZCRp39Asp1kG4A=s180-rw', 'https://play.google.com/store/apps/details?id=com.bloomberg.android.plus', ''),
(19225, 'Haystack TV: Local & World News - Free', 27, 13, 2, 5518, 4.3, 3684, 'Varies with device', 0.00, '2018-08-02', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/quNQpqZtI80aB66Lhpv1JpeaDARgEaJvW22pxLLl3hAvTY419jiNWOj0gcvtaUbCj83p=s180-rw', 'https://play.google.com/store/apps/details?id=air.unlimitskillshero', 'Tactical RPG a game about Isekai hero made by pixel style. Using different skills to save this fantasy world. As a hero you are not bound by the world. There is no any limit you could develop your hero as you wish. There is an infinite number of combinations of skills. Using skills to save the world! 1 600+ Skills ! A variety of types of skills working by fighting position adding hero\'s abilities working when attack working after the end of the battle. Hundreds of skills can be chosen 2?A variety of heroes. All Heroes can be freely developed. There is no limit at all. Try to create different heroes. 3?Monsters Upgrading a variety of Arms Skills the features of RPG game are included 4?A variety of Class warriors magicians choose what you want 5?Choose a Formation position strategic battle 6?Battle automatically?don\'t need to keep tapping 7?Sky Arena challenge 999 floor! 8?Collect stage treasures to strengthen abilities! 9?No daily tasks relaxed and stress-free! Come to create your heroes! Create your heroes!'),
(19226, 'ABC News - US & World News', 27, 15, 2, 11819, 4.0, 18976, '35M', 0.00, '2018-06-06', '3.19.11', '5.0 and up', 'https://play-lh.googleusercontent.com/uIEvqGwiiESWPzsoyIpfgSTIs3Go9JQ2Nmn84k6rLn2Xirkwk43HEGXepIeo0ehPFQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.rvappstudios.abc_kids_toddler_tracing_phonics', 'Looking for a fun free and simple educational app to help your toddler learn phonics and trace letters of the alphabet? Look no further than ABC Kids. ABC Kids is a free phonics and alphabet teaching app that makes learning fun for children from toddlers all the way to preschoolers and kindergartners. It features a series of tracing games to help kids recognize letter shapes associate them with phonic sounds and put their alphabet knowledge to use in fun matching exercises. Any toddler kindergartener or preschool age child can learn English and the English alphabet simply by following the arrows with their finger. They can even collect stickers and toys as they complete tracing games! ABC Kids is more than just a kid-friendly educational app it was designed with adult participation in mind too. The interface keeps toddlers focused on alphabet reading and writing tucking menu commands away from moving fingers. Adults can easily access settings to engage Teacher Mode look at report cards or toggle tracing and phonics games to better facilitate learning. Best of all ABC Kids is full-featured and free from in-app purchases and third party advertisements. Toddlers and adults can enjoy learning together without interruption. Features: - A colorful early education app that helps children learn the English alphabet. - Includes ABC tracing games phonics pairing letter matching and more. - Uppercase and lowercase letters to trace listen to and match. - Smart interface helps kids focus on phonics and letters without accidentally exiting the game. - No third party ads no in-app purchases no tricks. Just pure educational fun! Note to Parents: When creating ABC Kids we wanted to build the best experience possible for both adults and for children. We\'re parents ourselves and we know how paywalls in-app purchases and intrusive third party advertisements can detract from the learning experience. With ABC Kids we put the features of a paid app into a preschool friendly package leaving out frustrating pop-ups and microtransactions. The end result is exactly the educational experience we want for our children. We think you and your family will enjoy it too! - Best wishes from the parents at RV AppStudios'),
(19229, 'AP Mobile - Breaking News', 27, 15, 2, 1015, 4.5, 76677, '4.6M', 0.00, '2017-05-25', '4.4.3', '4.0 and up', 'https://play-lh.googleusercontent.com/do_q6xxPxRJOmkVLvheBZlmkDUyixNoRMO_0kz8Rlz3ucG78I9bJLj6HdA-h8YH4MQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.ap24x7.news.android', 'The official AP 24x7 news app brings you the latest Stories and articles from AP 24x7 newsrooms. Stay connected with the latest news from telugu states and around the world. Get easy access to our live TV and social media platforms. Our brand new app is faster and lighter to ensure the smoothest reading experience. The app is available in both Light mode and Dark mode Read -Breaking news top stories from telugu states and around the world. -Alerts to keep you up-to-date on the lastest news -Share via SMS WhatsApp Facebook Twitter e-mail Telegram and more App Features - Alerts/Notifications - opt-in or opt-out of alert notifications. - Mode - Available in Dark Mode and Light Mode. - Bookmarks - Save articles you like and read them offline. - Live TV - Access to our Live TV through App.'),
(19235, 'AC - Tips & News for Android', 27, 15, 2, 13043, 4.2, 23292, '14M', 0.00, '2018-05-24', '3.1.12', '4.1 and up', 'https://play-lh.googleusercontent.com/HQCTPahU80dhtw9BlESBuQN2w6LQpNTcF2ckv08CULhDBunQOwAwrrvUlDKma_c5Ww=s180-rw', 'https://play.google.com/store/apps/details?id=tips.animalcrossing', 'AC Fan is an online community with hundreds of thousands of people who play Animal Crossing - New Horizons (ACNH). Join the community to explore people\'s islands buy & sell your items meet wonderful people and make friends. What you can get from the community? 1. Get notifications for high turnip prices to make millions of bells 2. Buy & sell any in-game items with other players 3. Complete guide tool for all items recipes and villagers How can you contribute to the community? 1. Host turnip queues when you get high prices 2. Host giveaway events when you have extra items 3. Post your island photos or design ideas to inspire others We are here to make a positive healthy community for all the ACNH players around the world. Please send feedback to tips.animalcrossing@gmail.com Thanks.'),
