(19253, 'Air Traffic', 24, 15, 1, 17021, 4.3, 14110, '6.8M', 0.00, '2018-07-24', '4.3', '5.0 and up', 'https://play-lh.googleusercontent.com/-VG7nafiBT1kPQ_hLzoAb4Qjv0HWSS0lcVoFZ_oQL8UWNFm6VhEw78o5sRwxfAqgZWCJ=s180-rw', 'https://play.google.com/store/apps/details?id=com.i6.AirPlaneBusPilotSimulator', 'Come join in on the fun with the best commercial airplane flight simulation on the store! Try out airplane pilot flying skills and transport hundreds of passengers across the huge open world to fly in! Get right into the action and pilot the very best airplane and take to the skies! +Realistic 3D plane used in real life +Incredible HD Graphics +Fun animations and real landing sequences +Beautiful huge open world environment to explore and fly around in if objectives aren\'t your style +Easy to play game controls both tilt and mobile button controls +Clear realistic pilot user interface with accurate in-flight panels +Dynamic and exciting HD camera angles Air Plane Bus Pilot Simulator simulates real world elements: - Weather forecast: clear sky rain thunderstorms - Turbulence - Day and night cycle - Plane crashes and smokes effects.'),
(19263, 'Czech Public Transport IDOS', 24, 15, 1, 9774, 4.3, 26014, '7.7M', 0.00, '2017-11-06', '2.4.1', '4.0.3 and up', 'https://play-lh.googleusercontent.com/vx897PChNKC1To8HupFX9zU_AwRuvnu0RMeWfkP-rVnCyedL6t73LTOVsgFH-qXOY7w=s180-rw', 'https://play.google.com/store/apps/details?id=ch.dnastudios.towerofbabel', '#A smartphone is required to play this game. Tower of Babel is a great online game made by DNA Studios playable on AirConsole. It s simple to play and there are only a few rules. When you have some time off feel free to enjoy every second! This fun game allows you to quickly involve everyone in your group. Tower of Babel is different and original. It was created for people who want to make the most out of the time they spend together. The main rule of the game: just build a tower! You are not cooperating with the other players but you are competing against one another. All players will build the same tower. When you drop the blocks you have to be really careful otherwise the tower will come crumbling down. The player who breaks it will lose the game. So your goal is to stay safe and build wisely while trying to give your opponents a hard time and \'helping\' them to crash it. About AirConsole: AirConsole offers a new way to play together with friends. No need to buy anything. Use your Android TV and smartphones to play multiplayer games! AirConsole is fun free and fast to get started. Download now!'),
(19270, 'GPS Speedometer and Odometer', 24, 15, 1, 2705, 4.8, 15865, '3.3M', 0.00, '2018-08-03', '10.0', '4.1 and up', 'https://play-lh.googleusercontent.com/pwoXwTOFjTRDhhGugpChmVve-CI7fpw5ytrzeZP0w-5OcbzITkYqTkPsX5bQtv3AEN0=s180-rw', 'https://play.google.com/store/apps/details?id=com.caynax.sportstracker', 'Stay fit - track value of distance speed burned calories steps (pedometer) and much more during running cycling walking rollerskating and other sports and fitness activities. Lose body fat and improve cardiorespiratory fitness with Caynax GPS Sports Tracker. ? Fast light and user-friendly app. ? No registration needed. ? Small size (below 10MB). ? Supports over 30 languages ? All for free. Main features: - Application uses Android device GPS(BEIDOU GLONASS) to track your activity. - Track your progress live on map (Google Maps or OpenStreetMap). - Record the activity route. - Use TTS (Text To Speech) to get voice information about workout duration distance speed burned calories pace and more. - Auto pause - app will automatically pause when you are not moving. - Set workout goals (time or distance) to improve your stamina. - Use dark view in the evening or during strong sun exposure - Share your activities on social networks (Facebook Google+ etc.) - Browse workouts history (+ store application data on GoogleDrive). - Monitor your workouts statistics - compare your results in daily weekly and monthly intervals. - Customize workout dashboard to display information most important to you. - Add activities to schedule to create reminders (notification). - Take photos in interesting places and view them on the map. - Metric (meters kilometers) and imperial (miles yards) units support - Android Wear support - Import/export workout to GPX and TCX format Available indicators: Distance Speed Steps Duration Movement Time Calories Altitude Pace Ascent Descent Available sports and fitness activities: Cycling Running (Jogging) Hiking Swimming Nordic Walking Cross country skiing Kayaking Rollerskating Rowing Skateboarding Skating Snowboarding Wheelchair Motorbiking Scooter Mountain biking Stand Up Paddling (SUP) Horse riding. Application contains in-app advertisements.'),
