(19280, 'FindShip', 24, 15, 1, 5665, 4.2, 23279, '8.5M', 0.00, '2018-04-26', '5.2.10', '4.1 and up', 'https://play-lh.googleusercontent.com/9y-x2w6BgLCynVCNfGLLAVk9WCZNap0AYI2l_wFIr13gJFQoi1Oj49t7b0xdXVAvpSE=s180-rw', 'https://play.google.com/store/apps/details?id=com.GAMEsPORT.QiPro', 'IQ Pro is the result of 6 months worth of work to develop an intelligence quotient test as precise as possible. It was calibrated on more than 2000 individuals and gives the most reliable measure possible based on the Raven matrices. Answer the 40 questions in the given time without any help or any exterior disruptions to get your result. You\'ll then be able to share it with your friends and to compare it with them as well as with your favorite celebrities. It was created alongside a psychologist specialized in intelligence quotient tests.'),
(19293, 'A Call From Santa Claus!', 16, 15, 1, 16448, 3.9, 3720, '11M', 0.00, '2016-12-04', '4.2.3', '4.0.3 and up', 'https://play-lh.googleusercontent.com/ObT64R18cmhTbFS57p6xF_peyOOyfArqpbYk2h_iVrWyKyeKCO5Ze89cUUqBfWpUzds=s180-rw', 'https://play.google.com/store/apps/details?id=com.zibma.campusapp.abchikhli', 'A B School Chikhli Android App for their Students Parents & Teachers to View & Download Institute Information. Students & Parents can View Daily Attendance Daily Homework Download Assignments Send Queries View Timetable Academic Activities and many more things. Staff can Fill Attendance Set Homework. View Own Attendance Manage Queries and many more things.'),
