(19297, 'Akinator', 16, 18, 3, 4475, 4.3, 1805398, '55M', 0.00, '2018-06-11', '6.5.2', '4.4 and up', 'https://play-lh.googleusercontent.com/rjX8LZCV-MaY3o927R59GkEwDOIRLGCXFphaOTeFFzNiYY6SQ4a-B_5t7eUPlGANrcw=s180-rw', 'https://play.google.com/store/apps/details?id=com.digidust.elokence.akinator.freemium', ''),
(19298, 'Dog Sim Online: Raise a Family', 36, 16, 3, 14846, 4.6, 94989, '74M', 0.00, '2018-04-22', '8.6', '4.0 and up', 'https://play-lh.googleusercontent.com/-Kb7sgVi2bc9bzEgx0Sd52QuIQ8ZCg8ryT_RgZXW7UB-hVKjdCNZDH0MXGXIFCxs9Q=s180-rw', 'https://play.google.com/store/apps/details?id=com.turborocketgames.dogsim', 'Live the life of a dog in this online RPG adventure - choose from your favorite dog breeds explore a massive 3D world and raise a family of puppies with Dog Sim! Adventure as your favorite dog breeds in this new animal simulator. Join online multiplayer games to play with friends as you battle enemies and explore the 3D world. Build a family to pass on your genes and unlock all dog breeds to become the most powerful dog! DOG SIM FEATURES: 3D SIMULATOR - RAISE A FAMILY - Animal breeding games: Bring 3D dogs to life with customizable breed name and gender - Build a family: Breed puppies to raise a whole family of dogs - Puppies are new characters that you can play as and customize - Unlock dog breeds with coins earned by leveling up and learn amazing facts about dogs FANTASY RPG GAMEPLAY - Animal simulator: Fight play and explore in this RPG animal simulator to feel what it s like to be a dog! - Adventure in this exciting simulation game complete with multiple dog breeds to choose from - Fight dangerous new bosses to protect your family and strengthen your dog - Unlock fighting achievements by hunting specific enemies and leveling up ONLINE MULTIPLAYER GAMES - Multiplayer games let you explore with dogs from around the world for a fun online adventure! - Adventure and play with friends to battle enemies and explore - Battle in online multiplayer games to prove your strength in fighting ADVENTURE IN A REALISTIC 3D WORLD - Adventure awaits in a whole new type of 3D map with 6 unique locations - Explore the city or countryside each with its own simulation of highly detailed real weather conditions - 3D markers let you easily navigate the world by zooming rotating and even using the compass - Real online multiplayer: Face new enemies and make allies from around the world WEATHER AND DAY/NIGHT CYCLE SIMULATOR - Our simulator gives accurate weather with detailed levels of rainfall and thunder - Play all day and night with a 24-hour based time system. For every minute played a full in-game hour passes CLANS and LEADERBOARDS - Form clans and fight other online players in Clan Wars - Leaderboards rank the best players by clan war points level and duels - See when friends are online to join their dog pack SAVE YOUR ADVENTURE - CLOUD SAVING - Your adventure is important! Use the Cloud to back up characters when you register with an account. - Never lose your progress or miss a save with continuous gameplay across all of your devices. YOUR FAVORITE DOG BREEDS - Husky - Dalmatian - Daschund - Doberman - Boxer - German Shepherd - And many more! Build a family and choose from your favorite dog breeds in this free animal simulator! Download Dog Sim Online and raise your dog family today! Have fun playing Dog Sim! If you have any suggestions or ideas for the game - contact us please: support@turborocketgames.com We are getting happier with each of your email message. Please note that we are in no way affiliated with any other animal simulator games developed by other game companies.');
