(19299, 'Color by Number - Draw Sandbox Pixel Art', 16, 15, 1, 8710, 4.6, 10247, '15M', 0.00, '2018-07-27', '1.3.13', '4.1 and up', 'https://play-lh.googleusercontent.com/-xdHrNOyfIphDsdtxDTtG30UiA-22q-NNTOK_rWYz1Wqb8V7g6m2rAg-hAStuk70hd4=s180-rw', 'https://play.google.com/store/apps/details?id=com.miagames.aa', 'AA Crazy is a game which has 1200 great levels The design of game is simple everyone can play included a big ball in the center and attack other small balls in this body. Each level of AA Crazy game have many small balls in the queue player much be touch on screen to shoot there ball into the big ball so as not to be collide the other balls or impediments. Let\'s download and enjoy AA Crazy'),
(19300, 'A+ Mobile', 18, 11, 1, 12489, 3.9, 730, '6.3M', 0.00, '2018-06-26', '5.4.4', '4.4 and up', 'https://play-lh.googleusercontent.com/0LZn-mH8PZqM9e15YC2jRUj5Vmq8poJ9QV9oev5i5C8FY2vmuagyIy6MlzaCxctBTQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.cafe24.ec.plussmbm17109', 'Key Features Provide app-only coupons and discounts Provide auto login features See my order history Shipping info See shopping cart shipping info Push notifications for shopping mall news Share product info with SNS Customer Center'),
(19301, 'Build a Bridge!', 32, 17, 1, 2162, 4.6, 263454, '74M', 0.00, '2018-08-02', '2.1.1', '4.1 and up', 'https://play-lh.googleusercontent.com/5DApnEIJ-gBESRiNyrJN3fKmPjuUHZd6JPiJoQywJWtbn_r4mJIFizYREQYxDsOy1g=s180-rw', 'https://play.google.com/store/apps/details?id=com.boombitgames.BridgeLowpoly', '**Google Play Most Innovative Game 2017 - Winner** Test your engineering and improvisation skills in a puzzle game where the stakes are as high as they get. It is you who will construct bridges for cars trucks busses... And sometimes even monster trucks. Gather your wits and get on with the construction! During the planning phase the game presents itself with a simple 2D interface. It is there that you select the best materials for your bridge and connect the dots to make the most resilient structure you can. You can approach each level as a complex puzzle trying to be as efficient as possible and get the best solution. But don\'t be afraid to experiment too. You can just go crazy and construct something that looks outrageous but still somehow works. There\'s fun in both of these approaches. When you\'re done switch to the 3D mode and watch a car drive through your bridge. Will it hold? Or will you watch a spectacular crash? In addition to the normal mode the game features the easy mode for more relaxed gameplayed focused on creativity and improvisation. You can also use in-game hint system if things get too hard. With 86 levels plus hidden and bonus bridges to construct you will not run out of things to do quickly. Game features: - Different materials to build from - Wood Metal Cables - 86 levels of increasingly difficult puzzles - Varied detailed environments full of interactive elements - Multiple cars to test out your constructions - Realistic physics engine - Beautiful stylised art style - Available in 13 languages'),
(19303, 'Find a Way: Addictive Puzzle', 32, 14, 1, 17774, 4.8, 39480, '14M', 0.00, '2017-06-16', '4.1.1', '4.1 and up', 'https://play-lh.googleusercontent.com/VolBYsUdAN_znyVnDUw6jZyr1LX8yLEcJ8chI5N3-W9bxfTrQqRH48nUEku3Gt_seAU=s180-rw', 'https://play.google.com/store/apps/details?id=com.kate.find', ''),
(19305, 'Comptia A+ 220-901 & 220-902', 15, 11, 1, 7559, 4.4, 174, '5.7M', 0.00, '2018-04-19', '2.0.7', '4.1 and up', 'https://play-lh.googleusercontent.com/oMeYcD9NxZnS9VYn_tSFugnOw3lrs96WPuafGNw8fLmMTPYhSHWg2nLOkuRDfYAMDw=s180-rw', 'https://play.google.com/store/apps/details?id=com.kolmos.QSPRO2', 'Your device must have Bluetooth v4.0 (BLE) or better and Android v4.4 or newer. 1) Turn on your device Bluetooth. 2) Download the app to your phone or device open the download click install and open the app to be sure you have it. Once you are sure close the app. 3) YOU MUST turn on  Location  inside our app or you will not be able to connect. To do this you need to go into your  Application Manager : a Find and open  SETTINGS  b Find  Applications or Apps  and click on this. You should see a listing of all the apps you have installed on your phone. c Find  Annitori QS PRO  apps should be listed alphabetically so it will be near the top of the list d Click on  Annitori QS PRO 2  e You should see  Uninstall  and  Force Stop  as options if you are in the correct place. If you do not see these back out and correctly locate our app. f Once correctly in scroll down and you will see  Permissions . g Click on  Permissions  to open it. h You will see  Location  as an  on/off  option i Turn  Location  ON. It must be ON for the app to work! j After turning  Location  on back out of the App Manager to your home screen you are ready to go! 4) With the app closed begin pairing process listed in #5 below: 5) With the app closed start your motorcycle. This is very important you must start your machine BEFORE you open the app so that the BT on the shifter is searching as you open the Annitori App to connect. 6) After the bike is started open the app and you will first see an image of our QS PRO and then the setting page at left. Click  SCAN  at the top left so the app will begin searching for the shifter. 7) You will see your  MAC  address pop up this is the number that appears in the box as in this image. This number is the unique number that identifies your QS PRO shifter. When this appears the app has found your shifter. 8) Click on the  QS PRO / MAC address.\' Do not click on close this will stop the process. 9) When the app has connected with the shifter it will show the screen here with  Found Click Read  in the status bar. 10) Note that the settings are not correct. No direction is clicked Sensitivity is at 5 Kill Time at 1ms RFX at 1. These are NOT settings you would ever use with our shifter so you know you are not yet reading your QS PRO. Connected and Reading are TWO DIFFERENT things! 11) Click the center READ button. It will take a second or two to gather the information from the processor (if not click READ again) and you will see the image displayed (or your personal settings) at left. 12) Note that when the read is correct and actual you will see the STATUS as  Ready  the Firmware will show a version number and the Sensitivity Kill Time and RFX will all have realistic values. Now you know you are connected. If you do not see these you are NOT reading the shifter and need to start the process over again. 13) If ever in doubt simply exit the app and start over this whole process takes 10 seconds. In fact we STRONGLY recommend that after any settings change or use of the app when done EXIT the app completely. This way you know you are out and can only come back in from the start. You will know you are coming in from the start if you see the image of our shifter first when you open the app. If ever in need of help contact us always happy to assist you! 14) You are now ready to make changes to your QS PRO settings 15) The shifter comes pre-set with both directions Enabled 60 Sensitivity 55ms for Kill Time and RFX 18. 16) NOTE: RFX should be at 18 and always left at 18 unless you are having problems and have been in contact with our Customer Service directly. They will instruct you to make any changes otherwise leave RFX at 18 and never change it. 17) As you can see making changes are now very simple to do! 18 ) When you have your choices made click UPLOAD after which the status will return to  Ready.\''),
(19307, 'Azar', 13, 18, 4, 6588, 4.2, 1092337, 'Varies with device', 0.00, '2018-07-24', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/UGnF6w2YBMtpoPs7sslQXbkNz7d_7yY0K_2iN4UpJMBm8SkoNQItXIzqs3oX4PuG97g=s180-rw', 'https://play.google.com/store/apps/details?id=com.azarlive.android', 'Azar is a video chat app that allows you to connect instantly with millions of like-minded people near you and around the world. You no longer need to wait for a match to happen; just swipe left to instantly create meaningful connections. ? With Azar you can: - have a funny encounter - have a deep conversation - make new friends If you are seeking a live connection in real-time this is your app. Azar is full of surprises. You never know who you might run into next. Download now and try it yourself! ? Connect with new people: - Start swiping now and connect with other users live - Use our filters to talk to the people you want to meet - Add different backgrounds filters and effects while chatting With Azar you can easily explore new cultures and meet people from all over the world. Connect and chat with other users to learn more about their personalities and lives. ? User Safety & Privacy: We has been focusing on better matching system and improving user experience based on technology since the beginning of its launch. With users being the most valuable asset we prioritizes in providing a safe environment for them leading to a comprehensive operation of the following three items from dedicated Azar Team. - User ecosystem: We\'re establishing a virtuous cycle among users by providing an easy reporting system which pops up prior to any abusive actions and compensating users for reporting. - Heuristic monitoring: Hundreds of agents perform 24-hour monitoring and work towards solving problems raised by users with unpleasant experience in the shortest time possible. To best protect users\' privacy the agents are not monitoring the matches directly. - Technology-based user management: With machine learning technology any inappropriate images are being filtered out prior to getting matched. Also AI technology is used to protect passive users with hesitance to reporting. Since AI technology recognizes images on the screen without going through a server it automatically questions the users who are likely to have had an unpleasant experience in order to induce reports. ? Other key features: - Add new people to your friends list and create meaningful connections - Use the history feature to find and resume chatting with previous connections - Don t be afraid of foreign languages! Our chat feature translates messages in real-time ? Want to learn more? Go to http://azarlive.com Find us on Facebook and talk to us there: http://www.facebook.com/azar.application Follow us on Instagram and leave us some likes: https://instagram.com/azar_official Need help with your Azar account or have suggestions for new features? Message us at https://help.azarlive.com/hc At Azar we believe that true connections come from a first glimpse a fun chat a good talk or simply from laughing together. This is why we seek to connect and introduce people from all over the world. Spontaneously connect with people with shared interests to have a good time and find some entertainment in real-time. This is what we designed Azar for. Azar provides a variety of in-app purchases and subscriptions that give you more control over who you can meet. If you choose to purchase an Azar subscription payment will be charged to your Play Store account after purchase confirmation. Your account will be charged the subscription amount within 24-hours prior to the end of the current period unless auto-renewal is turned off. Auto-renewal may be turned off at any time by going to your settings in the Play Store after purchase.'),
(19308, '4 in a Row', 6, 14, 1, 16123, 3.8, 4257, 'Varies with device', 0.00, '2018-05-13', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/xvheFH_R41Fcod_NwItJb-3IHKJWUUsH2HGrd_u6sO9MDsPp1jUcSjzDaoVJAR78F8Q=s180-rw', 'https://play.google.com/store/apps/details?id=com.youssefbrzdqdq.mypics', 'how to play 4 pics 1 word Quiz ? 4 pics 1 word Quiz its a puzzle game that test your knowledge to play 4 pics 1 word Quiz you need to guess the word by the 4 pictures what can you do if you stuck in a level ? there is 2 ways in 4 pics 1 word first way you can you use coins by sharing our game in social media second way you can buy coins in 4 pics 1 word you will start with 25 coins in 4 pics 1 word always check new levels'),
