(19328, 'Four In A Line Free', 6, 16, 1, 10698, 4.3, 133195, '11M', 0.00, '2018-06-11', '1.58', '4.1 and up', 'https://play-lh.googleusercontent.com/sp3OxndbMAolh68HZq9fXk06oFDc6iNU9w2oL3O9Nwx2ZYs97vvH48qBspKLwepqiA=s180-rw', 'https://play.google.com/store/apps/details?id=com.outofthebit.fourinarow', 'Connect 4 pieces of your colour in a line before your opponent. The popular game is now in your hands every time you can spare a moment for a challenge or a bit of relax. Excellent for testing your skills or teaching strategy to kids. Play multiplayer with a friend or try to beat our well-trained virtual players and see your improvements game by game. A classic! Start playing now for free! :) Follow us on our Social Media: TWITTER @outofthebit FACEBOOK/outofthebit INSTAGRAM/outofthebit'),
(19330, 'AutoCAD - DWG Viewer & Editor', 31, 17, 1, 1468, 4.2, 145088, '24M', 0.00, '2018-07-23', '4.5.19', '4.4 and up', 'https://play-lh.googleusercontent.com/W1b3d7Rfz-ulxWWhkMl9YLBGtVXgdnWpfmtVFZeBVv8IdMv0A8A7NdBRzdsPIYvAlis=s180-rw', 'https://play.google.com/store/apps/details?id=com.autodesk.autocadws', 'Take the power of AutoCAD wherever you go! AutoCAD mobile is a DWG viewing and editing app with easy-to-use drawing and drafting tools. View create and edit DWG files on mobile devices - anytime anywhere. Simplify your site visits with the most powerful CAD app and do real CAD work on the go. 7 Day Trial: Enjoy unrestricted access to all premium drawing drafting and editing tools. Current AutoCAD or AutoCAD LT desktop subscribers: Sign in with your Autodesk account to unlock all premium features for FREE. AutoCAD mobile is accurate fast and offers an abundance of features. Upload and open 2D DWG drawings and view all aspects of your DWG file including external references (xrefs). Extend your workflow across platforms easily access data and DWGs from your desktop web browser and mobile device. You can even work offline without an internet connection taking your CAD drawings with you in the field and beyond. Simplify your client meetings and construction site visits with the most powerful CAD app and do real CAD work on the go. An ideal app for architects engineers construction professionals field technicians and contractors. Easy to use as a DWG editor and viewer regardless of CAD software experience. Features - View and edit DWG files from device storage email or external cloud storage like Google Drive Dropbox and OneDrive - Create new CAD drawings on the fly - CAD editor - Modify and mark-up AutoCAD drawings - Import values from Leica DISTO - Draw and edit shapes using object snap and keypad input - Advanced technical drawing and editing tools such as arc offset and more! - Select move rotate and scale objects. View coordinates and properties - Work offline and sync your changes once back online - Manage layers- create new layers lock rename or delete layers - Blocks- Move and duplicate existing blocks Key Benefits - Be more productive in the field by working with the latest drawings - Safeguard drawings in your free Autodesk account or with your own external accounts - Collaborate in real time and reduce mistakes and re-work - Replace blueprints at job sites with drawings on your mobile device - Work seamlessly across platforms- from desktop to mobile and back to desktop Upgrade to Premium or Ultimate to maintain access to all editing tools. AutoCAD mobile subscriptions are available in the following options: - Premium monthly for $4.99 - Premium annual for $49.99 (save $9.89 vs. monthly subscription) - Ultimate annual for $99.99 - Included free with AutoCAD and AutoCAD LT desktop subscriptions - Available free for Student Autodesk accounts All new users automatically get a free trial of the premium version for 7 days. Subscriptions will be charged to your credit card through your Google Play account. Subscriptions are automatically renewed unless cancelled at least 24-hours before the end of the current period. You will not be able to cancel a subscription during the active period. Manage your subscriptions in Account Settings after purchase. *Free products and services are subject to the Autodesk Inc. terms of use that accompany them. Stay connected! Follow us on: Autodesk.com Facebook @AutoCADmobileapp Twitter @AutoCADmobile Terms of use'),
(19333, 'Fortune City - A Finance App', 18, 14, 1, 1715, 4.6, 49275, '91M', 0.00, '2018-07-17', '2.0.3.1', '4.4 and up', 'https://play-lh.googleusercontent.com/g2hqZgdX9q3iv-xosSsr41jZJQMDk8AizKhqlvhWmmANz9CFgHgn6hu8_eEI70iXPUw=s180-rw', 'https://play.google.com/store/apps/details?id=com.app.pointskw', 'The easiest online shopping platform in Kuwait.'),
(19334, 'Draw A Stickman', 2, 15, 1, 14554, 3.4, 29265, '17M', 0.00, '2017-05-19', '1.1.0', '4.0.3 and up', 'https://play-lh.googleusercontent.com/Tx_udBObKVDFciAy8fWDanQkF3PVBdQudAt6_SuG1zvt3LjHZp19kWNUty6d_OgV8zg=s180-rw', 'https://play.google.com/store/apps/details?id=com.timeplusq.drawnguess', 'Draw N Guess Multiplayer is one of the best competitive multiplayer games. This game is all about drawing and guessing the word online with your friends and family. The fun begins when you get connected with thousands of people around the world and start playing with them. An exclusive mobile game that can be played by anyone anytime and anywhere in the world while talking with them through group voice chat. The objective of Draw N Guess multiplayer game is one player has to draw the word and the other players should guess the word and vice-versa. A turn based drawing and guessing game mode is also available which helps to express your artistic skills. So here you get to experience the craziness of the players with their funny guesses and sketches. Highlights: * A competitive multiplayer game providing a platform to exhibit your artwork * Best Pictionary type game * 2 to 6 players can play together online * Talk while you play through group voice chat * Play at your own pace in the turn based drawing and guessing game mode. * Unlock the distinct color sets paints crayons stickers smileys and variety of brushes for best painting and drawing experience. * Guess the word of the drawing based on the artistic skill of the painter. * Draw awesome doodles in the turn based game mode. * Start with a quick game and match up with the new players around the world. * Play with your friends and family in a party mode alongside chatting and talking with them. * Find new friends showcasing your drawing and appreciate each other through chat. * Get connected socially through Facebook and share your drawings if they are really cool. * Winning the games by completing the achievements fetches you precious trophies coins and powerups. * Playing really well automatically progress your way to top the global leaderboard. How to play ? Register an account by logging in using Facebook or Google. Or play as a guest. Click PLAY NOW --> QUICK GAME The fun begins here! If it s your turn to draw start drawing pretty pictures for the given word. If it s your turn to guess start making funny guesses. Beware!!! To win a round you need to be the first one to guess the word. So hold on tight and start making guesses! You get bonus points too if you play really well. The fun doesn\'t stop here. You can also play with your DRAW N GUESS friends online by clicking PLAY NOW --> PLAY WITH FRIENDS You can play live games with your family friends or other players from all around the world. Turn Based Game Mode: Enjoy the fun and addictive turn-based drawing and guessing game with infinite time on the clock in this mode. Sketch paint and show your creativity with colors. You can draw something for the given word and you could also guess what other artists have drawn and challenge your friends and family to find your drawing in this mode. If you have any queries or if you encounter any difficulty when playing Draw N Guess please drop a mail to us at support@timeplusq.com Sounds simple but it\'s unbelievable how amazingly fun and addictive Draw N Guess Multiplayer can become! So what are you waiting for? Download Draw N Guess Multiplayer and start having fun!!! If you like the Draw N Guess Multiplayer game please support us by rating the game.'),
(19335, 'Be A Legend: Soccer', 38, 15, 1, 10364, 3.8, 85763, '21M', 0.00, '2015-08-24', '2.8.0.17', '3.0 and up', 'https://play-lh.googleusercontent.com/SumhhXX49vE5CWW1PaBjOXBYWxzHIyOVyZiZfzoikCEoo5s5KLjJk01P0RmQoOtkxtc=s180-rw', 'https://play.google.com/store/apps/details?id=com.otoss.carwashsalon', 'Are you prepared to run the best car wash ever? Are you prepared to run the best gas station ever? If you like idle games - Be Car Tycoon game is best for you! In car idle construction tycoon business you build your own car wash and gas construction. Rule your car wash and gas station become the richest manager! Start with a small one and work on it to make it grow. Improve your car wash and control every aspect of the business. Build surrounding facilities to bring more cars to your town and offer them the most enjoyable experience. Extend car wash to increase the number of cars. Build the best gas station empire! Run the most famous gas station in the world! Will you invest your money in improving the facilities of your gas station? Or will you increase the price to earn more money? Take important decisions to create the best gas station. With the upgrade of gas stations your idle racing track will also be upgraded and you will also unlock different types of cars. If you like idle supermarket and idle car games you ll enjoy the Be Car Tycoon! More fun than the idle games named gym tycoon and Idle racing. Unlike the subway idle game this will be an upgraded version of the idle supermarket tycoon game you will get to create your own world-class car wash and gas station. An easy-to-play game but challenging. Start with a small car wash or gas station and take important business decisions to grow your tycoon. Run your small business into the best in the world! Features: - Super idle car wash game fun to play - More fun than the idle games named gym tycoon and Idle racing. - Amazing animations and great 3D graphics. - An upgraded version of the idle supermarket tycoon game. - Take important business decisions.'),
