(19337, 'Cat Sim Online: Play with Cats', 36, 16, 2, 14846, 4.6, 137198, '81M', 0.00, '2018-04-22', '3.7', '4.0 and up', 'https://play-lh.googleusercontent.com/N4n7lZBc7Il67KTD31RlqxQWKxVxdZIwdEEBNQnJ8iYw7eiZdsVALBrvZX8nlxebv5VM=s180-rw', 'https://play.google.com/store/apps/details?id=com.turborocketgames.catsim', 'Live like a cat or kitten and raise a family of your favorite cat breeds in Cat Sim Online a new RPG adventure set in a massive 3D world! Explore the big world for yourself as one of the many popular cat breeds and make a new adventure! Play with friends in online multiplayer games and form clans to battle enemies to keep your family safe. Unlock new cat breeds as your family grows and play with cats in Cat Sim Online! Cat Sim Online Features: Cat Games - Raise a Family - Animal simulator: Customize each cat by name gender fur color clothes and more! - Breeding: Watch the family tree grow as your generations of cats expand! - Raise a family by having new kittens and continue the family legacy - Cat breeds can be unlocked with coins earned by leveling up as you explore the world - Become pregnant: help the mom the give a birth! 3D RPG Games - Adventure & Battle Enemies - Adventure in this new cat simulator full of your favorite cat breeds - Battle against dangerous enemies in simulator games to know how a cat fights - Unlock fighting achievements when you take down specific enemies Explore the Massive 3D World - Adventure calls in this 3D simulator full of unique locations to travel - Explore the world from the city to the countryside and experience simulated weather conditions - RPG games come with a map that is easy to navigate - just zoom or rotate the compass Online Multiplayer Games - Play with friends in online RPG games and share the glory as you defeat enemies - Multiplayer games make fighting enemies and protecting your family easier - Battle in online adventure games and prove your strength against others Clans & Online Leaderboards - Adventure in clans with other online players and battle in the Clan Wars - Online leaderboards rank the best cat by level clan war points and battles won - Clans members can see when other players are online and join their adventure Raise a family explore a massive 3D world and battle enemies solo or in online multiplayer games! Play free cat games and make your own adventure in Cat Sim Online! Download today and start playing as your favorite cat breeds! We are happy to receive any of your suggestions or ideas for the game - please contact us at: support@turborocketgames.com Please note that we are in no way affiliated with any other animal simulator games developed by other game companies.'),
(19338, 'Four In A Line', 6, 15, 1, 10698, 3.8, 22191, '3.0M', 0.00, '2015-05-04', '1.10', '2.3 and up', 'https://play-lh.googleusercontent.com/sp3OxndbMAolh68HZq9fXk06oFDc6iNU9w2oL3O9Nwx2ZYs97vvH48qBspKLwepqiA=s180-rw', 'https://play.google.com/store/apps/details?id=com.outofthebit.fourinarow', 'Connect 4 pieces of your colour in a line before your opponent. The popular game is now in your hands every time you can spare a moment for a challenge or a bit of relax. Excellent for testing your skills or teaching strategy to kids. Play multiplayer with a friend or try to beat our well-trained virtual players and see your improvements game by game. A classic! Start playing now for free! :) Follow us on our Social Media: TWITTER @outofthebit FACEBOOK/outofthebit INSTAGRAM/outofthebit'),
(19360, 'Hay Day', 11, 19, 1, 13764, 4.5, 10053186, '94M', 0.00, '2018-06-28', '1_39_93', '4.0.3 and up', 'https://play-lh.googleusercontent.com/oXMNc6gaZK-bDdP8UfR4utJVcuLD-nzA6x0GSa4aowFW_zQ-8NfrkOJis09DUsoFEQ=s180-rw', 'https://play.google.com/store/apps/details?id=com.supercell.hayday', 'Welcome to Hay Day. Build a farm fish raise animals and explore the Valley. Farm decorate and customize your own slice of country paradise. Farming has never been easier or more fun! Crops like wheat and corn are ready to be grown and even though it never rains they will never die. Harvest and replant seeds to multiply your crops then make goods to sell. Welcome animals like chickens pigs and cows to your farm as you expand and grow! Feed your animals to produce eggs bacon dairy and more to trade with neighbors or fill delivery truck orders for coins. Build a farm and expand it to its fullest potential from a small-town farm to a full-blown business. Farm production buildings like Bakery BBQ Grill or Sugar Mill will expand your business to sell more goods. Build a Sewing Machine and Loom to create cute outfits or a Cake Oven to bake delicious cakes. The opportunities are endless on your dream farm! Customize your farm and decorate it with a wide variety of items. Enhance your farmhouse barn truck and roadside shop with customizations. Decorate your farm with items like a panda statue a birthday cake and instruments like harps tubas cellos and more! Decorate with special items - like flowers to attract butterflies - to make your farm more beautiful. Build a farm that shows off your style and inspires your friends! Trade and sell items in this farming simulator by truck or steamboat. Trade crops fresh goods and resources to in-game characters. Swap goods to gain experience and coins. Level up to unlock your own Roadside Shop where you can sell more goods and crops. Expand your farming experience and play with friends in the Valley. Join a neighborhood or create your own and play with a group of up to 30 players. Exchange tips and help each other create amazing farms! Download today and build the Best. Farm. Ever! Hay Day Features: Build a Farm: - Farming is easy get plots grow crops harvest and repeat! - Customize your family farm to be your own slice of paradise - Enhance your farm with production buildings like a bakery feed mill and sugar mill Crops to Harvest & Grow: - Crops like wheat and corn will never die - Harvest seeds and replant to multiply or use crops like wheat to make bread Animals: - Quirky animals are waiting to be added to your farm! - Chickens horses cows and more are waiting to join your farm - Pets like puppies kittens and bunnies can be added to your family farm Places to Visit: - Fishing Lake: Repair your dock and cast your lure to fish the waters - Town: Repair the train station and go to town to fulfill town visitors  orders - Valley: Play with friends in different seasons and events Play with Friends and Neighbors: - Start your neighborhood and welcome visitors! - Trade crops and fresh goods with neighbors in-game - Share tips with friends and help them complete trades - Compete in weekly derby events with your neighbors and win rewards! Trading Game: - Trade crops fresh goods and resources with the delivery truck or even by steamboat - Sell items through your own Roadside Shop - Trading game meets farming simulator Download now and build your dream farm! Neighbor are you having problems? Visit https://supercell.helpshift.com/a/hay-day/?l=en or contact us in-game by going to Settings > Help and Support. Under our Terms of Services and Privacy Policy Hay Day is allowed for download and play only for persons 13 years or over of age. PLEASE NOTE! Hay Day is free to download and install. However some game items can also be purchased for real money. If you do not want to use this feature please set up password protection for purchases in the settings of your Google Play Store app. A network connection is also required. Privacy Policy: http://www.supercell.net/privacy-policy/ Terms of Service: http://www.supercell.net/terms-of-service/ Parent\'s Guide: http://www.supercell.net/parents/'),
(19410, 'Fruit Ninja', 3, 19, 1, 16317, 4.3, 5091448, '41M', 0.00, '2018-07-12', '2.6.7.487220', '4.1 and up', 'https://play-lh.googleusercontent.com/g6XSinaifCu3PTrfHnlKT29uWTezsaQ7ve7xeXuatFGJBG5zD78H-rxeL-MLwGdySww=s180-rw', 'https://play.google.com/store/apps/details?id=com.zhgames.fruitmaniatravel', 'Fruits Mania : Travel is the best enjoyable 3-match puzzle game HOW TO PLAY - Swipe and match 3 or more fruits. - Collect the fruits to complete each level! - Achieve 3 stars to get more coins! FEATURES - MATCH 3 FRUIT PUZZLE - A delicious matching puzzle game with addictive levels! - EASY AND FUN PLAY - Easy to learn yet hard to master. - NO TIME LIMIT - Play as you want - NO NEED WIFI - NO NEED INTERNET - Play whenever you want online and offline! - 7 Days Events! - Play everyday to get more prizes. NOTES - Fruits Mania : Travel contains ads like banner interstitial video and house ads. - Fruits Mania : Travel is free to play but you can purchase In-app items like AD FREE and coins. SUPPORT UNIVERSAL APP - Enjoy the game on various devices (phones and tablets). E-MAIL - zhgames3@gmail.com [Optional Permissions] - Photo / Media / File: required storage access permission to save game data [Permission setting and withdrawal method] - Android 6.0+: Device Settings> Application Management> Select App> Revoke Access Have Fun :)'),
