users to continue protecting their Android devices with our software in full confidence of their data\'s safety and security.'),
(19426, 'Bad Piggies', 32, 18, 1, 13685, 4.3, 1168959, '66M', 0.00, '2017-05-03', '2.3.3', '4.1 and up', 'https://play-lh.googleusercontent.com/rm6aE6_mUV6PR8RafGMYicsyjhiE-7SInpzvLCq0bLoX7j22u244EF1HhaEIzjVw_kk=s180-rw', 'https://play.google.com/store/apps/details?id=com.gplayer.gplayeriptvbox', 'G Player App is Media Player App For Android TV Android Phone and Android Tab.Fully Customizable'),
(19467, 'Dumb Ways to Die 2: The Games', 11, 18, 3, 9288, 4.2, 1671658, 'Varies with device', 0.00, '2018-07-12', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/GyhQeJuED2XI3AVFrC7ND0CxVfuQv18AAihKZ3Z8RxeVJHJUqgILjqff8qpZHApHJkk=s180-rw', 'https://play.google.com/store/apps/details?id=au.com.metro.dwjr.zany', 'Before the Dumb Ways characters grew up they were already making mischief in all sorts of places - planes trains and now at the hospital! Visit the cute and colourful Dumb Ways Hospital with Doctor Zany and explore three main areas of play: a waiting room full of surprises to discover a check-up room where children can play the role of doctor and an ambulance that visits the hospital featuring fun guest appearances from the original Dumb Ways cast! This app engages young children in a playful experience of caring for others. Join Doctor Zany any help keep the Dumb Ways characters safe happy and healthy! Features: - Perform check-ups on Boffo Loopy Madcap and Dumbbell - Discover the differences between each character s heartbeat blood pressure and more - Tap on the characters to see their personality! - Enjoy fun surprises - what happens if you leave Boffo on the waiting room chair? - Also features three original Dumb Ways characters to play with: Lax Doofus and Mishap! - Perfect for 3-7 year olds - Engaging characters support children s pretend play and story-telling - No in-app purchases - Play without wifi or internet'),
(20153, 'AD - Nieuws, Sport, Regio & Entertainment', 27, 15, 1, 3436, 3.7, 10369, 'Varies with device', 0.00, '2018-07-28', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/7HORw7JLh36E_e_BpwMNSq8Zx0JQjp7E0Hjr7eDgdZnfq4mIpEoE3LlzvdNx3rAveQ=s180-rw', 'https://play.google.com/store/apps/details?id=be.persgroep.red.mobile.android.adn', 'AD brengt je internationaal nationaal en regionaal nieuws. We houden je op de hoogte van nationale en internationale topsport maar hebben ook aandacht voor sport in de regio zoals amateurvoetbal. En we vertellen je wat er speelt in de cultuur- en mediawereld en in showbizzland. De AD - Digitale krant app is de papieren krant maar dan op je beeldscherm. De app bevat alle regionale edities van vandaag en een archief vol oudere kranten. - Lees de editie van je eigen regio of kies uit alle andere edities. - Bepaal zelf hoe je wilt lezen: per pagina zoals de papieren krant of per artikel vanuit verschillende nieuwslijsten. - Eenmaal gedownload is de krant ook zonder internetverbinding te lezen en je kunt automatisch downloaden instellen. Edities AD Digitale krant bevat naast de landelijke editie ook alle edities voor deze regio s: - Alphen - Amersfoort - Dordrecht - Delft - Den Haag - Gouda - Hoeksche Waard - Rivierenland - Rotterdam - Utrecht - Voorne-Putten - Waterweg - Westland - Woerden - Zoetermeer Losse krant kopen of abonnement Heb je al een abonnement op het AD? Dan kun je gebruik maken van deze app door in te loggen met je AD-profiel. Ben je je inloggegevens vergeten of weet je niet hoe je moet inloggen? Kijk bij de veelgestelde vragen op ad.nl/service/faq. Of bel tijdens kantooruren met onze klantenservice via telefoonnummer 088- 0561 588. Wanneer je geen abonnee bent kun je de digitale krant aankopen via je Google Play account. Volg het AD op Social Media Blijf 24/7 op de hoogte door ad.nl te volgen op Facebook Instagram of Twitter. Facebook: https://www.facebook.com/AD.NL Instagram: https://www.instagram.com/ad_nl/ Twitter: https://twitter.com/adnl Vragen of suggesties? Heb je vragen of opmerkingen over de AD Digitale krant app of over AD in het algemeen? Neem gerust contact met ons op door een e-mail te sturen naar webcare@ad.nl. AD (Algemeen Dagblad) is een uitgave van DPG Media BV. Onze gebruiksvoorwaarden vind je hier: https://www.dpgmedia.be/gebruiksvoorwaarden En onze privacy statement vind je hier: https://www.dpgmedia.nl/privacy'),
(20481, 'Diary with lock password', 23, 16, 1, 16001, 4.3, 179139, '9.7M', 0.00, '2017-11-01', '3.5.3', '4.0.3 and up', 'https://play-lh.googleusercontent.com/HTX4QtnaIl6JT4jn6gb9MLCvU3fGkpYeyqqfKH_eRfZkO3gEr1EpxEnvjraT4nGWHW4=s180-rw', 'https://play.google.com/store/apps/details?id=com.adpog.diary', 'Use this diary app to make your own personal notes of daily events appointments secrets and feelings. FEATURES: - Password & pin code protection - Emojis via Quick access keyboard (requires Android 4.1 or higher) - Personalize background color (Pink Purple Blue ++) - Change text-size and font-style - Reminder - Easy to use - Search - Download backup (as text-file) - Sync between devices - Private & Secure cloud storage - The most downloaded diary app on Google Play! Build from the ground up to be simple and user friendly the user interface is designed to allow you to enter new notes quickly and easily. With this Diary you can write all your private notes and secure them with a pin code. Track and write about your daily activities Make it a habit to quickly write one or more mini-notes during your day. Simply leave a few words about your workout session what happened at school or in the office during your day. In weekends you can write about all the fun you had walking your dog meeting with friends or being social with your family. This can be the daily activity log you always have wanted. Make it your personal journal and have fun reading it over in few year and share a few laughs with your friends. As this app is pure textual and contains no images or photos it runs ultra fast and smooth on any Android device and consumes minimal of available memory and disk-space! Emojis If your Android phone support it you can use emojis in all entries. Decorate diary notes with beautiful heart and love emojis or popular sport or emotional face smileys. If the phone does not yet have native support for this we recommend you try downloading a third party emoji keyboard from Google Play. Bring your diary in your pocket! In 2016 it is simple for everybody to become a lifetime diarist. Follow millions of people join this popular diary trend. This diary is perfect to use as: Write your own Autobiography This diary app can easily fit the purpose of a writing down your memoir or chronicle. Keep a log or logbook to record history. Make a habit of doing daily records document your life in your own daybook. Setup a reminder to alert you when it is time to write. Protect all personal notes by adding a pin code when it starts up. Never worry about losing memories again. Easily send a backup of diary entries directly to email for extra protection.');
