(20739, 'Avakin Life - 3D virtual world', 34, 17, 3, 8467, 4.4, 1275373, '91M', 0.00, '2018-07-03', '1.021.10', '4.1 and up', 'https://play-lh.googleusercontent.com/W9A_DsiCT0LrRU4WJGqmmWYCBkFIH1tphp4RNp11LE8ywW1xxpMfDJvEN1oKsRqVgA=s180-rw', 'https://play.google.com/store/apps/details?id=com.lockwoodpublishing.avakinlife', 'Discover new dimensions of you! Join a 3D experience where you can make friends chat and dress up! Decorate and design your home visit dreamlike locations be anyone meet everyone and explore a virtual world! Play a 3D mobile role-playing game! Avakin Life s virtual universe lets you become the person you ve always wanted to be. Create an avatar as unique as you and join players from around the world. Enjoy weekly events and non-stop parties. Go on adventures and grab daily rewards. There s always something new to do. Who will you be today? Download to find out! Avakin Life lets you show the world your creativity. Dress your avatar in the latest virtual fashions then design your dream home - with apartments mansions space shuttles and more to choose from. Discover amazing brands and create your favorite outfit. Want to become a fashion star and show your designs? Jump into Fashion Contests then message your friends and party in paradise locations. Your Avakin. Your style. Your rules. CREATE YOUR UNIQUE AVATAR - Role-playing game where you can design your ideal character figure hair eye colour and explore unlimited ways to be you! - Dress your avatar how you want. Go cute or crazy - pick your favourite style and realise your wildest dreams. Anyone s possible! - A virtual world that lets you express yourself and your style every day! MEET REAL PEOPLE AND CHAT - Join Avakins from all around the world and adventure together. - Make new friends and build your crew! - Show off perfect outfits and dress in the newest trends. - Compete in Fashion Contests and explore brands and outfits! - Take pictures of your avatar and share on Facebook or Instagram! DEFINE YOUR STYLE - Express yourself with 28000+ Avakin clothing items and accessories. New outfits every week! - Build your wardrobe and create collections packed with stylish looks. - Dress up (or down) play with your style and amaze others with your sense of fashion. Whatever your mood there s an outfit waiting to be discovered. - Create unique looks with dresses suits shoes skirts bags jewellery clothing items and accessories. - Change hairstyles. Get a tattoo. Fly around in wings. Dress like a zombie! No barriers no judgements. - Become a fashion star and own the catwalk with dazzling poses that wow the crowds. DESIGN YOUR DREAM-HOME - From penthouses to castles. From the homes of your dreams to ones you re yet to imagine. Create your own space then invite friends over. - Decorate your home how you want - modern classic Hollywood style - whatever suits your mood or the latest fashion trends. - Host parties or just spend some quality time with your BFFs. Chill with pets or explore outer space in your personalised shuttle. THE 3D SIMULATION GAME - 3D virtual world where you can be anyone you want! - Create a second life and live adventures. - Choose your look clothes and accessories. - Become a fashion model and own your style. - Message friends and be the centre of attention. - Dress up discover new brands and shop for stylish outfits. - Role-playing game with hundreds of locations and ways to express your identity! Go to clubs the beach the stars and new places every week! - Dive into the world of Avakin Life now! FOLLOW US: facebook.com/AvakinOfficial/ instagram.com/avakinofficial/ Twitter @LockwoodLKWD Lockwood Publishing would love to hear your suggestions & feedback on how to improve our game! Send questions suggestions and ideas to https://avakin.com/community/ Visit us at http://www.avakin.com/'),
(23837, 'A+ Gallery - Photos & Videos', 30, 17, 1, 4587, 4.5, 223941, 'Varies with device', 0.00, '2018-08-06', 'Varies with device', 'Varies with device', 'https://play-lh.googleusercontent.com/3GHy-ITHHvu_BHBTdPRStespb8MX4ZWnQ_Iv7ZMTZFP3YMetZW6Z5fKI9a4j5ZSAqRge=s180-rw', 'https://play.google.com/store/apps/details?id=at.erstebank.securityapp', 's Identity - the new signing and login method for George and Telebanking Pro Secure fast and comfortable even without SMS. Download s Identity App and then start the change of the login & signing method in George via PC/MAC (settings). At the end of this process you generate the activation code for the App. Or start the activation in the George App at the product info screen. Available even with fingerprint or face recognition for login and signing. Get your activation code for Telebanking Pro from your administrator or your account manager. Login to George & co with your s Identity the smart way: Start signing in or log into internet banking and confirm this action in your s Identity app. Everything else is done automatically. Get started now.');
